eval("module.exports = {\"intro\":{\"level\":1,\"id\":\"ref1\",\"sidebarHeader\":\"Introduction & Quick Facts\",\"header\":\"Croatia\",\"elements\":[{\"tagName\":\"P\",\"html\":\"<strong>Croatia</strong>,  country located in the northwestern part of the <a href=\\\"/place/Balkans\\\">Balkan Peninsula</a>. It is a small yet highly geographically <a href=\\\"https://www.merriam-webster.com/dictionary/diverse\\\" data-dictionary-link-target=\\\"diverse\\\">diverse</a> crescent-shaped country. Its capital is <span></span><a href=\\\"/place/Zagreb\\\">Zagreb</a>, located in the north.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/09/6209-004-C4076F98.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/87/153487-004-B791CE7A.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"The present-day republic is composed of the historically Croatian regions of Croatia-<a href=\\\"/place/Slavonia\\\">Slavonia</a> (located in the upper arm of the country), <a href=\\\"/place/Istria\\\">Istria</a> (centred on the Istrian Peninsula on the northern <a href=\\\"/place/Adriatic-Sea\\\">Adriatic</a> coast), and <a href=\\\"/place/Dalmatia\\\">Dalmatia</a> (corresponding to the coastal strip). Although these regions were ruled for centuries by various foreign powers, they remained firmly Western-oriented in <a href=\\\"https://www.merriam-webster.com/dictionary/culture\\\" data-dictionary-link-target=\\\"culture\\\">culture</a>, acquiring a <a href=\\\"https://www.merriam-webster.com/dictionary/legacy\\\" data-dictionary-link-target=\\\"legacy\\\">legacy</a> of <a href=\\\"/topic/Roman-law\\\">Roman law</a>, the <a href=\\\"/topic/Latin-alphabet\\\">Latin alphabet</a>, and western European political and economic traditions and institutions. A part of <a href=\\\"/place/Yugoslavia-former-federated-nation-1929-2003\\\">Yugoslavia</a> for much of the 20th century, Croatia suffered considerably from the disintegration of that federation in the early 1990s. The European trajectory of Croatia was finally realized in 2013 when it joined the <a href=\\\"/topic/European-Union\\\">European Union</a>. As the Croatian Canadian scholar <span></span>Tony Fabijančić writes, Croatia’s <a href=\\\"https://www.merriam-webster.com/dictionary/tumultuous\\\" data-dictionary-link-target=\\\"tumultuous\\\">tumultuous</a> first years as an independent country also have obscured its centuries-long history:\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/22/183622-004-FDB652C6.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"Croatia (Hrvatska) is an ancient nation, yet a very young nation state. Once a <a href=\\\"https://www.merriam-webster.com/dictionary/formidable\\\" data-dictionary-link-target=\\\"formidable\\\">formidable</a> kingdom under Tomislav in the tenth century, a naval power in the sixteenth and seventeenth, and an awakening national entity in the nineteenth, it had to endure a thousand years of foreign meddling, subjugation, incursions, and outright wars before being recognized in 1992 as a distinct entity.\"}],\"writtenBy\":[\"Liz David-Barrett\",\"John R. Lampe\",\"Dijana Pleština\",\"C.W. Bracewell\"],\"isFilled\":true},\"facts\":[{\"header\":\"Official name\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"Republika Hrvatska (Republic of Croatia)\"}]},{\"header\":\"Form of government\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"multiparty republic with one legislative house (Croatian Parliament [151])\"}]},{\"header\":\"Head of state\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"President: Kolinda Grabar-Kitarović\"}]},{\"header\":\"Head of government\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"Prime Minister: Andrej Plenković\"}]},{\"header\":\"Capital\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"<a href=\\\"/place/Zagreb\\\">Zagreb</a>\"}]},{\"header\":\"Official language\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"Croatian\"}]},{\"header\":\"Official religion\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"none<sup>1</sup>\"}]},{\"header\":\"Monetary unit\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"kuna (kn; plural kune)\"}]},{\"header\":\"Currency Exchange Rate\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"1 USD equals 6.407 Croatian kuna\"}]},{\"header\":\"Population\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"(2017 est.) 4,139,000\"}]},{\"header\":\"Population rank\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"(2017) 128\"}]},{\"header\":\"Population projection 2030\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"3,878,000\"}]},{\"header\":\"Total area (sq mi)\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"21,851\"}]},{\"header\":\"Total area (sq km)\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"56,594\"}]},{\"header\":\"Density: persons per sq mi\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"(2017) 189.4\"}]},{\"header\":\"Density: persons per sq km\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"(2017) 73.1\"}]},{\"header\":\"Urban-rural population\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"Urban: (2015) 59%\"},{\"tagName\":\"DD\",\"html\":\"Rural: (2015) 41%\"}]},{\"header\":\"Life expectancy at birth\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"Male: (2015) 73 years\"},{\"tagName\":\"DD\",\"html\":\"Female: (2015) 80.4 years\"}]},{\"header\":\"Literacy: percentage of population age 15 and over literate\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"Male: (2010) 99.5%\"},{\"tagName\":\"DD\",\"html\":\"Female: (2010) 98.2%\"}]},{\"header\":\"GNI (U.S.$ ’000,000)\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"(2016) 50,491\"}]},{\"header\":\"GNI per capita (U.S.$)\",\"elements\":[{\"tagName\":\"DD\",\"html\":\"(2016) 12,110\"}]}],\"nodeMap\":{\"ref42760\":{\"level\":1,\"id\":\"ref42760\",\"sidebarHeader\":\"Land\",\"header\":\"Land\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The upper arm of the Croatian crescent is bordered on the east by the <a href=\\\"/place/Vojvodina\\\">Vojvodina</a> region of <a href=\\\"/place/Serbia\\\">Serbia</a> and on the north by <a href=\\\"/place/Hungary\\\">Hungary</a> and <a href=\\\"/place/Slovenia\\\">Slovenia</a>. The body of the crescent forms a long coastal strip along the <a href=\\\"/place/Adriatic-Sea\\\">Adriatic Sea</a>, and the southern tip touches on <a href=\\\"/place/Montenegro\\\">Montenegro</a>. Within the hollow of the crescent, Croatia shares a long border with <a href=\\\"/place/Bosnia-and-Herzegovina\\\">Bosnia and Herzegovina</a>, which actually severs a part of southern Croatia from the rest of the country by penetrating to the Adriatic in a narrow corridor.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/32/6232-004-D1DB8152.jpg\\\">\"}],\"sections\":[{\"level\":2,\"id\":\"ref42761\",\"sidebarHeader\":\"Relief\",\"header\":\"Relief\",\"elements\":[{\"tagName\":\"P\",\"html\":\"<span></span>Croatia is composed of three major geographic regions. In the north and northeast, running the full length of the upper arm of the Croatian crescent, are the <span></span><a href=\\\"/place/Pannonian-Basin\\\">Pannonian</a> and para-Pannonian plains. To the north of <a href=\\\"/place/Zagreb\\\">Zagreb</a>, the <span></span>Zagorje Hills, fragments of the <a href=\\\"/place/Julian-Alps\\\">Julian Alps</a> now covered with vines and orchards, separate the <a href=\\\"/place/Sava-River\\\">Sava</a> and <a href=\\\"/place/Drava-River\\\">Drava</a> river valleys.\"},{\"tagName\":\"P\",\"html\":\"To the west and south of the Pannonian region, linking it with the Adriatic coast, is the central mountain belt, itself part of the <span></span><a href=\\\"/place/Dinaric-Alps\\\">Dinaric Alps</a>. The <a href=\\\"/science/karst-geology\\\">karst</a> plateaus of this region, consisting mostly of <a href=\\\"/science/limestone\\\">limestone</a>, are barren at the highest elevations; lower down, they are heavily forested. The highest mountain in Croatia, Dinara (6,007 feet [1,831 metres]), is located in the central mountain belt.\"},{\"tagName\":\"P\",\"html\":\"The third geographic region, the Croatian littoral, is composed of the <span></span><a href=\\\"/place/Istria\\\">Istrian</a> Peninsula in the north and the <span></span><a href=\\\"/place/Dalmatia\\\">Dalmatian</a> coast extending south to the <a href=\\\"/place/Gulf-of-Kotor\\\">Gulf of Kotor</a>. Wedged between the Dinaric Alps to the east and the Adriatic Sea to the west, its 1,100 miles (1,800 km) of coastline are fringed by more than 1,100 islands and islets.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/12/6212-004-B43A1A54.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref42763\",\"sidebarHeader\":\"Drainage\",\"header\":\"Drainage\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Of the 26 rivers that flow for more than 30 miles (50 km) in Croatia, the <span></span><a href=\\\"/place/Sava-River\\\">Sava</a> and the <span></span><a href=\\\"/place/Drava-River\\\">Drava</a>, coursing through the Pannonian and para-Pannonian plains, are of particular importance—both because of their length and because, along with the Kupa River, they are in large part navigable. The Sava originates in Slovenia, passes Croatia’s capital city of Zagreb, and then forms most of the border between Croatia and Bosnia and Herzegovina along the inside of the Croatian crescent. The Drava enters Croatia from Slovenia and forms all but a small section of the border with Hungary before joining the <a href=\\\"/place/Danube-River\\\">Danube</a>, which in turn forms most of the border between Croatia and the Vojvodina province of Serbia. The <span></span>Kupa, which forms part of the frontier between Slovenia and Croatia, and the <span></span><a href=\\\"/place/Una-river-Europe\\\">Una</a> River, which meanders along part of the border between Croatia and Bosnia and Herzegovina, both flow into the Sava. In Dalmatia the <span></span><a href=\\\"/place/Krka\\\">Krka</a> and <span></span>Cetina rivers are of particular importance because of their hydroelectric potential and because they flow into the Adriatic Sea.\"},{\"tagName\":\"P\",\"html\":\"In addition, a great deal of water circulates in underground rivers and pools in the karstic regions of the central mountain belt and the littoral. These waters account for many of the unique geologic formations and the picturesque landscape of central and western Croatia.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref278417\",\"sidebarHeader\":\"Soils\",\"header\":\"Soils\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The Pannonian and para-Pannonian plains are enriched with alluvial soil deposited by the Sava and Drava rivers. These plains are the most fertile agricultural regions of Croatia and form the country’s breadbasket. The soil of the central mountainous belt is rather poor but offers some cultivable land in the fields and meadows and some grazing land in the plateaus. The Croatian littoral is mostly mountainous and barren, with rocky soil and poor agricultural land.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref42762\",\"sidebarHeader\":\"Climate\",\"header\":\"Climate\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Two main climatic zones dominate Croatia. The Pannonian and para-Pannonian plains and the mountain regions are characterized by a continental climate of warm summers and cold winters. In the plains, temperatures average in the low 70s F (low 20s C) in June and in the low 30s F (around 0 °C) in January—although they can range from a low of −5 °F (−20 °C) in the winter to a high of 105 °F (40 °C) in the summer. The central mountain regions of Lika and Krbava have slightly cooler summers and cold winters, with a milder climate in the valleys. The average temperature range is between about 65 °F (about 18 °C) in June and the upper 20s F (about −2 °C) in January. Considerable rainfall, turning to snow in winter, is characteristic of the region.\"},{\"tagName\":\"P\",\"html\":\"The Dalmatian coast, Istria, and the islands have a mild <a href=\\\"/science/Mediterranean-climate\\\">Mediterranean climate</a>. In southern Dalmatia, where the <span></span><a href=\\\"/science/sirocco-wind\\\">sirocco</a> winds (known there as the <em>jugo</em>) bring a moderating influence from Africa, summers are sunny, warm, and dry, and winters are rainy. In the north the winters are drier and colder as a result of the cold northeast wind known as the <span></span><a href=\\\"/science/bora\\\">bora</a> (<em>bura</em>). In the summer the mistral wind has a cooling effect on the coast and the islands. The average temperature ranges from the low 40s F (about 5 °C) in January to the low 70s F (low 20s C) in June. Rainfall is moderate and occurs mainly in the winter.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/37/118037-004-2BFCBC6E.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296687\",\"sidebarHeader\":\"Plant and animal life\",\"header\":\"Plant and animal life\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Reflecting the country’s diverse geography, the flora and fauna of Croatia are highly varied. On the Dalmatian coast, grapes and olives are grown to produce wine and oil, while Istria is dominated by firs, and Slavonia has many oak forests. In terms of animal life, lizards are found on the coast, while wolves and even bears can be found in the inland forests. Hares, foxes, boars, wildcats, and mouflons (wild sheep) also inhabit Croatia. Sea life in the Adriatic is rich as well, with many coral reefs and underwater caves serving as habitats.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/54/180354-049-40FA86E1.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/55/180355-049-76ADFD9A.jpg\\\">\"}],\"sections\":[],\"isFilled\":true}],\"isFilled\":true},\"ref42761\":{\"level\":2,\"id\":\"ref42761\",\"sidebarHeader\":\"Relief\",\"header\":\"Relief\",\"elements\":[{\"tagName\":\"P\",\"html\":\"<span></span>Croatia is composed of three major geographic regions. In the north and northeast, running the full length of the upper arm of the Croatian crescent, are the <span></span><a href=\\\"/place/Pannonian-Basin\\\">Pannonian</a> and para-Pannonian plains. To the north of <a href=\\\"/place/Zagreb\\\">Zagreb</a>, the <span></span>Zagorje Hills, fragments of the <a href=\\\"/place/Julian-Alps\\\">Julian Alps</a> now covered with vines and orchards, separate the <a href=\\\"/place/Sava-River\\\">Sava</a> and <a href=\\\"/place/Drava-River\\\">Drava</a> river valleys.\"},{\"tagName\":\"P\",\"html\":\"To the west and south of the Pannonian region, linking it with the Adriatic coast, is the central mountain belt, itself part of the <span></span><a href=\\\"/place/Dinaric-Alps\\\">Dinaric Alps</a>. The <a href=\\\"/science/karst-geology\\\">karst</a> plateaus of this region, consisting mostly of <a href=\\\"/science/limestone\\\">limestone</a>, are barren at the highest elevations; lower down, they are heavily forested. The highest mountain in Croatia, Dinara (6,007 feet [1,831 metres]), is located in the central mountain belt.\"},{\"tagName\":\"P\",\"html\":\"The third geographic region, the Croatian littoral, is composed of the <span></span><a href=\\\"/place/Istria\\\">Istrian</a> Peninsula in the north and the <span></span><a href=\\\"/place/Dalmatia\\\">Dalmatian</a> coast extending south to the <a href=\\\"/place/Gulf-of-Kotor\\\">Gulf of Kotor</a>. Wedged between the Dinaric Alps to the east and the Adriatic Sea to the west, its 1,100 miles (1,800 km) of coastline are fringed by more than 1,100 islands and islets.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/12/6212-004-B43A1A54.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},\"ref42763\":{\"level\":2,\"id\":\"ref42763\",\"sidebarHeader\":\"Drainage\",\"header\":\"Drainage\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Of the 26 rivers that flow for more than 30 miles (50 km) in Croatia, the <span></span><a href=\\\"/place/Sava-River\\\">Sava</a> and the <span></span><a href=\\\"/place/Drava-River\\\">Drava</a>, coursing through the Pannonian and para-Pannonian plains, are of particular importance—both because of their length and because, along with the Kupa River, they are in large part navigable. The Sava originates in Slovenia, passes Croatia’s capital city of Zagreb, and then forms most of the border between Croatia and Bosnia and Herzegovina along the inside of the Croatian crescent. The Drava enters Croatia from Slovenia and forms all but a small section of the border with Hungary before joining the <a href=\\\"/place/Danube-River\\\">Danube</a>, which in turn forms most of the border between Croatia and the Vojvodina province of Serbia. The <span></span>Kupa, which forms part of the frontier between Slovenia and Croatia, and the <span></span><a href=\\\"/place/Una-river-Europe\\\">Una</a> River, which meanders along part of the border between Croatia and Bosnia and Herzegovina, both flow into the Sava. In Dalmatia the <span></span><a href=\\\"/place/Krka\\\">Krka</a> and <span></span>Cetina rivers are of particular importance because of their hydroelectric potential and because they flow into the Adriatic Sea.\"},{\"tagName\":\"P\",\"html\":\"In addition, a great deal of water circulates in underground rivers and pools in the karstic regions of the central mountain belt and the littoral. These waters account for many of the unique geologic formations and the picturesque landscape of central and western Croatia.\"}],\"sections\":[],\"isFilled\":true},\"ref278417\":{\"level\":2,\"id\":\"ref278417\",\"sidebarHeader\":\"Soils\",\"header\":\"Soils\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The Pannonian and para-Pannonian plains are enriched with alluvial soil deposited by the Sava and Drava rivers. These plains are the most fertile agricultural regions of Croatia and form the country’s breadbasket. The soil of the central mountainous belt is rather poor but offers some cultivable land in the fields and meadows and some grazing land in the plateaus. The Croatian littoral is mostly mountainous and barren, with rocky soil and poor agricultural land.\"}],\"sections\":[],\"isFilled\":true},\"ref42762\":{\"level\":2,\"id\":\"ref42762\",\"sidebarHeader\":\"Climate\",\"header\":\"Climate\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Two main climatic zones dominate Croatia. The Pannonian and para-Pannonian plains and the mountain regions are characterized by a continental climate of warm summers and cold winters. In the plains, temperatures average in the low 70s F (low 20s C) in June and in the low 30s F (around 0 °C) in January—although they can range from a low of −5 °F (−20 °C) in the winter to a high of 105 °F (40 °C) in the summer. The central mountain regions of Lika and Krbava have slightly cooler summers and cold winters, with a milder climate in the valleys. The average temperature range is between about 65 °F (about 18 °C) in June and the upper 20s F (about −2 °C) in January. Considerable rainfall, turning to snow in winter, is characteristic of the region.\"},{\"tagName\":\"P\",\"html\":\"The Dalmatian coast, Istria, and the islands have a mild <a href=\\\"/science/Mediterranean-climate\\\">Mediterranean climate</a>. In southern Dalmatia, where the <span></span><a href=\\\"/science/sirocco-wind\\\">sirocco</a> winds (known there as the <em>jugo</em>) bring a moderating influence from Africa, summers are sunny, warm, and dry, and winters are rainy. In the north the winters are drier and colder as a result of the cold northeast wind known as the <span></span><a href=\\\"/science/bora\\\">bora</a> (<em>bura</em>). In the summer the mistral wind has a cooling effect on the coast and the islands. The average temperature ranges from the low 40s F (about 5 °C) in January to the low 70s F (low 20s C) in June. Rainfall is moderate and occurs mainly in the winter.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/37/118037-004-2BFCBC6E.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},\"ref296687\":{\"level\":2,\"id\":\"ref296687\",\"sidebarHeader\":\"Plant and animal life\",\"header\":\"Plant and animal life\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Reflecting the country’s diverse geography, the flora and fauna of Croatia are highly varied. On the Dalmatian coast, grapes and olives are grown to produce wine and oil, while Istria is dominated by firs, and Slavonia has many oak forests. In terms of animal life, lizards are found on the coast, while wolves and even bears can be found in the inland forests. Hares, foxes, boars, wildcats, and mouflons (wild sheep) also inhabit Croatia. Sea life in the Adriatic is rich as well, with many coral reefs and underwater caves serving as habitats.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/54/180354-049-40FA86E1.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/55/180355-049-76ADFD9A.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},\"ref42764\":{\"level\":1,\"id\":\"ref42764\",\"sidebarHeader\":\"People\",\"header\":\"People\",\"elements\":[],\"sections\":[{\"level\":2,\"id\":\"ref42765\",\"sidebarHeader\":\"Ethnic groups and religions\",\"header\":\"Ethnic groups and religions\",\"elements\":[{\"tagName\":\"P\",\"html\":\"A variety of ethnic groups coexist within the republic. Croats <a href=\\\"https://www.merriam-webster.com/dictionary/constitute\\\" data-dictionary-link-target=\\\"constitute\\\">constitute</a> about nine-tenths of the population. Serbs make up the largest minority group; however, their proportion fell dramatically as a result of the 1990s war of independence—from more than one-tenth of the population before the war to less than half that figure in 2001. In addition to the <span></span><a href=\\\"/topic/Croat\\\">Croats</a> and the Serbs, there are small groups of Bosnian Muslims (Bosniaks), Hungarians, Italians, and Slovenes as well as a few thousand Albanians, Austrians, Bulgarians, Czechs, Germans, and other nationalities.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/77/184077-004-99203AC8.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"It has been estimated that the number of Croats living outside the borders of Croatia is comparable to the number living inside the country. Many ethnic Croats reside in <a href=\\\"/place/Bosnia-and-Herzegovina\\\">Bosnia and Herzegovina</a>, where Croats have lived since the <span></span><a href=\\\"/topic/Slav\\\">Slavs</a> first migrated to the western <a href=\\\"/place/Balkans\\\">Balkan Peninsula</a> in the 6th and 7th centuries <span>ce</span>. Although there has traditionally been a yearning for unification with Croatia among the Croats of Herzegovina (a region <a href=\\\"https://www.merriam-webster.com/dictionary/contiguous\\\" data-dictionary-link-target=\\\"contiguous\\\">contiguous</a> to Dalmatia), this <a href=\\\"https://www.merriam-webster.com/dictionary/sentiment\\\" data-dictionary-link-target=\\\"sentiment\\\">sentiment</a> has not generally been shared by Croats within Croatia or even by Croats in Bosnia. Many of the Serbs in Croatia are descendants of people who migrated to the border areas of the <a href=\\\"/place/Holy-Roman-Empire\\\">Holy Roman Empire</a> between the 16th and 18th centuries, following the <a href=\\\"/place/Ottoman-Empire\\\">Ottoman</a> conquest of <a href=\\\"/place/Serbia\\\">Serbia</a> and Bosnia.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/39/61039-004-610E6BF1.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"There is traditionally a close correlation between ethnic identity and religious affiliation. The Croats are overwhelmingly <a href=\\\"/topic/Roman-Catholicism\\\">Roman Catholic</a> and more Western-influenced than the <span></span><a href=\\\"/topic/Serb\\\">Serbs</a>, who are overwhelmingly <a href=\\\"/topic/Eastern-Orthodoxy\\\">Eastern Orthodox</a>. A small minority of people are nonreligious or atheist. Bosniaks constitute most of the Muslim population.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/78/184078-004-320B2288.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/99/94599-004-2A895E5D.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref42766\",\"sidebarHeader\":\"Languages\",\"header\":\"Languages\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Croats speak <span></span><a href=\\\"/topic/Serbo-Croatian-language\\\">Croatian</a>, a <a href=\\\"/topic/Slavic-languages#ref74889\\\">South Slavic language</a> of the <a href=\\\"/topic/Indo-European-languages\\\">Indo-European</a> family. Croatian is quite similar to Serbian and Bosnian, but political developments since the collapse of <a href=\\\"/place/Yugoslavia-former-federated-nation-1929-2003\\\">Yugoslavia</a> have encouraged the three ethnic groups to emphasize the differences between their languages. The clearest distinction between the Croatian and Serbian variants of what was previously called the <a href=\\\"/topic/Serbo-Croatian-language\\\">Serbo-Croatian language</a> is the script, with Croatian written in the <a href=\\\"/topic/Latin-alphabet\\\">Latin alphabet</a> and Serbian in the <a href=\\\"/topic/Cyrillic-alphabet\\\">Cyrillic</a>. Distinctions of grammar and pronunciation also occur, as do more striking differences in vocabulary, which result partly from differential historical patterns of foreign domination. For Croats, this has resulted in a sprinkling of German, <a href=\\\"/topic/Hungarian-people\\\">Hungarian</a>, and (in <a href=\\\"/place/Dalmatia\\\">Dalmatia</a> and <a href=\\\"/place/Istria\\\">Istria</a>) Italian vocabulary, while the Serbs’ speech shows Turkish and Russian influences. In addition, there have been various movements to “purify” the Croatian language, which have led to further differences.\"},{\"tagName\":\"P\",\"html\":\"Another linguistic distinction, reflecting the <a href=\\\"https://www.merriam-webster.com/dictionary/legacies\\\" data-dictionary-link-target=\\\"legacies\\\">legacies</a> of history as well as the effects of geography, can be heard in the colourful medley of regional <a href=\\\"https://www.merriam-webster.com/dictionary/dialects\\\" data-dictionary-link-target=\\\"dialects\\\">dialects</a> and subdialects that survive to this day. The standard Croatian literary language, based on the <span></span><a href=\\\"/topic/Shtokavian\\\">Shtokavian</a> <a href=\\\"/topic/dialect\\\">dialect</a>, emerged in the second half of the 19th century as a result of an effort to unite all South Slavs. Although all three major branches of Serbo-Croatian (Shtokavian, Chakavian, and Kajkavian) were spoken by Croats (as they still are today), the Shtokavian <a href=\\\"https://www.merriam-webster.com/dictionary/dialect\\\" data-dictionary-link-target=\\\"dialect\\\">dialect</a> was the most widely heard in Croatian regions of eastern <a href=\\\"/place/Slavonia\\\">Slavonia</a>, the Adriatic littoral from Makarska to <a href=\\\"/place/Dubrovnik\\\">Dubrovnik</a>, and Herzegovina, as well as <a href=\\\"/place/Montenegro\\\">Montenegro</a> and Serbia. It was therefore adopted by leading Croatian national <a href=\\\"https://www.merriam-webster.com/dictionary/intellectuals\\\" data-dictionary-link-target=\\\"intellectuals\\\">intellectuals</a> of the 19th century.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref278418\",\"sidebarHeader\":\"Settlement patterns\",\"header\":\"Settlement patterns\",\"elements\":[{\"tagName\":\"P\",\"html\":\"More than half of the population resides in urban areas, particularly in the upper arm of the country and along the Adriatic coast. Settlement is relatively sparse in the central mountainous area. While most of Croatia’s Serbs live in urban centres, a significant number are scattered in villages and towns, mostly in lightly populated parts of the central mountain belt, in the regions of Lika and Banija, and in northern Dalmatia. There is also a smaller concentration of Serbs in Slavonia, although this area was particularly hard-hit by anti-Serb <a href=\\\"/topic/ethnic-cleansing\\\">ethnic cleansing</a> during the 1991–95 war.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/75/184075-004-81E47B02.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/63/121263-004-BB0D3C30.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/40/140340-004-43569B71.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref42767\",\"sidebarHeader\":\"Demographic trends\",\"header\":\"Demographic trends\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The major <a href=\\\"https://www.merriam-webster.com/dictionary/demographic\\\" data-dictionary-link-target=\\\"demographic\\\">demographic</a> trend of the post-<a href=\\\"/event/World-War-II\\\">World War II</a> period was rapid urbanization and a consequent migration from rural areas—especially from the less-prosperous karstic regions of Lika and Gorski Kotar in the central mountain belt, from Dalmatia, and from islands in the Adriatic but also from the Pannonian regions of Banija and Baranja. As a result, in the second half of the 20th century, the portion of the population employed in agriculture dropped from about two-thirds to less than one-fifth, and larger cities grew significantly; <span></span><a href=\\\"/place/Zagreb\\\">Zagreb</a>, for example, more than doubled its metropolitan population. Parallel to this rapid urbanization was a sharp decrease in the <a href=\\\"/science/birth-rate\\\">birth rate</a>. A much larger drop in infant mortality meant that Croatia’s population continued to increase—although at a very low rate—until the 1990s, when wartime displacement, emigration, and deaths caused the population to plummet by several hundred thousand. After hitting a plateau in the second half of the ’90s, the population remained at roughly the same level into the 21st century. The many emigrants who left Croatia during the 20th century have created significant <a href=\\\"https://www.merriam-webster.com/dictionary/diasporas\\\" data-dictionary-link-target=\\\"diasporas\\\">diasporas</a> in <a href=\\\"/place/Canada\\\">Canada</a>, the <a href=\\\"/place/United-States\\\">United States</a>, <a href=\\\"/place/Australia\\\">Australia</a>, and other countries. Croatian expatriates have sometimes played an important role in political developments in their homeland.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/76/184076-004-4B3DC1AF.jpg\\\">\"}],\"sections\":[],\"isFilled\":true}],\"isFilled\":true},\"ref42765\":{\"level\":2,\"id\":\"ref42765\",\"sidebarHeader\":\"Ethnic groups and religions\",\"header\":\"Ethnic groups and religions\",\"elements\":[{\"tagName\":\"P\",\"html\":\"A variety of ethnic groups coexist within the republic. Croats <a href=\\\"https://www.merriam-webster.com/dictionary/constitute\\\" data-dictionary-link-target=\\\"constitute\\\">constitute</a> about nine-tenths of the population. Serbs make up the largest minority group; however, their proportion fell dramatically as a result of the 1990s war of independence—from more than one-tenth of the population before the war to less than half that figure in 2001. In addition to the <span></span><a href=\\\"/topic/Croat\\\">Croats</a> and the Serbs, there are small groups of Bosnian Muslims (Bosniaks), Hungarians, Italians, and Slovenes as well as a few thousand Albanians, Austrians, Bulgarians, Czechs, Germans, and other nationalities.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/77/184077-004-99203AC8.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"It has been estimated that the number of Croats living outside the borders of Croatia is comparable to the number living inside the country. Many ethnic Croats reside in <a href=\\\"/place/Bosnia-and-Herzegovina\\\">Bosnia and Herzegovina</a>, where Croats have lived since the <span></span><a href=\\\"/topic/Slav\\\">Slavs</a> first migrated to the western <a href=\\\"/place/Balkans\\\">Balkan Peninsula</a> in the 6th and 7th centuries <span>ce</span>. Although there has traditionally been a yearning for unification with Croatia among the Croats of Herzegovina (a region <a href=\\\"https://www.merriam-webster.com/dictionary/contiguous\\\" data-dictionary-link-target=\\\"contiguous\\\">contiguous</a> to Dalmatia), this <a href=\\\"https://www.merriam-webster.com/dictionary/sentiment\\\" data-dictionary-link-target=\\\"sentiment\\\">sentiment</a> has not generally been shared by Croats within Croatia or even by Croats in Bosnia. Many of the Serbs in Croatia are descendants of people who migrated to the border areas of the <a href=\\\"/place/Holy-Roman-Empire\\\">Holy Roman Empire</a> between the 16th and 18th centuries, following the <a href=\\\"/place/Ottoman-Empire\\\">Ottoman</a> conquest of <a href=\\\"/place/Serbia\\\">Serbia</a> and Bosnia.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/39/61039-004-610E6BF1.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"There is traditionally a close correlation between ethnic identity and religious affiliation. The Croats are overwhelmingly <a href=\\\"/topic/Roman-Catholicism\\\">Roman Catholic</a> and more Western-influenced than the <span></span><a href=\\\"/topic/Serb\\\">Serbs</a>, who are overwhelmingly <a href=\\\"/topic/Eastern-Orthodoxy\\\">Eastern Orthodox</a>. A small minority of people are nonreligious or atheist. Bosniaks constitute most of the Muslim population.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/78/184078-004-320B2288.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/99/94599-004-2A895E5D.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},\"ref42766\":{\"level\":2,\"id\":\"ref42766\",\"sidebarHeader\":\"Languages\",\"header\":\"Languages\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Croats speak <span></span><a href=\\\"/topic/Serbo-Croatian-language\\\">Croatian</a>, a <a href=\\\"/topic/Slavic-languages#ref74889\\\">South Slavic language</a> of the <a href=\\\"/topic/Indo-European-languages\\\">Indo-European</a> family. Croatian is quite similar to Serbian and Bosnian, but political developments since the collapse of <a href=\\\"/place/Yugoslavia-former-federated-nation-1929-2003\\\">Yugoslavia</a> have encouraged the three ethnic groups to emphasize the differences between their languages. The clearest distinction between the Croatian and Serbian variants of what was previously called the <a href=\\\"/topic/Serbo-Croatian-language\\\">Serbo-Croatian language</a> is the script, with Croatian written in the <a href=\\\"/topic/Latin-alphabet\\\">Latin alphabet</a> and Serbian in the <a href=\\\"/topic/Cyrillic-alphabet\\\">Cyrillic</a>. Distinctions of grammar and pronunciation also occur, as do more striking differences in vocabulary, which result partly from differential historical patterns of foreign domination. For Croats, this has resulted in a sprinkling of German, <a href=\\\"/topic/Hungarian-people\\\">Hungarian</a>, and (in <a href=\\\"/place/Dalmatia\\\">Dalmatia</a> and <a href=\\\"/place/Istria\\\">Istria</a>) Italian vocabulary, while the Serbs’ speech shows Turkish and Russian influences. In addition, there have been various movements to “purify” the Croatian language, which have led to further differences.\"},{\"tagName\":\"P\",\"html\":\"Another linguistic distinction, reflecting the <a href=\\\"https://www.merriam-webster.com/dictionary/legacies\\\" data-dictionary-link-target=\\\"legacies\\\">legacies</a> of history as well as the effects of geography, can be heard in the colourful medley of regional <a href=\\\"https://www.merriam-webster.com/dictionary/dialects\\\" data-dictionary-link-target=\\\"dialects\\\">dialects</a> and subdialects that survive to this day. The standard Croatian literary language, based on the <span></span><a href=\\\"/topic/Shtokavian\\\">Shtokavian</a> <a href=\\\"/topic/dialect\\\">dialect</a>, emerged in the second half of the 19th century as a result of an effort to unite all South Slavs. Although all three major branches of Serbo-Croatian (Shtokavian, Chakavian, and Kajkavian) were spoken by Croats (as they still are today), the Shtokavian <a href=\\\"https://www.merriam-webster.com/dictionary/dialect\\\" data-dictionary-link-target=\\\"dialect\\\">dialect</a> was the most widely heard in Croatian regions of eastern <a href=\\\"/place/Slavonia\\\">Slavonia</a>, the Adriatic littoral from Makarska to <a href=\\\"/place/Dubrovnik\\\">Dubrovnik</a>, and Herzegovina, as well as <a href=\\\"/place/Montenegro\\\">Montenegro</a> and Serbia. It was therefore adopted by leading Croatian national <a href=\\\"https://www.merriam-webster.com/dictionary/intellectuals\\\" data-dictionary-link-target=\\\"intellectuals\\\">intellectuals</a> of the 19th century.\"}],\"sections\":[],\"isFilled\":true},\"ref278418\":{\"level\":2,\"id\":\"ref278418\",\"sidebarHeader\":\"Settlement patterns\",\"header\":\"Settlement patterns\",\"elements\":[{\"tagName\":\"P\",\"html\":\"More than half of the population resides in urban areas, particularly in the upper arm of the country and along the Adriatic coast. Settlement is relatively sparse in the central mountainous area. While most of Croatia’s Serbs live in urban centres, a significant number are scattered in villages and towns, mostly in lightly populated parts of the central mountain belt, in the regions of Lika and Banija, and in northern Dalmatia. There is also a smaller concentration of Serbs in Slavonia, although this area was particularly hard-hit by anti-Serb <a href=\\\"/topic/ethnic-cleansing\\\">ethnic cleansing</a> during the 1991–95 war.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/75/184075-004-81E47B02.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/63/121263-004-BB0D3C30.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/40/140340-004-43569B71.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},\"ref42767\":{\"level\":2,\"id\":\"ref42767\",\"sidebarHeader\":\"Demographic trends\",\"header\":\"Demographic trends\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The major <a href=\\\"https://www.merriam-webster.com/dictionary/demographic\\\" data-dictionary-link-target=\\\"demographic\\\">demographic</a> trend of the post-<a href=\\\"/event/World-War-II\\\">World War II</a> period was rapid urbanization and a consequent migration from rural areas—especially from the less-prosperous karstic regions of Lika and Gorski Kotar in the central mountain belt, from Dalmatia, and from islands in the Adriatic but also from the Pannonian regions of Banija and Baranja. As a result, in the second half of the 20th century, the portion of the population employed in agriculture dropped from about two-thirds to less than one-fifth, and larger cities grew significantly; <span></span><a href=\\\"/place/Zagreb\\\">Zagreb</a>, for example, more than doubled its metropolitan population. Parallel to this rapid urbanization was a sharp decrease in the <a href=\\\"/science/birth-rate\\\">birth rate</a>. A much larger drop in infant mortality meant that Croatia’s population continued to increase—although at a very low rate—until the 1990s, when wartime displacement, emigration, and deaths caused the population to plummet by several hundred thousand. After hitting a plateau in the second half of the ’90s, the population remained at roughly the same level into the 21st century. The many emigrants who left Croatia during the 20th century have created significant <a href=\\\"https://www.merriam-webster.com/dictionary/diasporas\\\" data-dictionary-link-target=\\\"diasporas\\\">diasporas</a> in <a href=\\\"/place/Canada\\\">Canada</a>, the <a href=\\\"/place/United-States\\\">United States</a>, <a href=\\\"/place/Australia\\\">Australia</a>, and other countries. Croatian expatriates have sometimes played an important role in political developments in their homeland.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/76/184076-004-4B3DC1AF.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},\"ref42768\":{\"level\":1,\"id\":\"ref42768\",\"sidebarHeader\":\"Economy\",\"header\":\"Economy\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Following the <a href=\\\"https://www.merriam-webster.com/dictionary/demise\\\" data-dictionary-link-target=\\\"demise\\\">demise</a> of communism in Croatia in 1990, the Croatian government began a course of restructuring the economy from the Yugoslav system of socialist self-management to <span></span><a href=\\\"/topic/market-economy\\\">market-oriented</a> capitalism. This required such measures as the sale of state-owned enterprises to private owners, the establishment of functioning markets, and the creation of stable prices, interest rates, and currency. The accomplishment of these tasks proved difficult, largely because of the destabilizing effects of war. The war not only deterred foreign investment, which was a crucial motor of <a href=\\\"/topic/economic-growth\\\">economic growth</a> and structural change in other central and eastern European countries, but also damaged <a href=\\\"https://www.merriam-webster.com/dictionary/infrastructure\\\" data-dictionary-link-target=\\\"infrastructure\\\">infrastructure</a> and production facilities. By the late 1990s nearly one in five members of the working-age population were jobless, with young people particularly affected; high unemployment remained a problem into the 21st century. The war also helped to foster an informal economy and a <a href=\\\"/topic/black-market\\\">black market</a>.\"}],\"sections\":[{\"level\":2,\"id\":\"ref42770\",\"sidebarHeader\":\"Agriculture, forestry, and fishing\",\"header\":\"Agriculture, forestry, and fishing\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Agriculture (grazing and tilling) occupies less than one-fourth of Croatia’s land and contributes less than one-tenth of the country’s <a href=\\\"/topic/gross-domestic-product\\\">gross domestic product</a> (GDP). Most agricultural land is privately held, but many landholdings are too small for profitable production. Croatian agricultural produce is exported mainly to nearby countries, particularly Bosnia and Herzegovina, <a href=\\\"/place/Italy\\\">Italy</a>, Slovenia, and Serbia.\"},{\"tagName\":\"P\",\"html\":\"<span></span><a href=\\\"/place/Slavonia\\\">Slavonia</a>, the granary of Croatia, is the most fertile agricultural region. Farming there is characterized by capital-intensive, market-oriented production and larger landholdings. Most of the land previously under social ownership has been nationalized by the Croatian government and is leased to farmers. Major crops of the region are sugar beets, corn (maize), wheat, potatoes, barley, soybeans, sunflowers, and tobacco. Oats, rye, millet, rice, beans, peas, and chicory are also grown. Pigs, cattle, and poultry are important to the economy of the region, while there is also some beekeeping and silkworm cultivation.\"},{\"tagName\":\"P\",\"html\":\"The hills of the western part of the para-Pannonian region are characterized by smallholdings, mixed farming, and generally low yields. Fruit growing, viticulture, and cattle and pig breeding are typical agricultural occupations.\"},{\"tagName\":\"P\",\"html\":\"The central mountain belt contains some of the poorest land and climate for agriculture. The large areas of meadow and pasture, however, are suitable for raising sheep and cattle, and there is also some cultivation of barley, oats, rye, and potatoes. Fruits grown include plums, apples, pears, sour cherries, sweet cherries, peaches, and apricots.\"},{\"tagName\":\"P\",\"html\":\"The Adriatic littoral of Istria and Dalmatia is characterized by rocky soil and long periods of <a href=\\\"/science/drought\\\">drought</a>, with small parcels of arable land and poor pasture. Sheep and goats are raised, while grapes, olives, almonds, figs, tangerines, and other Mediterranean fruits and vegetables round out the agriculture of this region. Beekeeping is also of some commercial importance, especially on the islands.\"},{\"tagName\":\"P\",\"html\":\"Croatia’s large forests, covering about two-fifths of the country’s area, form the basis of a wood and pulp industry. Fish and shellfish are harvested commercially in the waters off the Adriatic coast, although fish stocks in the sea declined in the late 20th and early 21st centuries. Around nine-tenths of the fish catch <a href=\\\"https://www.merriam-webster.com/dictionary/comprises\\\" data-dictionary-link-target=\\\"comprises\\\">comprises</a> small oily fish (e.g., anchovies and pilchards), much of which is consumed locally, but there is also an increasing demand for nonoily fish, or whitefish (e.g., sea bass). <a href=\\\"/topic/aquaculture\\\">Aquaculture</a>, or fish farming, is of growing importance, with <a href=\\\"/animal/sea-bass\\\">sea bass</a>, tuna, and mussels all popular. Almost all commercially sold freshwater fish is raised in ponds as well, though freshwater fishing has some significance for tourism. Farmed fish are exported to countries such as <a href=\\\"/place/Spain\\\">Spain</a> and <a href=\\\"/place/Japan\\\">Japan</a>, while canned fish is sold mainly to surrounding countries.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/21/114821-004-54F1FB7B.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref42769\",\"sidebarHeader\":\"Resources and power\",\"header\":\"Resources and power\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Deposits of oil and <a href=\\\"/science/natural-gas\\\">natural gas</a> are found in the Pannonian valleys of eastern Slavonia, but Croatia consumes more oil and gas than it produces and thus is dependent on imports. <a href=\\\"/science/bauxite\\\">Bauxite</a> and <a href=\\\"/technology/coal-mining\\\">coal mining</a> had ceased by the early 21st century. Clay, stone, and gravel are still quarried, however, and gypsum and quartz are mined. There are small deposits of other minerals, including salt, throughout the country.  Although Croatia’s numerous rivers offer hydroelectric potential, the country imports a significant portion of its electricity.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref42772\",\"sidebarHeader\":\"Manufacturing\",\"header\":\"Manufacturing\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Already more <span></span><a href=\\\"/topic/industrialization\\\">industrialized</a> than most of its neighbours when the communists assumed power over Yugoslavia in 1945, Croatia continued its rapid industrialization under socialist policies of economic and <a href=\\\"/science/social-learning\\\">social development</a>. One unfortunate result was the squandering of a great deal of money through inefficiency and the misallocation of resources through the building of so-called political factories, which served more to <a href=\\\"https://www.merriam-webster.com/dictionary/enhance\\\" data-dictionary-link-target=\\\"enhance\\\">enhance</a> the <a href=\\\"https://www.merriam-webster.com/dictionary/prestige\\\" data-dictionary-link-target=\\\"prestige\\\">prestige</a> of politicians than to use most rationally the endowments of a specific region. Nevertheless, large investments in industry (as well as transportation and education) ensured the continued growth of that sector and allowed the absorption into an industrial workforce of Croatia’s rapidly urbanizing population. On the eve of Yugoslavia’s disintegration into war in 1991, industry and mining accounted for more than one-third of Croatia’s GDP.\"},{\"tagName\":\"P\",\"html\":\"Today manufacturing and other <a href=\\\"/technology/industry#ref3506\\\">secondary industries</a> account for a smaller but still important portion of GDP. Significant industries include <a href=\\\"/technology/food-processing\\\">food processing</a> and wine making, as well as the production and refining of petroleum. Also important are chemical products, building materials, metallurgy (particularly aluminum and iron and steel), the wood and paper industries, machine engineering, electronics, textiles, and shipbuilding. The future of shipbuilding is in question, however, since it is heavily dependent on state subsidies. Most enterprises are concentrated around such urban centres as <a href=\\\"/place/Zagreb\\\">Zagreb</a>, <a href=\\\"/place/Rijeka\\\">Rijeka</a>, <a href=\\\"/place/Split-Croatia\\\">Split</a>, <a href=\\\"/place/Osijek\\\">Osijek</a>, <a href=\\\"/place/Karlovac\\\">Karlovac</a>, <a href=\\\"/place/Zadar\\\">Zadar</a>, Slavonski Brod, Sisak, and Varaždin.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296684\",\"sidebarHeader\":\"Finance, trade, and services\",\"header\":\"Finance, trade, and services\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The banking sector has consolidated considerably since the late 1990s, through mergers, takeovers, and bankruptcies. The sector is also now overwhelmingly privately and foreign-owned, with Italian, Austrian, and German banks dominating. Banks in Croatia have invested heavily in technology; hence, Internet, telephone, and drive-in banking are widely offered. Card transactions are the norm in cities. There has been a major expansion in credit since the late 1990s, with consumers eager to borrow money in order to satisfy pent-up demand. The sector is overseen by the Croatian National Bank, the country’s <a href=\\\"/topic/central-bank\\\">central bank</a>, which earned a good record of achieving price stability in the period after the independence war.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/79/184079-004-5806E0B9.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"The Croatian economy is very open to <a href=\\\"/topic/international-trade\\\">international trade</a>. Nearly two-thirds of trade is conducted with other <a href=\\\"/topic/European-Union\\\">European Union</a> (EU) countries, while trade with Croatia’s neighbours in southeastern <a href=\\\"/place/Europe\\\">Europe</a> is also significant. Italy, Bosnia and Herzegovina, <a href=\\\"/place/Germany\\\">Germany</a>, Slovenia, and <a href=\\\"/place/Austria\\\">Austria</a> are top buyers of Croatian exports, while Croatia imports primarily from Italy, Germany, <a href=\\\"/place/Russia\\\">Russia</a>, <a href=\\\"/place/China\\\">China</a>, and Slovenia. Important exports include fuels, ships, chemical products, food, machinery, and textiles. Fuels, chemical products, and transport equipment are also among the main imports.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/80/184080-004-2F297991.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"The service sector employs well over half the workforce and accounts for the majority of GDP. A substantial portion of service workers are employed in <a href=\\\"/topic/retailing\\\">retailing</a>. Although the retail market has long been dominated by small shops, newly constructed shopping malls have proliferated since 2000. Croatia’s beautiful coastline and numerous islands form the basis of another major component of the service sector—tourism. A historically important source of revenue, tourism was negatively affected by the war in the 1990s. The conflict deterred potential tourists from traveling to the country, and many empty hotels were used to house refugees and displaced persons. Significant investment has been necessary to revive the tourist industry.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296685\",\"sidebarHeader\":\"Labour and taxation\",\"header\":\"Labour and taxation\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The service and manufacturing sectors employ the bulk of the workforce, which, in general, is well educated and has excellent foreign-language skills, reflecting and <a href=\\\"https://www.merriam-webster.com/dictionary/facilitating\\\" data-dictionary-link-target=\\\"facilitating\\\">facilitating</a> the tourist trade. However, employing people in Croatia is expensive, owing to a combination of relatively high wages, burdensome <a href=\\\"/topic/social-security-government-program\\\">social security</a> contributions, and the high cost of dismissing workers. The Union of <a href=\\\"https://www.merriam-webster.com/dictionary/Autonomous\\\" data-dictionary-link-target=\\\"Autonomous\\\">Autonomous</a> Trade Unions of Croatia, founded in 1990, <a href=\\\"https://www.merriam-webster.com/dictionary/affiliates\\\" data-dictionary-link-target=\\\"affiliates\\\">affiliates</a> a number of unions in the country.\"},{\"tagName\":\"P\",\"html\":\"The tax burden on businesses in Croatia is moderate. Under a number of incentive programs, a business may reduce the tax on its profits. Profit tax is reduced, for example, on investments in areas with significant war damage or high unemployment. Income tax is levied on individuals at varying rates. A large part of revenue is raised through a <span></span><a href=\\\"/topic/value-added-tax\\\">value-added tax</a>, although this tax is reduced for many tourist services and is eliminated for some products, such as books, basic foodstuffs, and certain medical goods.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296686\",\"sidebarHeader\":\"Transportation and telecommunications\",\"header\":\"Transportation and telecommunications\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Croatia has excellent access to shipping routes because of its long coastline on the Adriatic. The major seaports of <a href=\\\"/place/Rijeka\\\">Rijeka</a>, <a href=\\\"/place/Zadar\\\">Zadar</a>, <a href=\\\"/place/Sibenik\\\">Šibenik</a>, <a href=\\\"/place/Split-Croatia\\\">Split</a>, Ploče, and <a href=\\\"/place/Dubrovnik\\\">Dubrovnik</a> link Europe, via the <a href=\\\"/topic/Suez-Canal\\\">Suez Canal</a>, with <a href=\\\"/place/Asia\\\">Asia</a> and Australia. There are also several international airports in Croatia, with a number of them used largely for tourism.\"},{\"tagName\":\"P\",\"html\":\"There has been significant investment in highways and railways within the country since the 1990s war. Highways run between Zagreb and Split—a route also well served by rail connections—and between Zagreb and the Serbian border. In addition to the direct eastward routes to Serbia and <a href=\\\"/place/Romania\\\">Romania</a>, road access to central Europe is good. However, connections to the south, to <a href=\\\"/place/Albania\\\">Albania</a> and <a href=\\\"/place/Greece\\\">Greece</a>, are cumbersome.\"},{\"tagName\":\"P\",\"html\":\"Croatia possesses a good telecommunications infrastructure. About half the population regularly uses the Internet. Mobile phone usage has outpaced that of landlines; there is more than one cellular subscription for every member of the population. The telecommunications market is fully liberalized, with numerous landline, cellular, and Internet service providers in operation.\"}],\"sections\":[],\"isFilled\":true}],\"isFilled\":true},\"ref42770\":{\"level\":2,\"id\":\"ref42770\",\"sidebarHeader\":\"Agriculture, forestry, and fishing\",\"header\":\"Agriculture, forestry, and fishing\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Agriculture (grazing and tilling) occupies less than one-fourth of Croatia’s land and contributes less than one-tenth of the country’s <a href=\\\"/topic/gross-domestic-product\\\">gross domestic product</a> (GDP). Most agricultural land is privately held, but many landholdings are too small for profitable production. Croatian agricultural produce is exported mainly to nearby countries, particularly Bosnia and Herzegovina, <a href=\\\"/place/Italy\\\">Italy</a>, Slovenia, and Serbia.\"},{\"tagName\":\"P\",\"html\":\"<span></span><a href=\\\"/place/Slavonia\\\">Slavonia</a>, the granary of Croatia, is the most fertile agricultural region. Farming there is characterized by capital-intensive, market-oriented production and larger landholdings. Most of the land previously under social ownership has been nationalized by the Croatian government and is leased to farmers. Major crops of the region are sugar beets, corn (maize), wheat, potatoes, barley, soybeans, sunflowers, and tobacco. Oats, rye, millet, rice, beans, peas, and chicory are also grown. Pigs, cattle, and poultry are important to the economy of the region, while there is also some beekeeping and silkworm cultivation.\"},{\"tagName\":\"P\",\"html\":\"The hills of the western part of the para-Pannonian region are characterized by smallholdings, mixed farming, and generally low yields. Fruit growing, viticulture, and cattle and pig breeding are typical agricultural occupations.\"},{\"tagName\":\"P\",\"html\":\"The central mountain belt contains some of the poorest land and climate for agriculture. The large areas of meadow and pasture, however, are suitable for raising sheep and cattle, and there is also some cultivation of barley, oats, rye, and potatoes. Fruits grown include plums, apples, pears, sour cherries, sweet cherries, peaches, and apricots.\"},{\"tagName\":\"P\",\"html\":\"The Adriatic littoral of Istria and Dalmatia is characterized by rocky soil and long periods of <a href=\\\"/science/drought\\\">drought</a>, with small parcels of arable land and poor pasture. Sheep and goats are raised, while grapes, olives, almonds, figs, tangerines, and other Mediterranean fruits and vegetables round out the agriculture of this region. Beekeeping is also of some commercial importance, especially on the islands.\"},{\"tagName\":\"P\",\"html\":\"Croatia’s large forests, covering about two-fifths of the country’s area, form the basis of a wood and pulp industry. Fish and shellfish are harvested commercially in the waters off the Adriatic coast, although fish stocks in the sea declined in the late 20th and early 21st centuries. Around nine-tenths of the fish catch <a href=\\\"https://www.merriam-webster.com/dictionary/comprises\\\" data-dictionary-link-target=\\\"comprises\\\">comprises</a> small oily fish (e.g., anchovies and pilchards), much of which is consumed locally, but there is also an increasing demand for nonoily fish, or whitefish (e.g., sea bass). <a href=\\\"/topic/aquaculture\\\">Aquaculture</a>, or fish farming, is of growing importance, with <a href=\\\"/animal/sea-bass\\\">sea bass</a>, tuna, and mussels all popular. Almost all commercially sold freshwater fish is raised in ponds as well, though freshwater fishing has some significance for tourism. Farmed fish are exported to countries such as <a href=\\\"/place/Spain\\\">Spain</a> and <a href=\\\"/place/Japan\\\">Japan</a>, while canned fish is sold mainly to surrounding countries.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/21/114821-004-54F1FB7B.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},\"ref42769\":{\"level\":2,\"id\":\"ref42769\",\"sidebarHeader\":\"Resources and power\",\"header\":\"Resources and power\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Deposits of oil and <a href=\\\"/science/natural-gas\\\">natural gas</a> are found in the Pannonian valleys of eastern Slavonia, but Croatia consumes more oil and gas than it produces and thus is dependent on imports. <a href=\\\"/science/bauxite\\\">Bauxite</a> and <a href=\\\"/technology/coal-mining\\\">coal mining</a> had ceased by the early 21st century. Clay, stone, and gravel are still quarried, however, and gypsum and quartz are mined. There are small deposits of other minerals, including salt, throughout the country.  Although Croatia’s numerous rivers offer hydroelectric potential, the country imports a significant portion of its electricity.\"}],\"sections\":[],\"isFilled\":true},\"ref42772\":{\"level\":2,\"id\":\"ref42772\",\"sidebarHeader\":\"Manufacturing\",\"header\":\"Manufacturing\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Already more <span></span><a href=\\\"/topic/industrialization\\\">industrialized</a> than most of its neighbours when the communists assumed power over Yugoslavia in 1945, Croatia continued its rapid industrialization under socialist policies of economic and <a href=\\\"/science/social-learning\\\">social development</a>. One unfortunate result was the squandering of a great deal of money through inefficiency and the misallocation of resources through the building of so-called political factories, which served more to <a href=\\\"https://www.merriam-webster.com/dictionary/enhance\\\" data-dictionary-link-target=\\\"enhance\\\">enhance</a> the <a href=\\\"https://www.merriam-webster.com/dictionary/prestige\\\" data-dictionary-link-target=\\\"prestige\\\">prestige</a> of politicians than to use most rationally the endowments of a specific region. Nevertheless, large investments in industry (as well as transportation and education) ensured the continued growth of that sector and allowed the absorption into an industrial workforce of Croatia’s rapidly urbanizing population. On the eve of Yugoslavia’s disintegration into war in 1991, industry and mining accounted for more than one-third of Croatia’s GDP.\"},{\"tagName\":\"P\",\"html\":\"Today manufacturing and other <a href=\\\"/technology/industry#ref3506\\\">secondary industries</a> account for a smaller but still important portion of GDP. Significant industries include <a href=\\\"/technology/food-processing\\\">food processing</a> and wine making, as well as the production and refining of petroleum. Also important are chemical products, building materials, metallurgy (particularly aluminum and iron and steel), the wood and paper industries, machine engineering, electronics, textiles, and shipbuilding. The future of shipbuilding is in question, however, since it is heavily dependent on state subsidies. Most enterprises are concentrated around such urban centres as <a href=\\\"/place/Zagreb\\\">Zagreb</a>, <a href=\\\"/place/Rijeka\\\">Rijeka</a>, <a href=\\\"/place/Split-Croatia\\\">Split</a>, <a href=\\\"/place/Osijek\\\">Osijek</a>, <a href=\\\"/place/Karlovac\\\">Karlovac</a>, <a href=\\\"/place/Zadar\\\">Zadar</a>, Slavonski Brod, Sisak, and Varaždin.\"}],\"sections\":[],\"isFilled\":true},\"ref296684\":{\"level\":2,\"id\":\"ref296684\",\"sidebarHeader\":\"Finance, trade, and services\",\"header\":\"Finance, trade, and services\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The banking sector has consolidated considerably since the late 1990s, through mergers, takeovers, and bankruptcies. The sector is also now overwhelmingly privately and foreign-owned, with Italian, Austrian, and German banks dominating. Banks in Croatia have invested heavily in technology; hence, Internet, telephone, and drive-in banking are widely offered. Card transactions are the norm in cities. There has been a major expansion in credit since the late 1990s, with consumers eager to borrow money in order to satisfy pent-up demand. The sector is overseen by the Croatian National Bank, the country’s <a href=\\\"/topic/central-bank\\\">central bank</a>, which earned a good record of achieving price stability in the period after the independence war.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/79/184079-004-5806E0B9.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"The Croatian economy is very open to <a href=\\\"/topic/international-trade\\\">international trade</a>. Nearly two-thirds of trade is conducted with other <a href=\\\"/topic/European-Union\\\">European Union</a> (EU) countries, while trade with Croatia’s neighbours in southeastern <a href=\\\"/place/Europe\\\">Europe</a> is also significant. Italy, Bosnia and Herzegovina, <a href=\\\"/place/Germany\\\">Germany</a>, Slovenia, and <a href=\\\"/place/Austria\\\">Austria</a> are top buyers of Croatian exports, while Croatia imports primarily from Italy, Germany, <a href=\\\"/place/Russia\\\">Russia</a>, <a href=\\\"/place/China\\\">China</a>, and Slovenia. Important exports include fuels, ships, chemical products, food, machinery, and textiles. Fuels, chemical products, and transport equipment are also among the main imports.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/80/184080-004-2F297991.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"The service sector employs well over half the workforce and accounts for the majority of GDP. A substantial portion of service workers are employed in <a href=\\\"/topic/retailing\\\">retailing</a>. Although the retail market has long been dominated by small shops, newly constructed shopping malls have proliferated since 2000. Croatia’s beautiful coastline and numerous islands form the basis of another major component of the service sector—tourism. A historically important source of revenue, tourism was negatively affected by the war in the 1990s. The conflict deterred potential tourists from traveling to the country, and many empty hotels were used to house refugees and displaced persons. Significant investment has been necessary to revive the tourist industry.\"}],\"sections\":[],\"isFilled\":true},\"ref296685\":{\"level\":2,\"id\":\"ref296685\",\"sidebarHeader\":\"Labour and taxation\",\"header\":\"Labour and taxation\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The service and manufacturing sectors employ the bulk of the workforce, which, in general, is well educated and has excellent foreign-language skills, reflecting and <a href=\\\"https://www.merriam-webster.com/dictionary/facilitating\\\" data-dictionary-link-target=\\\"facilitating\\\">facilitating</a> the tourist trade. However, employing people in Croatia is expensive, owing to a combination of relatively high wages, burdensome <a href=\\\"/topic/social-security-government-program\\\">social security</a> contributions, and the high cost of dismissing workers. The Union of <a href=\\\"https://www.merriam-webster.com/dictionary/Autonomous\\\" data-dictionary-link-target=\\\"Autonomous\\\">Autonomous</a> Trade Unions of Croatia, founded in 1990, <a href=\\\"https://www.merriam-webster.com/dictionary/affiliates\\\" data-dictionary-link-target=\\\"affiliates\\\">affiliates</a> a number of unions in the country.\"},{\"tagName\":\"P\",\"html\":\"The tax burden on businesses in Croatia is moderate. Under a number of incentive programs, a business may reduce the tax on its profits. Profit tax is reduced, for example, on investments in areas with significant war damage or high unemployment. Income tax is levied on individuals at varying rates. A large part of revenue is raised through a <span></span><a href=\\\"/topic/value-added-tax\\\">value-added tax</a>, although this tax is reduced for many tourist services and is eliminated for some products, such as books, basic foodstuffs, and certain medical goods.\"}],\"sections\":[],\"isFilled\":true},\"ref296686\":{\"level\":2,\"id\":\"ref296686\",\"sidebarHeader\":\"Transportation and telecommunications\",\"header\":\"Transportation and telecommunications\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Croatia has excellent access to shipping routes because of its long coastline on the Adriatic. The major seaports of <a href=\\\"/place/Rijeka\\\">Rijeka</a>, <a href=\\\"/place/Zadar\\\">Zadar</a>, <a href=\\\"/place/Sibenik\\\">Šibenik</a>, <a href=\\\"/place/Split-Croatia\\\">Split</a>, Ploče, and <a href=\\\"/place/Dubrovnik\\\">Dubrovnik</a> link Europe, via the <a href=\\\"/topic/Suez-Canal\\\">Suez Canal</a>, with <a href=\\\"/place/Asia\\\">Asia</a> and Australia. There are also several international airports in Croatia, with a number of them used largely for tourism.\"},{\"tagName\":\"P\",\"html\":\"There has been significant investment in highways and railways within the country since the 1990s war. Highways run between Zagreb and Split—a route also well served by rail connections—and between Zagreb and the Serbian border. In addition to the direct eastward routes to Serbia and <a href=\\\"/place/Romania\\\">Romania</a>, road access to central Europe is good. However, connections to the south, to <a href=\\\"/place/Albania\\\">Albania</a> and <a href=\\\"/place/Greece\\\">Greece</a>, are cumbersome.\"},{\"tagName\":\"P\",\"html\":\"Croatia possesses a good telecommunications infrastructure. About half the population regularly uses the Internet. Mobile phone usage has outpaced that of landlines; there is more than one cellular subscription for every member of the population. The telecommunications market is fully liberalized, with numerous landline, cellular, and Internet service providers in operation.\"}],\"sections\":[],\"isFilled\":true},\"ref42773\":{\"level\":1,\"id\":\"ref42773\",\"sidebarHeader\":\"Government and society\",\"header\":\"Government and society\",\"elements\":[],\"sections\":[{\"level\":2,\"id\":\"ref42774\",\"sidebarHeader\":\"Constitutional framework\",\"header\":\"Constitutional framework\",\"elements\":[{\"tagName\":\"P\",\"html\":\"On Dec. 22, 1990, the <span></span>constitution of the Republic of Croatia was <a href=\\\"https://www.merriam-webster.com/dictionary/promulgated\\\" data-dictionary-link-target=\\\"promulgated\\\">promulgated</a>. In addition to such classic <a href=\\\"/topic/civil-rights\\\">civil rights</a> as <a href=\\\"/topic/freedom-of-speech\\\">freedom of speech</a>, religion, information, and association, the equality of nationalities is guaranteed in a number of <a href=\\\"https://www.merriam-webster.com/dictionary/constitutional\\\" data-dictionary-link-target=\\\"constitutional\\\">constitutional</a> articles. Cultural <a href=\\\"https://www.merriam-webster.com/dictionary/autonomy\\\" data-dictionary-link-target=\\\"autonomy\\\">autonomy</a>, along with the right to use one’s own language and script (the latter specifically intended for the Serb minority), is also guaranteed.\"},{\"tagName\":\"P\",\"html\":\"The 1990 constitution changed the structure of the <span></span><a href=\\\"/topic/Sabor\\\">Sabor</a> (parliament) from a tricameral body under the Yugoslav system to a bicameral body consisting of the House of Representatives (lower house) and the House of Districts (upper house). Constitutional <a href=\\\"https://www.merriam-webster.com/dictionary/amendments\\\" data-dictionary-link-target=\\\"amendments\\\">amendments</a> in 2001 abolished the upper house, thereby rendering the Sabor a unicameral body. Members are elected from party lists every four years. In addition, a small percentage of seats are reserved for national minorities and for representatives of Croats living outside the country.\"},{\"tagName\":\"P\",\"html\":\"The <span></span><a href=\\\"/topic/president-government-official\\\">president</a> of the republic is elected directly by popular vote for a period of five years and is limited to two terms. The 1990 constitution originally granted the president very broad powers; this “superpresident” appointed and could dismiss the <a href=\\\"/topic/prime-minister\\\">prime minister</a>, who was nominally responsible to both the parliament and the president but was actually directly dependent on the president. Constitutional amendments in 2000 reduced the importance of the president, who thenceforth served solely as head of state, and increased the power of the parliament and of the prime minister, who assumed the role of head of government. The president continues to nominate the prime minister, but the Sabor must confirm the appointment. In addition, the prime minister is typically the head of the leading party in the Sabor.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref278419\",\"sidebarHeader\":\"Local government\",\"header\":\"Local government\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Below the national level, Croatia is divided into 20 administrative districts called <em>županije</em> (counties). One city, <a href=\\\"/place/Zagreb\\\">Zagreb</a>, has an administrative status equivalent to that of the counties. Within the <em>županije</em> are hundreds of <em>općine</em> (municipalities).\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296688\",\"sidebarHeader\":\"Justice\",\"header\":\"Justice\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The Supreme Court, county courts, and municipal courts <a href=\\\"https://www.merriam-webster.com/dictionary/constitute\\\" data-dictionary-link-target=\\\"constitute\\\">constitute</a> the three-tiered <a href=\\\"/topic/judiciary\\\">judicial system</a>. The Supreme Court is the highest legal authority in all matters but constitutional questions, which are decided by the Constitutional Court. <a href=\\\"https://www.merriam-webster.com/dictionary/Justices\\\" data-dictionary-link-target=\\\"Justices\\\">Justices</a> on the Supreme Court are appointed by a judicial council, which is elected by the Sabor. The independence of the judiciary has been questioned, largely because many of the judges who were politically appointed in the 1990s remained in office well into the 21st century. However, there have been significant reforms to the judiciary, largely under EU pressure.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296689\",\"sidebarHeader\":\"Political process\",\"header\":\"Political process\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Suffrage is universal from age 18, although employed individuals may vote beginning at age 16. Multiparty elections have been held in Croatia since independence. The Croatian Democratic Union (Hrvatska Demokratska Zajednica; HDZ) and the <a href=\\\"/topic/Social-Democratic-Party\\\">Social Democratic Party</a> (Socijaldemokratska partija Hrvatske; SDP) are the predominant political parties. The HDZ dominated politics in the first years of the post-Yugoslav era, having come to power in the parliamentary elections of 1990. The party leader, <a href=\\\"/biography/Franjo-Tudjman\\\">Franjo Tudjman</a>, served as the first president of independent Croatia. The HDZ initially based its <a href=\\\"https://www.merriam-webster.com/dictionary/ideology\\\" data-dictionary-link-target=\\\"ideology\\\">ideology</a> on Croatian <a href=\\\"https://www.merriam-webster.com/dictionary/nationalism\\\" data-dictionary-link-target=\\\"nationalism\\\">nationalism</a> and the struggle for independence, but it began to lose favour after the war ended in 1995 and the population felt the pain of economic collapse. In 2000, the year after Tudjman died, the HDZ was resoundingly defeated in parliamentary and presidential elections. A multiparty centre-left coalition, led by the SDP, then governed until 2003, when the HDZ, having repositioned itself as a typical centre-right party, returned to power. The HDZ and the SDP continued to be the main <a href=\\\"https://www.merriam-webster.com/dictionary/contenders\\\" data-dictionary-link-target=\\\"contenders\\\">contenders</a> in subsequent elections. Both parties favoured Croatian accession to the EU.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296690\",\"sidebarHeader\":\"Security\",\"header\":\"Security\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Croatia’s armed forces—comprising an army, a navy, and an air force—were created in the early 1990s with significant support from the international <a href=\\\"https://www.merriam-webster.com/dictionary/community\\\" data-dictionary-link-target=\\\"community\\\">community</a>, particularly the <a href=\\\"/place/United-States\\\">United States</a>. Although Croatia had no army to speak of when it declared independence in 1991, within a few years an army had been trained and equipped sufficiently to be able to conduct two major operations to reclaim territory from Serb paramilitaries in 1995. However, Croatia is not a militaristic country, and it relies on the security of the <a href=\\\"/topic/North-Atlantic-Treaty-Organization\\\">North Atlantic Treaty Organization</a> (NATO), which it joined in 2009.\"},{\"tagName\":\"P\",\"html\":\"The Croatian police force, under the authority of the central government, has been reformed since independence. Reform efforts have focused on improving service and stamping out corruption.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296691\",\"sidebarHeader\":\"Health, welfare, and housing\",\"header\":\"Health, welfare, and housing\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The health of Croatians is good compared with that of the populations of neighbouring countries. Life expectancy at birth is higher than the eastern European average, and the <a href=\\\"/science/infant-mortality-rate\\\">infant mortality rate</a> is significantly lower. The rate of HIV infection is low, reflecting competent prevention efforts. However, the health care system is in need of investment and far-reaching reform because, being almost entirely state-provided, it imposes a substantial burden on the budget. The social welfare system is also burdensome, partly because Croatia has a large number of retirees and unemployed individuals. In urban areas, large portions of the population live in concrete tower blocks built during the Yugoslav era, which are in dire need of investment.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref42775\",\"sidebarHeader\":\"Education\",\"header\":\"Education\",\"elements\":[{\"tagName\":\"P\",\"html\":\"During its 45 years in power, the communist Yugoslav regime reduced illiteracy in Croatia from 16 percent of the population over 10 years of age to less than 4 percent. By the early 21st century, the literacy rate for Croatians over age 14 was nearly 99 percent. In addition to thousands of elementary schools, secondary schools, commercial and technical institutions, and vocational schools, the Yugoslav emphasis on education led to the founding of universities in <a href=\\\"/place/Rijeka\\\">Rijeka</a> in 1973, in <a href=\\\"/place/Split-Croatia\\\">Split</a> in 1974, and in <a href=\\\"/place/Osijek\\\">Osijek</a> in 1975. The oldest university in Croatia is the <span></span>University of Zagreb (1669), which traces its beginnings to a Jesuit school of <a href=\\\"/topic/moral-theology\\\">moral theology</a> founded in 1632.\"}],\"sections\":[],\"isFilled\":true}],\"isFilled\":true},\"ref42774\":{\"level\":2,\"id\":\"ref42774\",\"sidebarHeader\":\"Constitutional framework\",\"header\":\"Constitutional framework\",\"elements\":[{\"tagName\":\"P\",\"html\":\"On Dec. 22, 1990, the <span></span>constitution of the Republic of Croatia was <a href=\\\"https://www.merriam-webster.com/dictionary/promulgated\\\" data-dictionary-link-target=\\\"promulgated\\\">promulgated</a>. In addition to such classic <a href=\\\"/topic/civil-rights\\\">civil rights</a> as <a href=\\\"/topic/freedom-of-speech\\\">freedom of speech</a>, religion, information, and association, the equality of nationalities is guaranteed in a number of <a href=\\\"https://www.merriam-webster.com/dictionary/constitutional\\\" data-dictionary-link-target=\\\"constitutional\\\">constitutional</a> articles. Cultural <a href=\\\"https://www.merriam-webster.com/dictionary/autonomy\\\" data-dictionary-link-target=\\\"autonomy\\\">autonomy</a>, along with the right to use one’s own language and script (the latter specifically intended for the Serb minority), is also guaranteed.\"},{\"tagName\":\"P\",\"html\":\"The 1990 constitution changed the structure of the <span></span><a href=\\\"/topic/Sabor\\\">Sabor</a> (parliament) from a tricameral body under the Yugoslav system to a bicameral body consisting of the House of Representatives (lower house) and the House of Districts (upper house). Constitutional <a href=\\\"https://www.merriam-webster.com/dictionary/amendments\\\" data-dictionary-link-target=\\\"amendments\\\">amendments</a> in 2001 abolished the upper house, thereby rendering the Sabor a unicameral body. Members are elected from party lists every four years. In addition, a small percentage of seats are reserved for national minorities and for representatives of Croats living outside the country.\"},{\"tagName\":\"P\",\"html\":\"The <span></span><a href=\\\"/topic/president-government-official\\\">president</a> of the republic is elected directly by popular vote for a period of five years and is limited to two terms. The 1990 constitution originally granted the president very broad powers; this “superpresident” appointed and could dismiss the <a href=\\\"/topic/prime-minister\\\">prime minister</a>, who was nominally responsible to both the parliament and the president but was actually directly dependent on the president. Constitutional amendments in 2000 reduced the importance of the president, who thenceforth served solely as head of state, and increased the power of the parliament and of the prime minister, who assumed the role of head of government. The president continues to nominate the prime minister, but the Sabor must confirm the appointment. In addition, the prime minister is typically the head of the leading party in the Sabor.\"}],\"sections\":[],\"isFilled\":true},\"ref278419\":{\"level\":2,\"id\":\"ref278419\",\"sidebarHeader\":\"Local government\",\"header\":\"Local government\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Below the national level, Croatia is divided into 20 administrative districts called <em>županije</em> (counties). One city, <a href=\\\"/place/Zagreb\\\">Zagreb</a>, has an administrative status equivalent to that of the counties. Within the <em>županije</em> are hundreds of <em>općine</em> (municipalities).\"}],\"sections\":[],\"isFilled\":true},\"ref296688\":{\"level\":2,\"id\":\"ref296688\",\"sidebarHeader\":\"Justice\",\"header\":\"Justice\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The Supreme Court, county courts, and municipal courts <a href=\\\"https://www.merriam-webster.com/dictionary/constitute\\\" data-dictionary-link-target=\\\"constitute\\\">constitute</a> the three-tiered <a href=\\\"/topic/judiciary\\\">judicial system</a>. The Supreme Court is the highest legal authority in all matters but constitutional questions, which are decided by the Constitutional Court. <a href=\\\"https://www.merriam-webster.com/dictionary/Justices\\\" data-dictionary-link-target=\\\"Justices\\\">Justices</a> on the Supreme Court are appointed by a judicial council, which is elected by the Sabor. The independence of the judiciary has been questioned, largely because many of the judges who were politically appointed in the 1990s remained in office well into the 21st century. However, there have been significant reforms to the judiciary, largely under EU pressure.\"}],\"sections\":[],\"isFilled\":true},\"ref296689\":{\"level\":2,\"id\":\"ref296689\",\"sidebarHeader\":\"Political process\",\"header\":\"Political process\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Suffrage is universal from age 18, although employed individuals may vote beginning at age 16. Multiparty elections have been held in Croatia since independence. The Croatian Democratic Union (Hrvatska Demokratska Zajednica; HDZ) and the <a href=\\\"/topic/Social-Democratic-Party\\\">Social Democratic Party</a> (Socijaldemokratska partija Hrvatske; SDP) are the predominant political parties. The HDZ dominated politics in the first years of the post-Yugoslav era, having come to power in the parliamentary elections of 1990. The party leader, <a href=\\\"/biography/Franjo-Tudjman\\\">Franjo Tudjman</a>, served as the first president of independent Croatia. The HDZ initially based its <a href=\\\"https://www.merriam-webster.com/dictionary/ideology\\\" data-dictionary-link-target=\\\"ideology\\\">ideology</a> on Croatian <a href=\\\"https://www.merriam-webster.com/dictionary/nationalism\\\" data-dictionary-link-target=\\\"nationalism\\\">nationalism</a> and the struggle for independence, but it began to lose favour after the war ended in 1995 and the population felt the pain of economic collapse. In 2000, the year after Tudjman died, the HDZ was resoundingly defeated in parliamentary and presidential elections. A multiparty centre-left coalition, led by the SDP, then governed until 2003, when the HDZ, having repositioned itself as a typical centre-right party, returned to power. The HDZ and the SDP continued to be the main <a href=\\\"https://www.merriam-webster.com/dictionary/contenders\\\" data-dictionary-link-target=\\\"contenders\\\">contenders</a> in subsequent elections. Both parties favoured Croatian accession to the EU.\"}],\"sections\":[],\"isFilled\":true},\"ref296690\":{\"level\":2,\"id\":\"ref296690\",\"sidebarHeader\":\"Security\",\"header\":\"Security\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Croatia’s armed forces—comprising an army, a navy, and an air force—were created in the early 1990s with significant support from the international <a href=\\\"https://www.merriam-webster.com/dictionary/community\\\" data-dictionary-link-target=\\\"community\\\">community</a>, particularly the <a href=\\\"/place/United-States\\\">United States</a>. Although Croatia had no army to speak of when it declared independence in 1991, within a few years an army had been trained and equipped sufficiently to be able to conduct two major operations to reclaim territory from Serb paramilitaries in 1995. However, Croatia is not a militaristic country, and it relies on the security of the <a href=\\\"/topic/North-Atlantic-Treaty-Organization\\\">North Atlantic Treaty Organization</a> (NATO), which it joined in 2009.\"},{\"tagName\":\"P\",\"html\":\"The Croatian police force, under the authority of the central government, has been reformed since independence. Reform efforts have focused on improving service and stamping out corruption.\"}],\"sections\":[],\"isFilled\":true},\"ref296691\":{\"level\":2,\"id\":\"ref296691\",\"sidebarHeader\":\"Health, welfare, and housing\",\"header\":\"Health, welfare, and housing\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The health of Croatians is good compared with that of the populations of neighbouring countries. Life expectancy at birth is higher than the eastern European average, and the <a href=\\\"/science/infant-mortality-rate\\\">infant mortality rate</a> is significantly lower. The rate of HIV infection is low, reflecting competent prevention efforts. However, the health care system is in need of investment and far-reaching reform because, being almost entirely state-provided, it imposes a substantial burden on the budget. The social welfare system is also burdensome, partly because Croatia has a large number of retirees and unemployed individuals. In urban areas, large portions of the population live in concrete tower blocks built during the Yugoslav era, which are in dire need of investment.\"}],\"sections\":[],\"isFilled\":true},\"ref42775\":{\"level\":2,\"id\":\"ref42775\",\"sidebarHeader\":\"Education\",\"header\":\"Education\",\"elements\":[{\"tagName\":\"P\",\"html\":\"During its 45 years in power, the communist Yugoslav regime reduced illiteracy in Croatia from 16 percent of the population over 10 years of age to less than 4 percent. By the early 21st century, the literacy rate for Croatians over age 14 was nearly 99 percent. In addition to thousands of elementary schools, secondary schools, commercial and technical institutions, and vocational schools, the Yugoslav emphasis on education led to the founding of universities in <a href=\\\"/place/Rijeka\\\">Rijeka</a> in 1973, in <a href=\\\"/place/Split-Croatia\\\">Split</a> in 1974, and in <a href=\\\"/place/Osijek\\\">Osijek</a> in 1975. The oldest university in Croatia is the <span></span>University of Zagreb (1669), which traces its beginnings to a Jesuit school of <a href=\\\"/topic/moral-theology\\\">moral theology</a> founded in 1632.\"}],\"sections\":[],\"isFilled\":true},\"ref42776\":{\"level\":1,\"id\":\"ref42776\",\"sidebarHeader\":\"Cultural life\",\"header\":\"Cultural life\",\"elements\":[],\"sections\":[{\"level\":2,\"id\":\"ref296692\",\"sidebarHeader\":\"Cultural milieu\",\"header\":\"Cultural milieu\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The Yugoslav version of <a href=\\\"/topic/communism\\\">communism</a>—which evolved following <a href=\\\"/place/Yugoslavia-former-federated-nation-1929-2003\\\">Yugoslavia</a>’s 1948 break with the <a href=\\\"/place/Soviet-Union\\\">Soviet Union</a> and the agency of international communism known as <a href=\\\"/topic/Cominform\\\">Cominform</a>—allowed far greater autonomy and self-expression in cultural and other spheres of life than did the communist societies of most of Yugoslavia’s neighbours. As a result, Croatian <a href=\\\"https://www.merriam-webster.com/dictionary/culture\\\" data-dictionary-link-target=\\\"culture\\\">culture</a> was able to develop in <a href=\\\"https://www.merriam-webster.com/dictionary/continuity\\\" data-dictionary-link-target=\\\"continuity\\\">continuity</a> with the Western heritage of which it has long been a part and to which it has contributed for the last thousand years.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296693\",\"sidebarHeader\":\"Daily life and social customs\",\"header\":\"Daily life and social customs\",\"elements\":[{\"tagName\":\"P\",\"html\":\"With a predominantly Roman Catholic population, Croatia observes Catholic religious holidays. Other important national holidays <a href=\\\"https://www.merriam-webster.com/dictionary/commemorate\\\" data-dictionary-link-target=\\\"commemorate\\\">commemorate</a> historical events. Anti-Fascist Resistance Day, June 22, marks the formation of the first <a href=\\\"/topic/Partisan-Yugoslavian-military-force\\\">Partisan</a> unit in Croatia in 1941. Statehood Day, June 25, celebrates Croatia’s declaration of independence from Yugoslavia in 1991. Independence Day, marking the day in 1991 on which Croatia formally broke with Yugoslavia, is October 8.\"},{\"tagName\":\"P\",\"html\":\"Croatian cuisine is heavily influenced by Turkish, central European, and Italian cuisine. Typical dishes are cabbage leaves stuffed with minced meat, <em>ćevapčići</em> (rolls of seasoned grilled meat), dumplings, and pickles. Along the coast, fish is served with <em>blitva</em>, a dish of <a href=\\\"/plant/chard-plant\\\">Swiss chard</a> mixed with potatoes and crushed garlic in <a href=\\\"/topic/olive-oil\\\">olive oil</a>. There are also local delicacies, such as cheese from the island of Pag and wine from any number of good-quality small producers, particularly in Dalmatia.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref278420\",\"sidebarHeader\":\"The arts\",\"header\":\"The arts\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Croatians take pride in their literary tradition, which dates to about 1100, with the dedication of the Baška Tablet (Bašćanska Ploča), a stone monument inscribed with <a href=\\\"/topic/Glagolitic-alphabet\\\">Glagolitic</a> script that was found in the 19th century on the island of <a href=\\\"/place/Krk\\\">Krk</a>. The first printed book in the <a href=\\\"/topic/Serbo-Croatian-language\\\">Croatian language</a> was <em>Hrvoje’s Missal</em>, a liturgical text printed in 1483. Among the 20th-century giants in <a href=\\\"/art/Croatian-literature\\\">Croatian literature</a> are the much-translated novelist, poet, essayist, dramatist, polemicist, and critic <span></span><a href=\\\"/biography/Miroslav-Krleza\\\">Miroslav Krleža</a> (1893–1981) and the lyric poet, essayist, and translator Tin Ujević (1891–1955), both of whom treated psychological and sociopolitical struggles at individual and universal levels.\"},{\"tagName\":\"P\",\"html\":\"The monumental sculptures of the Croatian-born American artist <span></span><a href=\\\"/biography/Ivan-Mestrovic\\\">Ivan Meštrović</a> (1883–1962), whom the French sculptor <a href=\\\"/biography/Auguste-Rodin\\\">Auguste Rodin</a> once called “the biggest phenomenon among sculptors,” synthesize a particularly Croatian national romanticism with the entire European tradition. His works include many religious reliefs and figures carved in walnut. Meštrović designed his own house in <a href=\\\"/place/Split-Croatia\\\">Split</a>, now used as a museum for his works.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/20/36820-004-6E4CF824.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"Croatian visual artists also have been active in several other <a href=\\\"https://www.merriam-webster.com/dictionary/genres\\\" data-dictionary-link-target=\\\"genres\\\">genres</a>. Hundreds of painters and photographers are represented in galleries throughout the country, and traditional Croatian arts, including fine textile and lacework, can still be seen. Croatian naive painting, through a simple depiction of the timeless concerns of men and women, struck a universal chord in the mid- to late 20th century and brought worldwide fame to its main exponents, Ivan Generalić, Ivan Rabuzin, and Ivan Lacković-Croata.\"},{\"tagName\":\"P\",\"html\":\"Film enjoys a particularly important place in contemporary Croatian culture. The <a href=\\\"/place/Zagreb\\\">Zagreb</a> school of film animation has acquired world renown and recognition, including an <a href=\\\"/art/Academy-Award\\\">Academy Award</a> in 1961 for Dušan Vukotić’s animated film <em>The Substitute</em>. Since 1972, Zagreb has periodically hosted an international animated <a href=\\\"/art/film-festival\\\">film festival</a>. Acclaimed Croatian filmmakers of the late 20th and early 21st centuries include Dejan Šorak, Krsto Papić, and Zrinko Ogresta.\"},{\"tagName\":\"P\",\"html\":\"Croatians enjoy music of many varieties, ranging from folk to opera, jazz, and rock. In Croatia and among the Croatian <a href=\\\"https://www.merriam-webster.com/dictionary/diaspora\\\" data-dictionary-link-target=\\\"diaspora\\\">diaspora</a>, traditional music featuring the <em>tamburitza</em>, a <a href=\\\"/art/stringed-instrument\\\">stringed instrument</a> similar to a mandolin (<em>see also</em> <a href=\\\"/art/tanbur\\\">tanbur</a>), has a fervid following. In addition, the traditional <a href=\\\"/art/kolo\\\">kolo</a> dance is still performed at weddings and festivals. Zagreb, Split, and Dubrovnik teem with nightclubs that showcase local musical talent. Tereza Kesovija, arguably Croatia’s most famous singer, first received acclaim in the 1960s as a singer of French chansons. In the late 20th and early 21st centuries Sandra Nasić sang and wrote lyrics for Guano Apes, one of <a href=\\\"/place/Germany\\\">Germany’s</a> most popular rock groups.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/03/115203-004-57C48726.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296694\",\"sidebarHeader\":\"Cultural institutions\",\"header\":\"Cultural institutions\",\"elements\":[{\"tagName\":\"P\",\"html\":\"<a href=\\\"/topic/UNESCO\\\">UNESCO</a> has inscribed several sites in Croatia on its <a href=\\\"/topic/World-Heritage-site\\\">World Heritage List</a>. These include the old city of <a href=\\\"/place/Dubrovnik\\\">Dubrovnik</a> and the historical area of <a href=\\\"/place/Split-Croatia\\\">Split</a> that contains ruins of the <a href=\\\"/topic/Palace-of-Diocletian\\\">palace</a> of the Roman emperor <a href=\\\"/biography/Diocletian\\\">Diocletian</a>. Zagreb hosts the National Theatre, the National and University Library, and a concert hall named after the 19th-century Croatian composer Vatroslav Lisinski.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/68/95568-004-144BDCC9.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/60/121260-004-45AA407C.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref278421\",\"sidebarHeader\":\"Sports and recreation\",\"header\":\"Sports and recreation\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Like most Europeans, Croatians are passionate about <span></span><a href=\\\"/sports/football-soccer\\\">football</a> (soccer). Since independence, Croatia’s national team, made up largely of players from Zagreb and Split, has performed with great distinction. <span></span><a href=\\\"/sports/basketball\\\">Basketball</a> is also widely popular, with Croatian club teams winning several European championships. The well-known basketball player <span></span><a href=\\\"/biography/Drazen-Petrovic\\\">Dražen Petrović</a> played for Croatia’s Olympic team in 1992 as well as in the <a href=\\\"/topic/National-Basketball-Association\\\">National Basketball Association</a>. Croatian tennis players have performed well in international competitions; in particular, <span></span>Goran Ivanišević won the men’s <a href=\\\"/sports/Wimbledon-Championships\\\">Wimbledon</a> championship in 2001.\"},{\"tagName\":\"P\",\"html\":\"Croatian athletes participated on Yugoslavia’s <span></span><a href=\\\"/sports/Olympic-Games\\\">Olympic</a> team from 1948. The independent Republic of Croatia formed a national Olympic committee in 1991, and its athletes competed at the <a href=\\\"/event/Barcelona-1992-Olympic-Games\\\">1992 Summer Olympics in Barcelona</a>, where its basketball squad earned the silver medal. The country’s greatest Summer Olympics strengths are handball (for which it won gold medals in 1996 and 2004) and <a href=\\\"/sports/weightlifting\\\">weight lifting</a> (one gold in 2000), as well as rowing, <a href=\\\"/sports/water-polo\\\">water polo</a>, sailing, swimming, and gymnastics. Croatia also has performed well in the Winter Olympics, with Alpine skier <span></span><a href=\\\"/biography/Janica-Kostelic\\\">Janica Kostelić</a> winning a total of four gold medals in 2002 and 2006 and her brother, Ivica Kostelić, winning silver medals in 2006 and 2010.\"},{\"tagName\":\"P\",\"html\":\"Croatia has a number of national parks and reserves that are popular with hikers and other nature enthusiasts. <a href=\\\"/place/Plitvicka-Lakes\\\">Plitvička Lakes</a> National Park features an extensive waterfall system. The stunning natural beauty of many of Croatia’s islands is preserved in the national parks of Brijuni, Kornati, and Mljet. The North Velebit, Paklenica, and Risnjak national parks <a href=\\\"https://www.merriam-webster.com/dictionary/encompass\\\" data-dictionary-link-target=\\\"encompass\\\">encompass</a> mountainous terrain, while the Krka National Park is centred on the river of the same name.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/14/114614-004-FDBB3210.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296695\",\"sidebarHeader\":\"Media and publishing\",\"header\":\"Media and publishing\",\"elements\":[{\"tagName\":\"P\",\"html\":\"During the 1990s, the Croatian media appeared to be easily influenced by the political agenda of the government. Although <a href=\\\"/topic/media-freedom\\\">media freedom</a> and independence have progressed significantly since that time, <a href=\\\"/topic/market\\\">market</a> pressures now may pose a greater threat to media freedom. Several newspapers, based in various cities, focus on politics or business, but a number of the daily papers are tabloids. Croatia’s well-respected independent weekly newspaper, <em>Feral Tribune</em>, closed down in 2008 because of financial problems. The departure of <em>Feral</em> left <em>Nacional</em>, another weekly, as the main source of independent commentary. However, the assassination of its editor in 2008 revived concerns about freedom of the press.\"},{\"tagName\":\"P\",\"html\":\"Television is dominated by the state provider, Croatian Radio-Television (Hrvatska Radiotelevizija; HRT), which derives a good portion of its revenue from a compulsory subscription fee. It has some respected current affairs programs but largely focuses on sports and entertainment. Two significant privately owned channels are Nova TV and RTL; both tend toward sensationalism. In addition to the HRT-run radio networks, there are a few private radio operations.\"}],\"sections\":[],\"isFilled\":true}],\"isFilled\":true},\"ref296692\":{\"level\":2,\"id\":\"ref296692\",\"sidebarHeader\":\"Cultural milieu\",\"header\":\"Cultural milieu\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The Yugoslav version of <a href=\\\"/topic/communism\\\">communism</a>—which evolved following <a href=\\\"/place/Yugoslavia-former-federated-nation-1929-2003\\\">Yugoslavia</a>’s 1948 break with the <a href=\\\"/place/Soviet-Union\\\">Soviet Union</a> and the agency of international communism known as <a href=\\\"/topic/Cominform\\\">Cominform</a>—allowed far greater autonomy and self-expression in cultural and other spheres of life than did the communist societies of most of Yugoslavia’s neighbours. As a result, Croatian <a href=\\\"https://www.merriam-webster.com/dictionary/culture\\\" data-dictionary-link-target=\\\"culture\\\">culture</a> was able to develop in <a href=\\\"https://www.merriam-webster.com/dictionary/continuity\\\" data-dictionary-link-target=\\\"continuity\\\">continuity</a> with the Western heritage of which it has long been a part and to which it has contributed for the last thousand years.\"}],\"sections\":[],\"isFilled\":true},\"ref296693\":{\"level\":2,\"id\":\"ref296693\",\"sidebarHeader\":\"Daily life and social customs\",\"header\":\"Daily life and social customs\",\"elements\":[{\"tagName\":\"P\",\"html\":\"With a predominantly Roman Catholic population, Croatia observes Catholic religious holidays. Other important national holidays <a href=\\\"https://www.merriam-webster.com/dictionary/commemorate\\\" data-dictionary-link-target=\\\"commemorate\\\">commemorate</a> historical events. Anti-Fascist Resistance Day, June 22, marks the formation of the first <a href=\\\"/topic/Partisan-Yugoslavian-military-force\\\">Partisan</a> unit in Croatia in 1941. Statehood Day, June 25, celebrates Croatia’s declaration of independence from Yugoslavia in 1991. Independence Day, marking the day in 1991 on which Croatia formally broke with Yugoslavia, is October 8.\"},{\"tagName\":\"P\",\"html\":\"Croatian cuisine is heavily influenced by Turkish, central European, and Italian cuisine. Typical dishes are cabbage leaves stuffed with minced meat, <em>ćevapčići</em> (rolls of seasoned grilled meat), dumplings, and pickles. Along the coast, fish is served with <em>blitva</em>, a dish of <a href=\\\"/plant/chard-plant\\\">Swiss chard</a> mixed with potatoes and crushed garlic in <a href=\\\"/topic/olive-oil\\\">olive oil</a>. There are also local delicacies, such as cheese from the island of Pag and wine from any number of good-quality small producers, particularly in Dalmatia.\"}],\"sections\":[],\"isFilled\":true},\"ref278420\":{\"level\":2,\"id\":\"ref278420\",\"sidebarHeader\":\"The arts\",\"header\":\"The arts\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Croatians take pride in their literary tradition, which dates to about 1100, with the dedication of the Baška Tablet (Bašćanska Ploča), a stone monument inscribed with <a href=\\\"/topic/Glagolitic-alphabet\\\">Glagolitic</a> script that was found in the 19th century on the island of <a href=\\\"/place/Krk\\\">Krk</a>. The first printed book in the <a href=\\\"/topic/Serbo-Croatian-language\\\">Croatian language</a> was <em>Hrvoje’s Missal</em>, a liturgical text printed in 1483. Among the 20th-century giants in <a href=\\\"/art/Croatian-literature\\\">Croatian literature</a> are the much-translated novelist, poet, essayist, dramatist, polemicist, and critic <span></span><a href=\\\"/biography/Miroslav-Krleza\\\">Miroslav Krleža</a> (1893–1981) and the lyric poet, essayist, and translator Tin Ujević (1891–1955), both of whom treated psychological and sociopolitical struggles at individual and universal levels.\"},{\"tagName\":\"P\",\"html\":\"The monumental sculptures of the Croatian-born American artist <span></span><a href=\\\"/biography/Ivan-Mestrovic\\\">Ivan Meštrović</a> (1883–1962), whom the French sculptor <a href=\\\"/biography/Auguste-Rodin\\\">Auguste Rodin</a> once called “the biggest phenomenon among sculptors,” synthesize a particularly Croatian national romanticism with the entire European tradition. His works include many religious reliefs and figures carved in walnut. Meštrović designed his own house in <a href=\\\"/place/Split-Croatia\\\">Split</a>, now used as a museum for his works.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/20/36820-004-6E4CF824.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"Croatian visual artists also have been active in several other <a href=\\\"https://www.merriam-webster.com/dictionary/genres\\\" data-dictionary-link-target=\\\"genres\\\">genres</a>. Hundreds of painters and photographers are represented in galleries throughout the country, and traditional Croatian arts, including fine textile and lacework, can still be seen. Croatian naive painting, through a simple depiction of the timeless concerns of men and women, struck a universal chord in the mid- to late 20th century and brought worldwide fame to its main exponents, Ivan Generalić, Ivan Rabuzin, and Ivan Lacković-Croata.\"},{\"tagName\":\"P\",\"html\":\"Film enjoys a particularly important place in contemporary Croatian culture. The <a href=\\\"/place/Zagreb\\\">Zagreb</a> school of film animation has acquired world renown and recognition, including an <a href=\\\"/art/Academy-Award\\\">Academy Award</a> in 1961 for Dušan Vukotić’s animated film <em>The Substitute</em>. Since 1972, Zagreb has periodically hosted an international animated <a href=\\\"/art/film-festival\\\">film festival</a>. Acclaimed Croatian filmmakers of the late 20th and early 21st centuries include Dejan Šorak, Krsto Papić, and Zrinko Ogresta.\"},{\"tagName\":\"P\",\"html\":\"Croatians enjoy music of many varieties, ranging from folk to opera, jazz, and rock. In Croatia and among the Croatian <a href=\\\"https://www.merriam-webster.com/dictionary/diaspora\\\" data-dictionary-link-target=\\\"diaspora\\\">diaspora</a>, traditional music featuring the <em>tamburitza</em>, a <a href=\\\"/art/stringed-instrument\\\">stringed instrument</a> similar to a mandolin (<em>see also</em> <a href=\\\"/art/tanbur\\\">tanbur</a>), has a fervid following. In addition, the traditional <a href=\\\"/art/kolo\\\">kolo</a> dance is still performed at weddings and festivals. Zagreb, Split, and Dubrovnik teem with nightclubs that showcase local musical talent. Tereza Kesovija, arguably Croatia’s most famous singer, first received acclaim in the 1960s as a singer of French chansons. In the late 20th and early 21st centuries Sandra Nasić sang and wrote lyrics for Guano Apes, one of <a href=\\\"/place/Germany\\\">Germany’s</a> most popular rock groups.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/03/115203-004-57C48726.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},\"ref296694\":{\"level\":2,\"id\":\"ref296694\",\"sidebarHeader\":\"Cultural institutions\",\"header\":\"Cultural institutions\",\"elements\":[{\"tagName\":\"P\",\"html\":\"<a href=\\\"/topic/UNESCO\\\">UNESCO</a> has inscribed several sites in Croatia on its <a href=\\\"/topic/World-Heritage-site\\\">World Heritage List</a>. These include the old city of <a href=\\\"/place/Dubrovnik\\\">Dubrovnik</a> and the historical area of <a href=\\\"/place/Split-Croatia\\\">Split</a> that contains ruins of the <a href=\\\"/topic/Palace-of-Diocletian\\\">palace</a> of the Roman emperor <a href=\\\"/biography/Diocletian\\\">Diocletian</a>. Zagreb hosts the National Theatre, the National and University Library, and a concert hall named after the 19th-century Croatian composer Vatroslav Lisinski.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/68/95568-004-144BDCC9.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/60/121260-004-45AA407C.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},\"ref278421\":{\"level\":2,\"id\":\"ref278421\",\"sidebarHeader\":\"Sports and recreation\",\"header\":\"Sports and recreation\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Like most Europeans, Croatians are passionate about <span></span><a href=\\\"/sports/football-soccer\\\">football</a> (soccer). Since independence, Croatia’s national team, made up largely of players from Zagreb and Split, has performed with great distinction. <span></span><a href=\\\"/sports/basketball\\\">Basketball</a> is also widely popular, with Croatian club teams winning several European championships. The well-known basketball player <span></span><a href=\\\"/biography/Drazen-Petrovic\\\">Dražen Petrović</a> played for Croatia’s Olympic team in 1992 as well as in the <a href=\\\"/topic/National-Basketball-Association\\\">National Basketball Association</a>. Croatian tennis players have performed well in international competitions; in particular, <span></span>Goran Ivanišević won the men’s <a href=\\\"/sports/Wimbledon-Championships\\\">Wimbledon</a> championship in 2001.\"},{\"tagName\":\"P\",\"html\":\"Croatian athletes participated on Yugoslavia’s <span></span><a href=\\\"/sports/Olympic-Games\\\">Olympic</a> team from 1948. The independent Republic of Croatia formed a national Olympic committee in 1991, and its athletes competed at the <a href=\\\"/event/Barcelona-1992-Olympic-Games\\\">1992 Summer Olympics in Barcelona</a>, where its basketball squad earned the silver medal. The country’s greatest Summer Olympics strengths are handball (for which it won gold medals in 1996 and 2004) and <a href=\\\"/sports/weightlifting\\\">weight lifting</a> (one gold in 2000), as well as rowing, <a href=\\\"/sports/water-polo\\\">water polo</a>, sailing, swimming, and gymnastics. Croatia also has performed well in the Winter Olympics, with Alpine skier <span></span><a href=\\\"/biography/Janica-Kostelic\\\">Janica Kostelić</a> winning a total of four gold medals in 2002 and 2006 and her brother, Ivica Kostelić, winning silver medals in 2006 and 2010.\"},{\"tagName\":\"P\",\"html\":\"Croatia has a number of national parks and reserves that are popular with hikers and other nature enthusiasts. <a href=\\\"/place/Plitvicka-Lakes\\\">Plitvička Lakes</a> National Park features an extensive waterfall system. The stunning natural beauty of many of Croatia’s islands is preserved in the national parks of Brijuni, Kornati, and Mljet. The North Velebit, Paklenica, and Risnjak national parks <a href=\\\"https://www.merriam-webster.com/dictionary/encompass\\\" data-dictionary-link-target=\\\"encompass\\\">encompass</a> mountainous terrain, while the Krka National Park is centred on the river of the same name.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/14/114614-004-FDBB3210.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},\"ref296695\":{\"level\":2,\"id\":\"ref296695\",\"sidebarHeader\":\"Media and publishing\",\"header\":\"Media and publishing\",\"elements\":[{\"tagName\":\"P\",\"html\":\"During the 1990s, the Croatian media appeared to be easily influenced by the political agenda of the government. Although <a href=\\\"/topic/media-freedom\\\">media freedom</a> and independence have progressed significantly since that time, <a href=\\\"/topic/market\\\">market</a> pressures now may pose a greater threat to media freedom. Several newspapers, based in various cities, focus on politics or business, but a number of the daily papers are tabloids. Croatia’s well-respected independent weekly newspaper, <em>Feral Tribune</em>, closed down in 2008 because of financial problems. The departure of <em>Feral</em> left <em>Nacional</em>, another weekly, as the main source of independent commentary. However, the assassination of its editor in 2008 revived concerns about freedom of the press.\"},{\"tagName\":\"P\",\"html\":\"Television is dominated by the state provider, Croatian Radio-Television (Hrvatska Radiotelevizija; HRT), which derives a good portion of its revenue from a compulsory subscription fee. It has some respected current affairs programs but largely focuses on sports and entertainment. Two significant privately owned channels are Nova TV and RTL; both tend toward sensationalism. In addition to the HRT-run radio networks, there are a few private radio operations.\"}],\"sections\":[],\"isFilled\":true},\"ref223953\":{\"level\":1,\"id\":\"ref223953\",\"sidebarHeader\":\"History\",\"header\":\"History\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The territory of Croatia bridges the central European and Mediterranean worlds, and its history has been marked by this position as a borderland. It lay near the division between the two halves of the <span></span><a href=\\\"/place/Roman-Empire\\\">Roman Empire</a> and between their <a href=\\\"/place/Byzantine-Empire\\\">Byzantine</a> and <a href=\\\"/topic/Frank-people\\\">Frankish</a> successors. The <span></span><a href=\\\"/topic/Eastern-Orthodoxy\\\">Eastern</a> and Western churches competed for influence there, and, as the frontier of Christendom, it confronted the limits of Muslim expansion into <a href=\\\"/place/Europe\\\">Europe</a>. As a part of <a href=\\\"/place/Yugoslavia-former-federated-nation-1929-2003\\\">Yugoslavia</a> after both World Wars, it struggled within the Serbian-dominated state of the interwar years and emerged from <a href=\\\"/event/World-War-II\\\">World War II</a> as a separate republic in the communist federation that navigated between the Soviet and Western blocs. All these competing interests have had an influence on Croatia’s development.\"}],\"sections\":[{\"level\":2,\"id\":\"ref43554\",\"sidebarHeader\":\"Croatia to the Ottoman conquests\",\"header\":\"Croatia to the Ottoman conquests\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The lands where the <span></span><a href=\\\"/topic/Croat\\\">Croats</a> would settle and establish their state lay just within the borders of the Western Roman Empire. In the 6th and 7th centuries <span>ce</span>, <span></span><a href=\\\"/topic/Slav\\\">Slavs</a> arrived in the western <a href=\\\"/place/Balkans\\\">Balkans</a>, settling on <a href=\\\"https://www.merriam-webster.com/dictionary/Byzantine\\\" data-dictionary-link-target=\\\"Byzantine\\\">Byzantine</a> territory along the Adriatic and in the hinterland and gradually merging with the <a href=\\\"https://www.merriam-webster.com/dictionary/indigenous\\\" data-dictionary-link-target=\\\"indigenous\\\">indigenous</a> Latinized population. Eventually they accepted the <a href=\\\"/topic/Roman-Catholicism\\\">Roman Catholic Church</a>, though preserving a <a href=\\\"/topic/Old-Church-Slavonic-language\\\">Slavonic</a> liturgy. In the 9th century an independent Croatian state developed with its centre in northern <span></span><a href=\\\"/place/Dalmatia\\\">Dalmatia</a>, later incorporating Croatia proper and <a href=\\\"/place/Slavonia\\\">Slavonia</a> as well. This state grew into a powerful military force under King <span></span>Tomislav (reigned <em>c.</em> 910–928). Croatia retained its independence under native kings until 1102, when the crown passed into the hands of the <a href=\\\"/topic/Hungarian-people\\\">Hungarian</a> <a href=\\\"https://www.merriam-webster.com/dictionary/dynasty\\\" data-dictionary-link-target=\\\"dynasty\\\">dynasty</a>. The precise terms of this relationship later became a matter of dispute. Nonetheless, even under dynastic union with <span></span><a href=\\\"/place/Hungary\\\">Hungary</a>, institutions of separate Croatian statehood were maintained through the Sabor (an assembly of Croatian nobles) and the <span></span><a href=\\\"/topic/ban-Hungarian-official\\\">ban</a> (viceroy). In addition, the Croatian nobles retained their lands and titles.\"},{\"tagName\":\"P\",\"html\":\"Over the following centuries, the area associated with the name Croatia shifted gradually north and west as its territory was eroded, first with the loss of Dalmatia to <a href=\\\"/place/Venice\\\">Venice</a> by 1420 and then as a result of <span></span><a href=\\\"/place/Ottoman-Empire\\\">Ottoman</a> conquests in the 16th century. The Croatian nobility maintained their claims to lands occupied by the Ottomans, hoping to repossess them once liberated. A Croatian national tradition also survived within these territories, as well as in lands under Venetian rule. A broader Croatian ethnic identity would be further consolidated among the Catholics of Dalmatia and of <a href=\\\"/place/Bosnia-and-Herzegovina\\\">Bosnia and Herzegovina</a> during the nationalist movements of the 19th century.\"},{\"tagName\":\"P\",\"html\":\"The <span></span><a href=\\\"/topic/history-of-Austria\\\">Austrian</a> <span></span><a href=\\\"/topic/House-of-Habsburg\\\">Habsburgs</a>, elected to the throne of Croatia in 1527 after the death of King <a href=\\\"/biography/Louis-II-king-of-Hungary-and-Bohemia\\\">Louis II</a> of Hungary at the <a href=\\\"/event/Battle-of-Mohacs\\\">Battle of Mohács</a>, defended the “remnant of the remnants” of Croatia by establishing the Military Frontier (German: Militärgrenze; Serbo-Croatian: Vojna Krajina), a defensive zone along the border with the Ottoman-controlled lands. Because it was ruled directly by the Habsburg war council, the Military Frontier further reduced the amount of land under the control of Croatian nobles, the Sabor, and the ban. Furthermore, its military units and their land rights attracted not only some Croatian peasants but also a larger Orthodox inflow from the Ottoman-conquered territories. Such was the origin of Croatia’s minority <span></span><a href=\\\"/topic/Serb\\\">Serb</a> population.\"},{\"tagName\":\"P\",\"html\":\"Under the pressures caused by the Ottoman invasions and increased obligations to landlords, the position of the Croatian peasantry deteriorated, leading to a number of rebellions—most notably in 1573. The nobility, too, was under pressure from Habsburg absolutism. An anti-Habsburg <a href=\\\"https://www.merriam-webster.com/dictionary/conspiracy\\\" data-dictionary-link-target=\\\"conspiracy\\\">conspiracy</a> of Croatian and Hungarian nobles was unsuccessful, and its leaders, including Petar Zrinski, ban of Croatia, were executed in 1671. Their extensive properties in Croatia were confiscated by the Habsburg crown.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref43555\",\"sidebarHeader\":\"Ragusa and the Croat Renaissance in Dalmatia\",\"header\":\"Ragusa and the Croat Renaissance in Dalmatia\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The Adriatic port of Ragusa had been founded by Latinized colonists, but by the 14th century it had been largely Slavicized and had acquired its alternate name of <span></span><a href=\\\"/place/Dubrovnik\\\">Dubrovnik</a>. The largely Croat republic of Ragusa maintained a precarious autonomy under the suzerainty of Venice, Hungary, and (after 1397) the <a href=\\\"/place/Ottoman-Empire\\\">Ottoman Empire</a>. Its wealth as a trading power was based on its role as an intermediary between East and West, and it nurtured a flourishing cultural life. In the 16th and 17th centuries, Ragusa and other Dalmatian cities under the rule of Venice became the centre of the Croat Renaissance, which produced, in addition to works of art and science, an extensive and powerful literature that had a lasting influence on the development of the Croatian literary language. As a mercantile power, however, Ragusa eventually entered a decline parallel to that of Venice, so that by the 18th century it had become little more than an economic backwater. Ragusa retained its autonomy as a city-state until 1806, when it was occupied by <a href=\\\"/biography/Napoleon-I\\\">Napoleon I</a>’s armies. During the French occupation of all of Dalmatia, which lasted until 1813, the region was designated as part of the <a href=\\\"/place/Illyrian-Provinces\\\">Illyrian Provinces</a>, where education and publications in South Slav languages were allowed.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref43556\",\"sidebarHeader\":\"Croatian national revival\",\"header\":\"Croatian national revival\",\"elements\":[{\"tagName\":\"P\",\"html\":\"From the end of the 17th century, the Habsburgs began to regain Croatian crown lands, first from the Ottomans (with the treaties of <span></span><a href=\\\"/event/Treaty-of-Carlowitz\\\">Carlowitz</a> in 1699 and <span></span><a href=\\\"/event/Treaty-of-Passarowitz\\\">Passarowitz</a> in 1718) and then from Venice after the <a href=\\\"/event/French-revolutionary-wars\\\">Napoleonic Wars</a> (confirmed by the <a href=\\\"/event/Congress-of-Vienna\\\">Congress of Vienna</a> in 1815). For the most part these territories were not rejoined to Croatia but were either incorporated into the Military Frontier or organized as separate provinces—as in the case of Austrian Habsburg Dalmatia. Much of the land was distributed to German or Hungarian magnates and military dignitaries.\"},{\"tagName\":\"P\",\"html\":\"The Croat nobility was impoverished, often culturally <a href=\\\"https://www.merriam-webster.com/dictionary/assimilated\\\" data-dictionary-link-target=\\\"assimilated\\\">assimilated</a>, and too weak to withstand the Habsburg centralization and Germanization that began in the 18th century under the Austrian archduchess and Holy Roman empress <a href=\\\"/biography/Maria-Theresa\\\">Maria Theresa</a> and continued under her son, the Holy Roman emperor <a href=\\\"/biography/Joseph-II\\\">Joseph II</a>. As the best defense of their rights and privileges, the Croats turned to cooperation with the Hungarians, but this choice would later expose them to the rising force of Hungarian nationalism. When Hungarian, rather than Latin, was imposed as the official language in Hungary and Croatia, Croatian resistance took shape in the <span></span><a href=\\\"/topic/Illyrian-movement\\\">Illyrian movement</a> of the 1830s and ’40s. The Illyrianists—primarily <a href=\\\"https://www.merriam-webster.com/dictionary/intellectuals\\\" data-dictionary-link-target=\\\"intellectuals\\\">intellectuals</a>, professionals, clergymen, and gentry led by the linguistic reformer <span></span><a href=\\\"/biography/Ljudevit-Gaj\\\">Ljudevit Gaj</a>—strove to defend Croatian interests by calling for the unification of all the South Slavs, to be <a href=\\\"https://www.merriam-webster.com/dictionary/facilitated\\\" data-dictionary-link-target=\\\"facilitated\\\">facilitated</a> through the adoption of a single literary language. Though the Illyrianists failed to win over the other South Slavs, they did succeed in <a href=\\\"https://www.merriam-webster.com/dictionary/integrating\\\" data-dictionary-link-target=\\\"integrating\\\">integrating</a> the linguistically and administratively divided Croats within one national movement.\"},{\"tagName\":\"P\",\"html\":\"Threatened by Hungarian <span></span><a href=\\\"/topic/nationalism\\\">nationalism</a> in the <a href=\\\"/event/Revolutions-of-1848\\\">Revolution of 1848</a> and hoping for national unification and autonomy within the Austrian Empire, the Croats, under Ban <span></span><a href=\\\"/biography/Josip-Count-Jelacic\\\">Josip Jelačić</a>, an Illyrianist, sided with the Austrian dynasty against the Hungarians. Yet, instead of a reward, the Croats received the same central control and Germanization that were dealt out to the Hungarians as punishment. Reaction against these disappointments encouraged the development of the <span></span>Party of Right, led by <span></span>Ante Starčević, which emphasized the idea of Croatian “state rights” and aspired to the creation of an independent Great Croatia. The necessity of relying on the other South Slavs in opposition to the Habsburgs and Hungarians also kept alive the Illyrian idea, revived in the 1860s under the name <span></span>Yugoslavism. The Yugoslavists, under the patronage of Bishop <span></span><a href=\\\"/biography/Joseph-George-Strossmayer\\\">Josip Juraj Štrossmajer</a> (<a href=\\\"/biography/Joseph-George-Strossmayer\\\">Joseph George Strossmayer</a>), advocated South Slav unity within a federated Habsburg state as the basis for an independent Balkan state. Croatian separatism and South Slav cooperation (Yugoslavism) thus became the two <a href=\\\"https://www.merriam-webster.com/dictionary/alternatives\\\" data-dictionary-link-target=\\\"alternatives\\\">alternatives</a> that would shape much of Croatian political thought in the future.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/65/121265-004-3E433E44.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref43557\",\"sidebarHeader\":\"Croatia in Austria-Hungary\",\"header\":\"Croatia in Austria-Hungary\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The Habsburg monarchy was reconstituted in 1867 as <a href=\\\"/place/Austria-Hungary\\\">Austria-Hungary</a>, with Croatia-Slavonia placed under the rule of Hungary and with Dalmatia, <span></span><a href=\\\"/place/Istria\\\">Istria</a>, and the Military Frontier remaining under <a href=\\\"/place/Vienna\\\">Vienna</a>. Under an 1868 agreement between Croatia and Hungary, known as the <span></span><a href=\\\"/event/Nagodba\\\">Nagodba</a>, Croatian statehood was formally recognized, but Croatia was in fact stripped of all real control over its affairs. The Sabor requested that Bosnia and Herzegovina, under Habsburg occupation from 1878, be incorporated into Croatia on the grounds that those lands had been part of the <a href=\\\"https://www.merriam-webster.com/dictionary/medieval\\\" data-dictionary-link-target=\\\"medieval\\\">medieval</a> kingdom. The request was rejected, but the Military Frontier was rejoined to Croatia in 1881. In the following decades, Hungarian domination of Croatian politics was maintained by Ban Károly Khuen-Héderváry, a Hungarian magnate, and supported by those in Croatia who favoured cooperation with <a href=\\\"/place/Budapest\\\">Budapest</a>. The government also gained support through <a href=\\\"https://www.merriam-webster.com/dictionary/concessions\\\" data-dictionary-link-target=\\\"concessions\\\">concessions</a> to the Serbs, who, with the incorporation of the Military Frontier, had become a larger proportion of Croatia’s population. These changes increased Croat-Serb antagonism in Croatia, as did the Croatian opposition’s demands for greater Croatian autonomy.\"},{\"tagName\":\"P\",\"html\":\"However, the crisis of Austro-Hungarian dualism and the accession of the Russophilic <span></span><a href=\\\"/topic/Karadjordjevic-dynasty\\\">Karadjordjević dynasty</a> in <a href=\\\"/place/Serbia\\\">Serbia</a> in 1903 created a more favourable climate for cooperation, embodied in the <span></span>Croat-Serb Coalition of political parties. Launched by the Rijeka Resolution of 1905, the coalition emphasized the links between Croats and Serbs, and in the following years it attracted wide support. Discontent with the existing order contributed to the growing belief that the problems of Croatia could best be solved in a South Slav state, either within Austria-Hungary or outside it—although there was disagreement about what shape such a state would take and about the status of its <a href=\\\"https://www.merriam-webster.com/dictionary/constituent\\\" data-dictionary-link-target=\\\"constituent\\\">constituent</a> nationalities.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref223954\",\"sidebarHeader\":\"From World War I to the establishment of the Kingdom of Serbs, Croats, and Slovenes\",\"header\":\"From World War I to the establishment of the Kingdom of Serbs, Croats, and Slovenes\",\"elements\":[{\"tagName\":\"P\",\"html\":\"New solutions to <span></span><a href=\\\"/topic/history-of-Croatia\\\">Croatia</a>’s problems became possible with the dissolution of Austria-Hungary during <a href=\\\"/event/World-War-I\\\">World War I</a>. However, Croatia’s postwar future was threatened by the 1915 <span></span><a href=\\\"/event/Treaty-of-London\\\">Treaty of London</a>, which promised <span></span><a href=\\\"/topic/history-of-Italy\\\">Italy</a> extensive Habsburg territories on the Adriatic in return for entering the war on the <a href=\\\"/topic/Allied-Powers-international-alliance\\\">Allied</a> side. Representatives of the Habsburg South Slavs in exile, led by the former Croat-Serb Coalition politicians <span></span><a href=\\\"/biography/Ante-Trumbic\\\">Ante Trumbić</a> and <span></span><a href=\\\"/biography/Frano-Supilo\\\">Frano Supilo</a>, set up the Yugoslav Committee to promote the cause of a new Yugoslav state that was to be based on the national unity of the South Slavs and on the principle of self-determination. In July 1917 the leaders of the Yugoslav Committee and representatives of the Serbian government-in-exile signed the <span></span><a href=\\\"/event/Corfu-Declaration\\\">Corfu Declaration</a>, announcing the intention of founding at the end of the war a unified South Slav state, conceived of as a democratic, constitutional, and parliamentary monarchy under the Karadjordjević dynasty. The agreement with Serbia would save Croatia from being partitioned by the Allies as part of vanquished Austria-Hungary, but the declaration did not specify whether the new state would be a federation of equal partners or would merely represent an extension of the Serbian administrative system.\"},{\"tagName\":\"P\",\"html\":\"At the same time, a movement for unification developed among South Slav politicians still living under Habsburg authority in Croatia. With the Habsburg monarchy collapsing, the peasantry in revolt, and the Serbian and Italian armies advancing toward Croatian territory, the Croatian Sabor voted in October 1918 to break relations with <span></span><a href=\\\"/topic/history-of-Austria\\\">Austria</a>-<span></span><a href=\\\"/topic/history-of-Hungary\\\">Hungary</a> and declared the unification of the lands of Croatia, Dalmatia, and Slavonia in an independent Croatian state. Soon, however, the Sabor announced the incorporation of Croatia into a South Slav state and transferred its power to the newly created <span></span>National Council of Slovenes, Croats, and Serbs in <a href=\\\"/place/Zagreb\\\">Zagreb</a>. One dissenting voice was that of <span></span><a href=\\\"/biography/Stjepan-Radic\\\">Stjepan Radić</a>, leader of the <span></span><a href=\\\"/topic/Croatian-Peasant-Party\\\">Croatian Peasant Party</a>, who opposed unconditional unification with no reference to the will of the people of Croatia and with no guarantees of national equality in the future state. Notwithstanding the Peasant Party’s objections, in November 1918 representatives of the National Council, the Yugoslav Committee, and the Serbian government signed the Geneva declaration calling for the establishment of a South <span></span><a href=\\\"/topic/Slav\\\">Slav</a> state with a form of government to be decided by a national Constituent Assembly. On December 1, 1918, delegates of the National Council met Serbia’s regent, <span></span><a href=\\\"/biography/Alexander-I-king-of-Yugoslavia\\\">Alexander I</a>, to <a href=\\\"https://www.merriam-webster.com/dictionary/affiliate\\\" data-dictionary-link-target=\\\"affiliate\\\">affiliate</a> themselves to the <a href=\\\"/place/Kingdom-of-Serbs-Croats-and-Slovenes\\\">Kingdom of Serbs, Croats, and Slovenes</a>.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref223955\",\"sidebarHeader\":\"Croatia in Yugoslavia, 1918–41\",\"header\":\"Croatia in Yugoslavia, 1918–41\",\"elements\":[{\"tagName\":\"P\",\"html\":\"In many respects, the <span></span><a href=\\\"/place/Kingdom-of-Serbs-Croats-and-Slovenes\\\">Kingdom of Serbs, Croats, and Slovenes</a> represented an expansion of Serbian <a href=\\\"https://www.merriam-webster.com/dictionary/hegemony\\\" data-dictionary-link-target=\\\"hegemony\\\">hegemony</a> over new territories, particularly in <a href=\\\"/place/Kosovo\\\">Kosovo</a> and <a href=\\\"/place/Macedonia\\\">Macedonia</a>. In Croatia, discontent with the new state was demonstrated by the massive electoral success of Radić’s Croatian Peasant Party. Refusing to accept the unification act, Radić called instead for an independent Croatian peasant republic. In elections to the Constituent Assembly in 1920, his party received the fourth largest bloc of votes, but Radić <a href=\\\"https://www.merriam-webster.com/dictionary/boycotted\\\" data-dictionary-link-target=\\\"boycotted\\\">boycotted</a> the assembly, thus making possible the adoption of a constitution in 1921 that imposed a highly centralized administration on the new state. In the following decade the kingdom’s multiparty parliament came to be controlled by Serbian centralists, while Croatia’s elected representatives, led by Radić and the Peasant Party, continued to demand a federal system that would allow Croatia autonomy. The parliament made some progress in <a href=\\\"/topic/land-reform\\\">agrarian reform</a>, with peasants receiving land expropriated from large estates. However, by 1928, when Radić and four other Croatian deputies were assassinated on the floor of the parliament by a Montenegrin deputy, national conflict had brought the <a href=\\\"/topic/political-system\\\">political system</a> to a standstill.\"},{\"tagName\":\"P\",\"html\":\"Under the dictatorship established in 1929, King Alexander attempted to override ethnic divisions by introducing a supranational patriotism symbolized by the new name of <a href=\\\"/place/Yugoslavia-former-federated-nation-1929-2003\\\">Yugoslavia</a>. The internal borders of the country were redrawn, so that historical Croatia was subdivided into several new <em>banovine</em> (provinces) named after rivers and natural features. However, Croatian nationalism and opposition to the state system were not <a href=\\\"https://www.merriam-webster.com/dictionary/eradicated\\\" data-dictionary-link-target=\\\"eradicated\\\">eradicated</a> by this policy of unitarism—and neither was Serbian hegemony, which simply continued under the name of Yugoslavism. Political repression bred extremism among some opponents of the regime. In 1934 <span></span><a href=\\\"/biography/Alexander-I-king-of-Yugoslavia\\\">Alexander</a> was assassinated as the result of a plot hatched by the Croatian <span></span><a href=\\\"/topic/Ustasa\\\">Ustaša</a> (“Insurgence”), a separatist association founded in 1929 by <span></span><a href=\\\"/biography/Ante-Pavelic\\\">Ante Pavelić</a> and enjoying the support of Italy’s fascist leader, <a href=\\\"/biography/Benito-Mussolini\\\">Benito Mussolini</a>. Unlike the majority of Croats, who still believed in a federal solution, members of the Ustaša insisted that only the destruction of Yugoslavia could liberate Croatia.\"},{\"tagName\":\"P\",\"html\":\"The new Yugoslav regent, Prince <a href=\\\"/biography/Prince-Paul-Karadjordjevic\\\">Paul Karadjordjević</a>, permitted some relaxation in political life, though he prevented the restoration of full democratic rights. The desire for political change led to the formation of a united Yugoslav opposition, which argued for the reinstatement of <a href=\\\"https://www.merriam-webster.com/dictionary/democracy\\\" data-dictionary-link-target=\\\"democracy\\\">democracy</a> and for constitutional reform. In Croatia this opposition included the Peasant Party, now led by <span></span><a href=\\\"/biography/Vladko-Macek\\\">Vladko Maček</a>. In the elections of 1938, the <span></span><a href=\\\"/topic/Croatian-Peasant-Party\\\">Peasant Party</a> received 80 percent of the vote in Croatia and Dalmatia. Faced with such evidence of popular support for the opposition program, Prince Paul encouraged negotiations between the government and Maček. These culminated in the <span></span><a href=\\\"/topic/Sporazum\\\">Sporazum</a> (“Agreement”) of <a href=\\\"https://www.merriam-webster.com/dictionary/August\\\" data-dictionary-link-target=\\\"August\\\">August</a> 26, 1939, which created an <a href=\\\"https://www.merriam-webster.com/dictionary/autonomous\\\" data-dictionary-link-target=\\\"autonomous\\\">autonomous</a> Croatian <em>banovina</em> that was largely self-governing except in defense and foreign affairs. The agreement provoked resentment among the Serbs, even in the opposition.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref223956\",\"sidebarHeader\":\"World War II\",\"header\":\"World War II\",\"elements\":[{\"tagName\":\"P\",\"html\":\"War broke out soon after the Sporazum was signed, and Yugoslavia declared its neutrality. Invasion, occupation, and partition followed in 1941. In their campaign against Yugoslavia, the <span></span><a href=\\\"/topic/history-of-Germany\\\">Germans</a> exploited Croatian discontent, presenting themselves as liberators and inciting Croats in the armed forces to mutiny. In April 1941 Germans and Italians set up the Independent State of Croatia, which also embraced Bosnia and Herzegovina and those parts of Dalmatia that had not been ceded to Italy. Though in fact this state was under occupation by the German and <span></span><a href=\\\"/topic/history-of-Italy\\\">Italian</a> armies, Pavelić’s Ustaša was put into power—a takeover facilitated by the refusal of Maček to take part in a puppet government and by the passivity of the Roman Catholic archbishop of Zagreb, Alojzije Stepinac. Initially there was enthusiasm for the independent state, but once in power the Ustaša ruthlessly persecuted Serbs, Jews, Roma (Gypsies), and antifascist Croats. The Ustaša planned to eliminate Croatia’s Serb minority partly by conversion from Orthodoxy to Catholicism, partly by expulsion, and partly by extermination. As many as 350,000 to 450,000 victims were killed in Ustaša massacres and in the <a href=\\\"https://www.merriam-webster.com/dictionary/notorious\\\" data-dictionary-link-target=\\\"notorious\\\">notorious</a> <a href=\\\"/topic/concentration-camp\\\">concentration camp</a> at Jasenovac.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/21/115621-004-95CAC9BA.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"Sporadic resistance, particularly by Croatia’s Serbs, began almost immediately, but it was the communist <a href=\\\"/topic/Partisan-Yugoslavian-military-force\\\">Partisans</a>, under <span></span><a href=\\\"/biography/Josip-Broz-Tito\\\">Josip Broz Tito</a> (himself a Croat), who provided the resistance with leadership and a program. Croatian Serbs joined the Partisans in flight from Ustaša terror. Antifascist Croats subsequently were attracted by the Partisans’ broad popular front and by their emphasis on national self-determination, particularly the proposed reordering of postwar Yugoslavia along federal lines. Mass enlistment in their ranks made the Partisans more successful in Croatia and in Bosnia and Herzegovina than anywhere else outside their mountain strongholds. By 1944 most of Croatia—apart from the main cities—was liberated territory, and Croats were joining the Partisans’ ranks in <a href=\\\"/topic/large-numbers-1765137\\\">large numbers</a>. As the war neared its end, however, many Croats, especially those compromised by involvement with the Ustaša regime and those who opposed the communists, fled north along with other refugees toward the Allied armies. British commanders refused to accept their surrender and handed them over to the Partisans, who took a merciless revenge. Tens of thousands, including some civilians, were subsequently slaughtered on forced marches and in death camps.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref223957\",\"sidebarHeader\":\"Croatia in Yugoslavia, 1945–91\",\"header\":\"Croatia in Yugoslavia, 1945–91\",\"elements\":[{\"tagName\":\"P\",\"html\":\"After 1945 Croatia was a republic within the Socialist Federal Republic of Yugoslavia. This new federation was intended to satisfy the national <a href=\\\"https://www.merriam-webster.com/dictionary/aspirations\\\" data-dictionary-link-target=\\\"aspirations\\\">aspirations</a> of all its peoples, but a centrally controlled <span></span><a href=\\\"/topic/communism\\\">Communist</a> Party and a supranational push for Yugoslav unity undermined this structure. The effects were felt in Croatia in such matters as the purge in 1948 of the Croatian communist Andrija Hebrang and others who had supported first Croatian national interests and then the Soviet side in Tito’s split with <a href=\\\"/biography/Joseph-Stalin\\\">Joseph Stalin</a>. A later issue was the Partisan-based Serb predominance in the Yugoslav army and the local Croatian police. By the 1960s Croats had grown increasingly critical of the economic centralization that appropriated part of the republic’s income for investment in other parts of the federation.\"},{\"tagName\":\"P\",\"html\":\"Beginning in the early 1960s, the Yugoslav government instituted a number of economic reforms and attempts at political liberalization and decentralization. Encouraged in Croatia by a reformist party leadership under Miko Tripalo and Savka Dabčević-Kučar, these reforms contributed to the flowering of a “Croatian Spring” in 1969–71. The movement took the shape of a cultural and <span></span><a href=\\\"/topic/nationalism\\\">national</a> revival, expressed in large part through the activities of the cultural organization Matica Hrvatska, but it soon culminated in calls for greater Croatian autonomy. Warning of the danger of civil war, <span></span><a href=\\\"/biography/Josip-Broz-Tito\\\">Tito</a> intervened and reimposed “democratic centralism” through a series of purges and trials that decimated the ranks of Croatian politicians and intellectuals. The political restrictions were not <a href=\\\"https://www.merriam-webster.com/dictionary/alleviated\\\" data-dictionary-link-target=\\\"alleviated\\\">alleviated</a> by the 1974 Yugoslav constitution: although the republics gained greater autonomy within the federation, they were still controlled by their single-party regimes.\"},{\"tagName\":\"P\",\"html\":\"This centralized control began to break down in the late 1980s, however. In 1989, as communist hegemony was challenged throughout eastern Europe, the Slovene and Croatian communists agreed to free multiparty elections. The right-wing, nationalist <span></span><a href=\\\"/topic/Croatian-Democratic-Union\\\">Croatian Democratic Union</a> (Hrvatska Demokratska Zajednica; HDZ), led by <span></span><a href=\\\"/biography/Franjo-Tudjman\\\">Franjo Tudjman</a> (a former party member who had been jailed during the suppression of the Croatian Spring), was victorious in the <span></span><a href=\\\"/topic/Croat\\\">Croatian</a> elections of 1990. The <span></span><a href=\\\"/topic/Serb\\\">Serb</a> minority was deeply alarmed by Croatia’s new constitution (promulgated in December 1990), which omitted Serbs as a “constituent people,” and by the actions of the new government, which purged Serbs from <a href=\\\"/topic/public-administration\\\">public administration</a>, especially the police. Serbs’ fears also were aroused by accusations, especially from <a href=\\\"/place/Belgrade\\\">Belgrade</a>, that Croatian nationalism meant a return to fascism and the anti-Serb violence of World War II.\"},{\"tagName\":\"P\",\"html\":\"When independence was declared on June 25, 1991, armed clashes spread in protest throughout Serb enclaves in Croatia. This violence coincided with the hasty withdrawal of the <span></span><a href=\\\"/topic/Yugoslav-Peoples-Army\\\">Yugoslav People’s Army</a> from a newly independent <a href=\\\"/place/Slovenia\\\">Slovenia</a>. Turning to oppose Croatia’s independence, a larger <a href=\\\"https://www.merriam-webster.com/dictionary/contingent\\\" data-dictionary-link-target=\\\"contingent\\\">contingent</a> of army forces attacked the new regime. In the ensuing war, the city of Vukovar in <a href=\\\"/place/Slavonia\\\">Slavonia</a> was leveled by bombardment, <a href=\\\"/place/Dubrovnik\\\">Dubrovnik</a> and other <span></span><a href=\\\"/place/Dalmatia\\\">Dalmatian</a> cities were shelled, and about one-third of Croatian territory was occupied by Yugoslav forces. Warfare was halted by an agreement whereby European troops, sponsored by the <a href=\\\"/topic/United-Nations\\\">United Nations</a> (UN), were installed in the disputed areas in order to stabilize and demilitarize them. Although Croatia was granted international recognition in 1992, the government’s control over its own territories remained incomplete.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref284760\",\"sidebarHeader\":\"Independent Croatia\",\"header\":\"Independent Croatia\",\"elements\":[{\"tagName\":\"P\",\"html\":\"In May and August 1995 two Croatian military offensives regained control of western Slavonia and central Croatia from rebel Serbs. Croatia was disappointed, however, when in November the U.S.-brokered <a href=\\\"/event/Dayton-Accords\\\">Dayton Accords</a> failed to provide a clear timetable for the return of eastern Slavonia to Zagreb’s control. In 1996 <a href=\\\"/biography/Slobodan-Milosevic\\\">Slobodan Milošević</a>, Serbia’s president and the effective leader of the rump Yugoslavia, agreed to give up claims to eastern Slavonia. Yugoslav troops then withdrew from the region under a UN <a href=\\\"https://www.merriam-webster.com/dictionary/mandate\\\" data-dictionary-link-target=\\\"mandate\\\">mandate</a>, and Yugoslavia established full diplomatic relations with Croatia. Croatia recovered full <a href=\\\"https://www.merriam-webster.com/dictionary/sovereignty\\\" data-dictionary-link-target=\\\"sovereignty\\\">sovereignty</a> over eastern Slavonia in 1998, and, with the withdrawal of UN troops from the Prelavka Peninsula in 2002, Croatia finally had full control of its territory.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/70/135670-004-DA1E444F.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"Tudjman died in December 1999, and <span></span><a href=\\\"/biography/Stipe-Mesic\\\">Stipe Mesić</a>, who had broken with the HDZ over Tudjman’s autocratic rule, was elected president in February 2000. Mesić quickly moved to cut down corruption and to improve Croatia’s relations with its neighbours, but he failed to deliver on promises of early entry to the <span></span><a href=\\\"/topic/North-Atlantic-Treaty-Organization\\\">North Atlantic Treaty Organization</a> (NATO) or the <span></span><a href=\\\"/topic/European-Union\\\">European Union</a> (EU). Croatia continued to suffer deep economic and political divisions, particularly over cooperation with the <span></span><a href=\\\"/topic/International-Criminal-Tribunal-for-the-Former-Yugoslavia\\\">International Criminal Tribunal for the Former Yugoslavia</a> (ICTY), which indicted several Croatian generals who, according to many Croats, had heroic wartime reputations.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/30/127930-004-DF12FC44.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"With the success of the HDZ in the 2003 parliamentary elections, Croatia’s broad-based <a href=\\\"/topic/coalition-government\\\">coalition government</a> fell, and HDZ leader Ivo Sanader became prime minister of a new centre-right government. In 2004 Croatia became an official EU candidate, but negotiations were postponed in 2005 after the ICTY raised concerns about the country’s commitment to bringing war criminals to <a href=\\\"https://www.merriam-webster.com/dictionary/justice\\\" data-dictionary-link-target=\\\"justice\\\">justice</a>. EU officials also questioned Croatia’s dedication to eliminating corruption. By the following year, however, several key suspects had been arrested or tried for war crimes, and the government had adopted a strong anticorruption strategy. These developments <a href=\\\"https://www.merriam-webster.com/dictionary/bolstered\\\" data-dictionary-link-target=\\\"bolstered\\\">bolstered</a> hopes that Croatia could join the EU by the end of the decade. Meanwhile, the country’s economy, helped by the spectacular growth of tourism, began to improve. The status of the much-reduced Serb minority also was boosted by the inclusion of an ethnic Serb in the cabinet of the HDZ-led coalition government that came to power in 2008. On April 1, 2009, NATO officially welcomed Croatia as a member of the alliance.\"},{\"tagName\":\"P\",\"html\":\"By mid-2009 the outlook was not as promising. Although neighbouring <a href=\\\"/place/Slovenia\\\">Slovenia</a>—a member of both NATO and the EU—had agreed to Croatia’s NATO membership, it continued to block Croatian accession negotiations with the EU, claiming that the countries’ ongoing border dispute needed to be resolved first. (The dispute, focused on the maritime border in the Bay of Piran, had originated in 1991 when both countries seceded from Yugoslavia.) Adding to Croatia’s problems, the growing global financial crisis caused the economy to contract sharply during the first half of 2009, and by the end of the year it had suffered a decline of 6 percent of <a href=\\\"/topic/gross-domestic-product\\\">gross domestic product</a>. Croatia faced yet another hurdle when Prime Minister Sanader resigned on July 1, 2009. Fellow HDZ member <span></span>Jadranka Kosor, who had been serving as deputy prime minister, succeeded Sanader. She was the first woman to hold the Croatian prime ministership.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/29/133729-004-DC385D49.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"In January 2010 <span></span>Ivo Josipović, a member of the opposition Social Democratic Party of Croatia (Socijaldemokratska partija Hrvatske; SDP), was elected president. Despite his political differences with the ruling HDZ, he promised to support Prime Minister Kosor’s goals of expediting EU membership talks and fighting corruption. Nevertheless, the relative inexperience of the two new leaders and the jockeying of their parties for advantage in the 2011 parliamentary elections kept their differences in play. The HDZ’s continued emphasis on an exclusively Croatian national identity and history still separated its adherents from many younger urban voters and the remaining Serb minority. Some HDZ supporters, for instance, objected to the public apology that Josipović made in April 2010 to Bosnia and Herzegovina for Croatia’s role in the warfare there in the early 1990s. Meanwhile, the SDP was drawn into the public’s continued concerns about EU membership when one of the party’s major supporters, a large public employees’ union, objected to labour-related conditions imposed by the EU on prospective members. The objections slowed the full-scale labour reform that would be needed for EU accession. Larger concerns for EU accession, however, remained judicial reform in general and the conclusion of several corruption trials in particular. Still, the fact that both major parties and the respected Croatian National Bank supported membership in the EU was a major advantage in the accession process, which had gained momentum after November 2009, when Slovenia and Croatia agreed to have their border dispute settled by international arbitration.\"},{\"tagName\":\"P\",\"html\":\"After more than a decade of effort and six years of formal talks, the accession process reached a final milestone in June 2011, when Croatia closed negotiations with the EU. This accomplishment did little to <a href=\\\"https://www.merriam-webster.com/dictionary/bolster\\\" data-dictionary-link-target=\\\"bolster\\\">bolster</a> public approval of the HDZ, however, as corruption scandals—the most notable involving former prime minister Sanader—bogged down the party throughout the year. Croatia also struggled with the economic <a href=\\\"https://www.merriam-webster.com/dictionary/malaise\\\" data-dictionary-link-target=\\\"malaise\\\">malaise</a> that had afflicted the rest of Europe, and, like ruling parties across the continent throughout 2011, the HDZ suffered for it at the polls. In the general election on December 4, 2011, the opposition <span></span>Kukuriku coalition, headed by <span></span>Zoran Milanović of the SDP, swept the HDZ from power and claimed an overall majority in parliament, winning 80 of 151 seats. Just days after the election, as Milanović began the work of constructing his government, Croatia signed the accession treaty that would enable it to join the EU in 2013. In a referendum held in January 2012, accession received approval from two-thirds of Croatian voters, but voter turnout, at 43.6 percent, marked the lowest level of participation for any poll on EU entry. Nevertheless, thousands celebrated in Zagreb on July 1, 2013, when Croatia completed its decadelong accession journey to become the 28th member of the EU.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/71/172271-004-F96B9198.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"While full EU membership opened the door to financial assistance, Croatia did not make effective use of EU structural funds to help improve its business climate, and the country faced its sixth consecutive year of recession in 2014. As public finances deteriorated, investor confidence weakened, and Croatia’s <a href=\\\"https://www.merriam-webster.com/dictionary/sovereign\\\" data-dictionary-link-target=\\\"sovereign\\\">sovereign</a> credit rating suffered. Critics blamed successive governments for failing to introduce reform, partly because of public mistrust of market capitalism.\"},{\"tagName\":\"P\",\"html\":\"Opposition candidate <span></span>Kolinda Grabar-Kitarović narrowly topped incumbent Josipović in balloting in January 2015, becoming Croatia’s first woman president. The election was seen as a referendum on Milanović’s centre-left government, and the defeat of Josipović, who had enjoyed widespread popularity throughout much of his term, signaled dissatisfaction with the pace of Croatia’s economic recovery.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/43/193043-004-A4E36B08.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"Domestic politics was complicated further by the European migrant crisis, which saw refugees from <a href=\\\"/place/North-Africa\\\">North Africa</a>, the <a href=\\\"/place/Middle-East\\\">Middle East</a>, and <a href=\\\"/place/Afghanistan\\\">Afghanistan</a> attempting to transit Croatia en route to northern Europe. As neighbouring countries enacted tighter border restrictions, tens of thousands of migrants became trapped in Croatia. In early November 2015 the <a href=\\\"/topic/European-Commission\\\">European Commission</a> offered $18 million in emergency funding to help pay for police officers <a href=\\\"https://www.merriam-webster.com/dictionary/deployed\\\" data-dictionary-link-target=\\\"deployed\\\">deployed</a> along the Croatian-Serbian border and to fund temporary detention centres. By that point, well over 300,000 migrants had entered Croatia.\"},{\"tagName\":\"P\",\"html\":\"Parliamentary elections held on November 8, 2015, were inconclusive, with the HDZ and SDP finishing in a dead heat. Elsewhere in Europe, far right parties had capitalized on the migrant crisis by stoking nationalist <a href=\\\"https://www.merriam-webster.com/dictionary/sentiment\\\" data-dictionary-link-target=\\\"sentiment\\\">sentiment</a>, but Croatian voters largely supported Milanović’s evenhanded response, and that enabled the SDP to cut into the HDZ’s pre-election lead. Weeks of coalition talks followed, with the centrist Bridge of Independent Lists (Most Nezavisnih Lista) ultimately acting as kingmakers for the HDZ. In January 2016 <span></span>Tihomir Orešković was sworn in as the nonpartisan technocratic head of a centre-right coalition government. Orešković, a pharmaceutical <a href=\\\"/topic/executive-government\\\">executive</a> who held dual Croatian and Canadian citizenship, seemingly was chosen for his financial <a href=\\\"https://www.merriam-webster.com/dictionary/acumen\\\" data-dictionary-link-target=\\\"acumen\\\">acumen</a>, as Croatia struggled to maintain the fragile economic recovery that had begun in late 2015.\"},{\"tagName\":\"P\",\"html\":\"After just five months in office, however, Orešković’s government was toppled by a vote of no confidence after a bribery scandal enveloped one of his deputy prime ministers. The HDZ emerged as the winner in snap elections held on September 11, 2016, and the following month HDZ leader <span></span>Andrej Plenković was confirmed as prime minister at the head of a centre-right coalition government. Plenković presided over a healthy economic recovery, but further <a href=\\\"https://www.merriam-webster.com/dictionary/integration\\\" data-dictionary-link-target=\\\"integration\\\">integration</a> with the EU was hindered by Croatia’s ongoing border dispute with Slovenia. In June 2017 the Permanent Court of Arbitration at The Hague ruled in favour of Slovenia, stating that a “junction area” should be created in the <a href=\\\"/place/Adriatic-Sea\\\">Adriatic Sea</a> that would allow Slovenian shipping to pass through waters claimed by Croatia. Plenković rejected the decision as nonbinding and declared that it would not be <a href=\\\"https://www.merriam-webster.com/dictionary/implemented\\\" data-dictionary-link-target=\\\"implemented\\\">implemented</a>.\"},{\"tagName\":\"P\",\"html\":\"Croatia marked the five-year anniversary of its accession to the EU on July 1, 2018. With that landmark came the expiration of labour regulations that had limited the rights of Croatian citizens to pursue work throughout the EU. While many EU members lifted these labour controls on or ahead of that date, several countries, including Austria and Slovenia, elected to extend the restrictions for an additional two years.\"}],\"sections\":[],\"isFilled\":true}],\"isFilled\":true},\"ref43554\":{\"level\":2,\"id\":\"ref43554\",\"sidebarHeader\":\"Croatia to the Ottoman conquests\",\"header\":\"Croatia to the Ottoman conquests\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The lands where the <span></span><a href=\\\"/topic/Croat\\\">Croats</a> would settle and establish their state lay just within the borders of the Western Roman Empire. In the 6th and 7th centuries <span>ce</span>, <span></span><a href=\\\"/topic/Slav\\\">Slavs</a> arrived in the western <a href=\\\"/place/Balkans\\\">Balkans</a>, settling on <a href=\\\"https://www.merriam-webster.com/dictionary/Byzantine\\\" data-dictionary-link-target=\\\"Byzantine\\\">Byzantine</a> territory along the Adriatic and in the hinterland and gradually merging with the <a href=\\\"https://www.merriam-webster.com/dictionary/indigenous\\\" data-dictionary-link-target=\\\"indigenous\\\">indigenous</a> Latinized population. Eventually they accepted the <a href=\\\"/topic/Roman-Catholicism\\\">Roman Catholic Church</a>, though preserving a <a href=\\\"/topic/Old-Church-Slavonic-language\\\">Slavonic</a> liturgy. In the 9th century an independent Croatian state developed with its centre in northern <span></span><a href=\\\"/place/Dalmatia\\\">Dalmatia</a>, later incorporating Croatia proper and <a href=\\\"/place/Slavonia\\\">Slavonia</a> as well. This state grew into a powerful military force under King <span></span>Tomislav (reigned <em>c.</em> 910–928). Croatia retained its independence under native kings until 1102, when the crown passed into the hands of the <a href=\\\"/topic/Hungarian-people\\\">Hungarian</a> <a href=\\\"https://www.merriam-webster.com/dictionary/dynasty\\\" data-dictionary-link-target=\\\"dynasty\\\">dynasty</a>. The precise terms of this relationship later became a matter of dispute. Nonetheless, even under dynastic union with <span></span><a href=\\\"/place/Hungary\\\">Hungary</a>, institutions of separate Croatian statehood were maintained through the Sabor (an assembly of Croatian nobles) and the <span></span><a href=\\\"/topic/ban-Hungarian-official\\\">ban</a> (viceroy). In addition, the Croatian nobles retained their lands and titles.\"},{\"tagName\":\"P\",\"html\":\"Over the following centuries, the area associated with the name Croatia shifted gradually north and west as its territory was eroded, first with the loss of Dalmatia to <a href=\\\"/place/Venice\\\">Venice</a> by 1420 and then as a result of <span></span><a href=\\\"/place/Ottoman-Empire\\\">Ottoman</a> conquests in the 16th century. The Croatian nobility maintained their claims to lands occupied by the Ottomans, hoping to repossess them once liberated. A Croatian national tradition also survived within these territories, as well as in lands under Venetian rule. A broader Croatian ethnic identity would be further consolidated among the Catholics of Dalmatia and of <a href=\\\"/place/Bosnia-and-Herzegovina\\\">Bosnia and Herzegovina</a> during the nationalist movements of the 19th century.\"},{\"tagName\":\"P\",\"html\":\"The <span></span><a href=\\\"/topic/history-of-Austria\\\">Austrian</a> <span></span><a href=\\\"/topic/House-of-Habsburg\\\">Habsburgs</a>, elected to the throne of Croatia in 1527 after the death of King <a href=\\\"/biography/Louis-II-king-of-Hungary-and-Bohemia\\\">Louis II</a> of Hungary at the <a href=\\\"/event/Battle-of-Mohacs\\\">Battle of Mohács</a>, defended the “remnant of the remnants” of Croatia by establishing the Military Frontier (German: Militärgrenze; Serbo-Croatian: Vojna Krajina), a defensive zone along the border with the Ottoman-controlled lands. Because it was ruled directly by the Habsburg war council, the Military Frontier further reduced the amount of land under the control of Croatian nobles, the Sabor, and the ban. Furthermore, its military units and their land rights attracted not only some Croatian peasants but also a larger Orthodox inflow from the Ottoman-conquered territories. Such was the origin of Croatia’s minority <span></span><a href=\\\"/topic/Serb\\\">Serb</a> population.\"},{\"tagName\":\"P\",\"html\":\"Under the pressures caused by the Ottoman invasions and increased obligations to landlords, the position of the Croatian peasantry deteriorated, leading to a number of rebellions—most notably in 1573. The nobility, too, was under pressure from Habsburg absolutism. An anti-Habsburg <a href=\\\"https://www.merriam-webster.com/dictionary/conspiracy\\\" data-dictionary-link-target=\\\"conspiracy\\\">conspiracy</a> of Croatian and Hungarian nobles was unsuccessful, and its leaders, including Petar Zrinski, ban of Croatia, were executed in 1671. Their extensive properties in Croatia were confiscated by the Habsburg crown.\"}],\"sections\":[],\"isFilled\":true},\"ref43555\":{\"level\":2,\"id\":\"ref43555\",\"sidebarHeader\":\"Ragusa and the Croat Renaissance in Dalmatia\",\"header\":\"Ragusa and the Croat Renaissance in Dalmatia\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The Adriatic port of Ragusa had been founded by Latinized colonists, but by the 14th century it had been largely Slavicized and had acquired its alternate name of <span></span><a href=\\\"/place/Dubrovnik\\\">Dubrovnik</a>. The largely Croat republic of Ragusa maintained a precarious autonomy under the suzerainty of Venice, Hungary, and (after 1397) the <a href=\\\"/place/Ottoman-Empire\\\">Ottoman Empire</a>. Its wealth as a trading power was based on its role as an intermediary between East and West, and it nurtured a flourishing cultural life. In the 16th and 17th centuries, Ragusa and other Dalmatian cities under the rule of Venice became the centre of the Croat Renaissance, which produced, in addition to works of art and science, an extensive and powerful literature that had a lasting influence on the development of the Croatian literary language. As a mercantile power, however, Ragusa eventually entered a decline parallel to that of Venice, so that by the 18th century it had become little more than an economic backwater. Ragusa retained its autonomy as a city-state until 1806, when it was occupied by <a href=\\\"/biography/Napoleon-I\\\">Napoleon I</a>’s armies. During the French occupation of all of Dalmatia, which lasted until 1813, the region was designated as part of the <a href=\\\"/place/Illyrian-Provinces\\\">Illyrian Provinces</a>, where education and publications in South Slav languages were allowed.\"}],\"sections\":[],\"isFilled\":true},\"ref43556\":{\"level\":2,\"id\":\"ref43556\",\"sidebarHeader\":\"Croatian national revival\",\"header\":\"Croatian national revival\",\"elements\":[{\"tagName\":\"P\",\"html\":\"From the end of the 17th century, the Habsburgs began to regain Croatian crown lands, first from the Ottomans (with the treaties of <span></span><a href=\\\"/event/Treaty-of-Carlowitz\\\">Carlowitz</a> in 1699 and <span></span><a href=\\\"/event/Treaty-of-Passarowitz\\\">Passarowitz</a> in 1718) and then from Venice after the <a href=\\\"/event/French-revolutionary-wars\\\">Napoleonic Wars</a> (confirmed by the <a href=\\\"/event/Congress-of-Vienna\\\">Congress of Vienna</a> in 1815). For the most part these territories were not rejoined to Croatia but were either incorporated into the Military Frontier or organized as separate provinces—as in the case of Austrian Habsburg Dalmatia. Much of the land was distributed to German or Hungarian magnates and military dignitaries.\"},{\"tagName\":\"P\",\"html\":\"The Croat nobility was impoverished, often culturally <a href=\\\"https://www.merriam-webster.com/dictionary/assimilated\\\" data-dictionary-link-target=\\\"assimilated\\\">assimilated</a>, and too weak to withstand the Habsburg centralization and Germanization that began in the 18th century under the Austrian archduchess and Holy Roman empress <a href=\\\"/biography/Maria-Theresa\\\">Maria Theresa</a> and continued under her son, the Holy Roman emperor <a href=\\\"/biography/Joseph-II\\\">Joseph II</a>. As the best defense of their rights and privileges, the Croats turned to cooperation with the Hungarians, but this choice would later expose them to the rising force of Hungarian nationalism. When Hungarian, rather than Latin, was imposed as the official language in Hungary and Croatia, Croatian resistance took shape in the <span></span><a href=\\\"/topic/Illyrian-movement\\\">Illyrian movement</a> of the 1830s and ’40s. The Illyrianists—primarily <a href=\\\"https://www.merriam-webster.com/dictionary/intellectuals\\\" data-dictionary-link-target=\\\"intellectuals\\\">intellectuals</a>, professionals, clergymen, and gentry led by the linguistic reformer <span></span><a href=\\\"/biography/Ljudevit-Gaj\\\">Ljudevit Gaj</a>—strove to defend Croatian interests by calling for the unification of all the South Slavs, to be <a href=\\\"https://www.merriam-webster.com/dictionary/facilitated\\\" data-dictionary-link-target=\\\"facilitated\\\">facilitated</a> through the adoption of a single literary language. Though the Illyrianists failed to win over the other South Slavs, they did succeed in <a href=\\\"https://www.merriam-webster.com/dictionary/integrating\\\" data-dictionary-link-target=\\\"integrating\\\">integrating</a> the linguistically and administratively divided Croats within one national movement.\"},{\"tagName\":\"P\",\"html\":\"Threatened by Hungarian <span></span><a href=\\\"/topic/nationalism\\\">nationalism</a> in the <a href=\\\"/event/Revolutions-of-1848\\\">Revolution of 1848</a> and hoping for national unification and autonomy within the Austrian Empire, the Croats, under Ban <span></span><a href=\\\"/biography/Josip-Count-Jelacic\\\">Josip Jelačić</a>, an Illyrianist, sided with the Austrian dynasty against the Hungarians. Yet, instead of a reward, the Croats received the same central control and Germanization that were dealt out to the Hungarians as punishment. Reaction against these disappointments encouraged the development of the <span></span>Party of Right, led by <span></span>Ante Starčević, which emphasized the idea of Croatian “state rights” and aspired to the creation of an independent Great Croatia. The necessity of relying on the other South Slavs in opposition to the Habsburgs and Hungarians also kept alive the Illyrian idea, revived in the 1860s under the name <span></span>Yugoslavism. The Yugoslavists, under the patronage of Bishop <span></span><a href=\\\"/biography/Joseph-George-Strossmayer\\\">Josip Juraj Štrossmajer</a> (<a href=\\\"/biography/Joseph-George-Strossmayer\\\">Joseph George Strossmayer</a>), advocated South Slav unity within a federated Habsburg state as the basis for an independent Balkan state. Croatian separatism and South Slav cooperation (Yugoslavism) thus became the two <a href=\\\"https://www.merriam-webster.com/dictionary/alternatives\\\" data-dictionary-link-target=\\\"alternatives\\\">alternatives</a> that would shape much of Croatian political thought in the future.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/65/121265-004-3E433E44.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},\"ref43557\":{\"level\":2,\"id\":\"ref43557\",\"sidebarHeader\":\"Croatia in Austria-Hungary\",\"header\":\"Croatia in Austria-Hungary\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The Habsburg monarchy was reconstituted in 1867 as <a href=\\\"/place/Austria-Hungary\\\">Austria-Hungary</a>, with Croatia-Slavonia placed under the rule of Hungary and with Dalmatia, <span></span><a href=\\\"/place/Istria\\\">Istria</a>, and the Military Frontier remaining under <a href=\\\"/place/Vienna\\\">Vienna</a>. Under an 1868 agreement between Croatia and Hungary, known as the <span></span><a href=\\\"/event/Nagodba\\\">Nagodba</a>, Croatian statehood was formally recognized, but Croatia was in fact stripped of all real control over its affairs. The Sabor requested that Bosnia and Herzegovina, under Habsburg occupation from 1878, be incorporated into Croatia on the grounds that those lands had been part of the <a href=\\\"https://www.merriam-webster.com/dictionary/medieval\\\" data-dictionary-link-target=\\\"medieval\\\">medieval</a> kingdom. The request was rejected, but the Military Frontier was rejoined to Croatia in 1881. In the following decades, Hungarian domination of Croatian politics was maintained by Ban Károly Khuen-Héderváry, a Hungarian magnate, and supported by those in Croatia who favoured cooperation with <a href=\\\"/place/Budapest\\\">Budapest</a>. The government also gained support through <a href=\\\"https://www.merriam-webster.com/dictionary/concessions\\\" data-dictionary-link-target=\\\"concessions\\\">concessions</a> to the Serbs, who, with the incorporation of the Military Frontier, had become a larger proportion of Croatia’s population. These changes increased Croat-Serb antagonism in Croatia, as did the Croatian opposition’s demands for greater Croatian autonomy.\"},{\"tagName\":\"P\",\"html\":\"However, the crisis of Austro-Hungarian dualism and the accession of the Russophilic <span></span><a href=\\\"/topic/Karadjordjevic-dynasty\\\">Karadjordjević dynasty</a> in <a href=\\\"/place/Serbia\\\">Serbia</a> in 1903 created a more favourable climate for cooperation, embodied in the <span></span>Croat-Serb Coalition of political parties. Launched by the Rijeka Resolution of 1905, the coalition emphasized the links between Croats and Serbs, and in the following years it attracted wide support. Discontent with the existing order contributed to the growing belief that the problems of Croatia could best be solved in a South Slav state, either within Austria-Hungary or outside it—although there was disagreement about what shape such a state would take and about the status of its <a href=\\\"https://www.merriam-webster.com/dictionary/constituent\\\" data-dictionary-link-target=\\\"constituent\\\">constituent</a> nationalities.\"}],\"sections\":[],\"isFilled\":true},\"ref223954\":{\"level\":2,\"id\":\"ref223954\",\"sidebarHeader\":\"From World War I to the establishment of the Kingdom of Serbs, Croats, and Slovenes\",\"header\":\"From World War I to the establishment of the Kingdom of Serbs, Croats, and Slovenes\",\"elements\":[{\"tagName\":\"P\",\"html\":\"New solutions to <span></span><a href=\\\"/topic/history-of-Croatia\\\">Croatia</a>’s problems became possible with the dissolution of Austria-Hungary during <a href=\\\"/event/World-War-I\\\">World War I</a>. However, Croatia’s postwar future was threatened by the 1915 <span></span><a href=\\\"/event/Treaty-of-London\\\">Treaty of London</a>, which promised <span></span><a href=\\\"/topic/history-of-Italy\\\">Italy</a> extensive Habsburg territories on the Adriatic in return for entering the war on the <a href=\\\"/topic/Allied-Powers-international-alliance\\\">Allied</a> side. Representatives of the Habsburg South Slavs in exile, led by the former Croat-Serb Coalition politicians <span></span><a href=\\\"/biography/Ante-Trumbic\\\">Ante Trumbić</a> and <span></span><a href=\\\"/biography/Frano-Supilo\\\">Frano Supilo</a>, set up the Yugoslav Committee to promote the cause of a new Yugoslav state that was to be based on the national unity of the South Slavs and on the principle of self-determination. In July 1917 the leaders of the Yugoslav Committee and representatives of the Serbian government-in-exile signed the <span></span><a href=\\\"/event/Corfu-Declaration\\\">Corfu Declaration</a>, announcing the intention of founding at the end of the war a unified South Slav state, conceived of as a democratic, constitutional, and parliamentary monarchy under the Karadjordjević dynasty. The agreement with Serbia would save Croatia from being partitioned by the Allies as part of vanquished Austria-Hungary, but the declaration did not specify whether the new state would be a federation of equal partners or would merely represent an extension of the Serbian administrative system.\"},{\"tagName\":\"P\",\"html\":\"At the same time, a movement for unification developed among South Slav politicians still living under Habsburg authority in Croatia. With the Habsburg monarchy collapsing, the peasantry in revolt, and the Serbian and Italian armies advancing toward Croatian territory, the Croatian Sabor voted in October 1918 to break relations with <span></span><a href=\\\"/topic/history-of-Austria\\\">Austria</a>-<span></span><a href=\\\"/topic/history-of-Hungary\\\">Hungary</a> and declared the unification of the lands of Croatia, Dalmatia, and Slavonia in an independent Croatian state. Soon, however, the Sabor announced the incorporation of Croatia into a South Slav state and transferred its power to the newly created <span></span>National Council of Slovenes, Croats, and Serbs in <a href=\\\"/place/Zagreb\\\">Zagreb</a>. One dissenting voice was that of <span></span><a href=\\\"/biography/Stjepan-Radic\\\">Stjepan Radić</a>, leader of the <span></span><a href=\\\"/topic/Croatian-Peasant-Party\\\">Croatian Peasant Party</a>, who opposed unconditional unification with no reference to the will of the people of Croatia and with no guarantees of national equality in the future state. Notwithstanding the Peasant Party’s objections, in November 1918 representatives of the National Council, the Yugoslav Committee, and the Serbian government signed the Geneva declaration calling for the establishment of a South <span></span><a href=\\\"/topic/Slav\\\">Slav</a> state with a form of government to be decided by a national Constituent Assembly. On December 1, 1918, delegates of the National Council met Serbia’s regent, <span></span><a href=\\\"/biography/Alexander-I-king-of-Yugoslavia\\\">Alexander I</a>, to <a href=\\\"https://www.merriam-webster.com/dictionary/affiliate\\\" data-dictionary-link-target=\\\"affiliate\\\">affiliate</a> themselves to the <a href=\\\"/place/Kingdom-of-Serbs-Croats-and-Slovenes\\\">Kingdom of Serbs, Croats, and Slovenes</a>.\"}],\"sections\":[],\"isFilled\":true},\"ref223955\":{\"level\":2,\"id\":\"ref223955\",\"sidebarHeader\":\"Croatia in Yugoslavia, 1918–41\",\"header\":\"Croatia in Yugoslavia, 1918–41\",\"elements\":[{\"tagName\":\"P\",\"html\":\"In many respects, the <span></span><a href=\\\"/place/Kingdom-of-Serbs-Croats-and-Slovenes\\\">Kingdom of Serbs, Croats, and Slovenes</a> represented an expansion of Serbian <a href=\\\"https://www.merriam-webster.com/dictionary/hegemony\\\" data-dictionary-link-target=\\\"hegemony\\\">hegemony</a> over new territories, particularly in <a href=\\\"/place/Kosovo\\\">Kosovo</a> and <a href=\\\"/place/Macedonia\\\">Macedonia</a>. In Croatia, discontent with the new state was demonstrated by the massive electoral success of Radić’s Croatian Peasant Party. Refusing to accept the unification act, Radić called instead for an independent Croatian peasant republic. In elections to the Constituent Assembly in 1920, his party received the fourth largest bloc of votes, but Radić <a href=\\\"https://www.merriam-webster.com/dictionary/boycotted\\\" data-dictionary-link-target=\\\"boycotted\\\">boycotted</a> the assembly, thus making possible the adoption of a constitution in 1921 that imposed a highly centralized administration on the new state. In the following decade the kingdom’s multiparty parliament came to be controlled by Serbian centralists, while Croatia’s elected representatives, led by Radić and the Peasant Party, continued to demand a federal system that would allow Croatia autonomy. The parliament made some progress in <a href=\\\"/topic/land-reform\\\">agrarian reform</a>, with peasants receiving land expropriated from large estates. However, by 1928, when Radić and four other Croatian deputies were assassinated on the floor of the parliament by a Montenegrin deputy, national conflict had brought the <a href=\\\"/topic/political-system\\\">political system</a> to a standstill.\"},{\"tagName\":\"P\",\"html\":\"Under the dictatorship established in 1929, King Alexander attempted to override ethnic divisions by introducing a supranational patriotism symbolized by the new name of <a href=\\\"/place/Yugoslavia-former-federated-nation-1929-2003\\\">Yugoslavia</a>. The internal borders of the country were redrawn, so that historical Croatia was subdivided into several new <em>banovine</em> (provinces) named after rivers and natural features. However, Croatian nationalism and opposition to the state system were not <a href=\\\"https://www.merriam-webster.com/dictionary/eradicated\\\" data-dictionary-link-target=\\\"eradicated\\\">eradicated</a> by this policy of unitarism—and neither was Serbian hegemony, which simply continued under the name of Yugoslavism. Political repression bred extremism among some opponents of the regime. In 1934 <span></span><a href=\\\"/biography/Alexander-I-king-of-Yugoslavia\\\">Alexander</a> was assassinated as the result of a plot hatched by the Croatian <span></span><a href=\\\"/topic/Ustasa\\\">Ustaša</a> (“Insurgence”), a separatist association founded in 1929 by <span></span><a href=\\\"/biography/Ante-Pavelic\\\">Ante Pavelić</a> and enjoying the support of Italy’s fascist leader, <a href=\\\"/biography/Benito-Mussolini\\\">Benito Mussolini</a>. Unlike the majority of Croats, who still believed in a federal solution, members of the Ustaša insisted that only the destruction of Yugoslavia could liberate Croatia.\"},{\"tagName\":\"P\",\"html\":\"The new Yugoslav regent, Prince <a href=\\\"/biography/Prince-Paul-Karadjordjevic\\\">Paul Karadjordjević</a>, permitted some relaxation in political life, though he prevented the restoration of full democratic rights. The desire for political change led to the formation of a united Yugoslav opposition, which argued for the reinstatement of <a href=\\\"https://www.merriam-webster.com/dictionary/democracy\\\" data-dictionary-link-target=\\\"democracy\\\">democracy</a> and for constitutional reform. In Croatia this opposition included the Peasant Party, now led by <span></span><a href=\\\"/biography/Vladko-Macek\\\">Vladko Maček</a>. In the elections of 1938, the <span></span><a href=\\\"/topic/Croatian-Peasant-Party\\\">Peasant Party</a> received 80 percent of the vote in Croatia and Dalmatia. Faced with such evidence of popular support for the opposition program, Prince Paul encouraged negotiations between the government and Maček. These culminated in the <span></span><a href=\\\"/topic/Sporazum\\\">Sporazum</a> (“Agreement”) of <a href=\\\"https://www.merriam-webster.com/dictionary/August\\\" data-dictionary-link-target=\\\"August\\\">August</a> 26, 1939, which created an <a href=\\\"https://www.merriam-webster.com/dictionary/autonomous\\\" data-dictionary-link-target=\\\"autonomous\\\">autonomous</a> Croatian <em>banovina</em> that was largely self-governing except in defense and foreign affairs. The agreement provoked resentment among the Serbs, even in the opposition.\"}],\"sections\":[],\"isFilled\":true},\"ref223956\":{\"level\":2,\"id\":\"ref223956\",\"sidebarHeader\":\"World War II\",\"header\":\"World War II\",\"elements\":[{\"tagName\":\"P\",\"html\":\"War broke out soon after the Sporazum was signed, and Yugoslavia declared its neutrality. Invasion, occupation, and partition followed in 1941. In their campaign against Yugoslavia, the <span></span><a href=\\\"/topic/history-of-Germany\\\">Germans</a> exploited Croatian discontent, presenting themselves as liberators and inciting Croats in the armed forces to mutiny. In April 1941 Germans and Italians set up the Independent State of Croatia, which also embraced Bosnia and Herzegovina and those parts of Dalmatia that had not been ceded to Italy. Though in fact this state was under occupation by the German and <span></span><a href=\\\"/topic/history-of-Italy\\\">Italian</a> armies, Pavelić’s Ustaša was put into power—a takeover facilitated by the refusal of Maček to take part in a puppet government and by the passivity of the Roman Catholic archbishop of Zagreb, Alojzije Stepinac. Initially there was enthusiasm for the independent state, but once in power the Ustaša ruthlessly persecuted Serbs, Jews, Roma (Gypsies), and antifascist Croats. The Ustaša planned to eliminate Croatia’s Serb minority partly by conversion from Orthodoxy to Catholicism, partly by expulsion, and partly by extermination. As many as 350,000 to 450,000 victims were killed in Ustaša massacres and in the <a href=\\\"https://www.merriam-webster.com/dictionary/notorious\\\" data-dictionary-link-target=\\\"notorious\\\">notorious</a> <a href=\\\"/topic/concentration-camp\\\">concentration camp</a> at Jasenovac.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/21/115621-004-95CAC9BA.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"Sporadic resistance, particularly by Croatia’s Serbs, began almost immediately, but it was the communist <a href=\\\"/topic/Partisan-Yugoslavian-military-force\\\">Partisans</a>, under <span></span><a href=\\\"/biography/Josip-Broz-Tito\\\">Josip Broz Tito</a> (himself a Croat), who provided the resistance with leadership and a program. Croatian Serbs joined the Partisans in flight from Ustaša terror. Antifascist Croats subsequently were attracted by the Partisans’ broad popular front and by their emphasis on national self-determination, particularly the proposed reordering of postwar Yugoslavia along federal lines. Mass enlistment in their ranks made the Partisans more successful in Croatia and in Bosnia and Herzegovina than anywhere else outside their mountain strongholds. By 1944 most of Croatia—apart from the main cities—was liberated territory, and Croats were joining the Partisans’ ranks in <a href=\\\"/topic/large-numbers-1765137\\\">large numbers</a>. As the war neared its end, however, many Croats, especially those compromised by involvement with the Ustaša regime and those who opposed the communists, fled north along with other refugees toward the Allied armies. British commanders refused to accept their surrender and handed them over to the Partisans, who took a merciless revenge. Tens of thousands, including some civilians, were subsequently slaughtered on forced marches and in death camps.\"}],\"sections\":[],\"isFilled\":true},\"ref223957\":{\"level\":2,\"id\":\"ref223957\",\"sidebarHeader\":\"Croatia in Yugoslavia, 1945–91\",\"header\":\"Croatia in Yugoslavia, 1945–91\",\"elements\":[{\"tagName\":\"P\",\"html\":\"After 1945 Croatia was a republic within the Socialist Federal Republic of Yugoslavia. This new federation was intended to satisfy the national <a href=\\\"https://www.merriam-webster.com/dictionary/aspirations\\\" data-dictionary-link-target=\\\"aspirations\\\">aspirations</a> of all its peoples, but a centrally controlled <span></span><a href=\\\"/topic/communism\\\">Communist</a> Party and a supranational push for Yugoslav unity undermined this structure. The effects were felt in Croatia in such matters as the purge in 1948 of the Croatian communist Andrija Hebrang and others who had supported first Croatian national interests and then the Soviet side in Tito’s split with <a href=\\\"/biography/Joseph-Stalin\\\">Joseph Stalin</a>. A later issue was the Partisan-based Serb predominance in the Yugoslav army and the local Croatian police. By the 1960s Croats had grown increasingly critical of the economic centralization that appropriated part of the republic’s income for investment in other parts of the federation.\"},{\"tagName\":\"P\",\"html\":\"Beginning in the early 1960s, the Yugoslav government instituted a number of economic reforms and attempts at political liberalization and decentralization. Encouraged in Croatia by a reformist party leadership under Miko Tripalo and Savka Dabčević-Kučar, these reforms contributed to the flowering of a “Croatian Spring” in 1969–71. The movement took the shape of a cultural and <span></span><a href=\\\"/topic/nationalism\\\">national</a> revival, expressed in large part through the activities of the cultural organization Matica Hrvatska, but it soon culminated in calls for greater Croatian autonomy. Warning of the danger of civil war, <span></span><a href=\\\"/biography/Josip-Broz-Tito\\\">Tito</a> intervened and reimposed “democratic centralism” through a series of purges and trials that decimated the ranks of Croatian politicians and intellectuals. The political restrictions were not <a href=\\\"https://www.merriam-webster.com/dictionary/alleviated\\\" data-dictionary-link-target=\\\"alleviated\\\">alleviated</a> by the 1974 Yugoslav constitution: although the republics gained greater autonomy within the federation, they were still controlled by their single-party regimes.\"},{\"tagName\":\"P\",\"html\":\"This centralized control began to break down in the late 1980s, however. In 1989, as communist hegemony was challenged throughout eastern Europe, the Slovene and Croatian communists agreed to free multiparty elections. The right-wing, nationalist <span></span><a href=\\\"/topic/Croatian-Democratic-Union\\\">Croatian Democratic Union</a> (Hrvatska Demokratska Zajednica; HDZ), led by <span></span><a href=\\\"/biography/Franjo-Tudjman\\\">Franjo Tudjman</a> (a former party member who had been jailed during the suppression of the Croatian Spring), was victorious in the <span></span><a href=\\\"/topic/Croat\\\">Croatian</a> elections of 1990. The <span></span><a href=\\\"/topic/Serb\\\">Serb</a> minority was deeply alarmed by Croatia’s new constitution (promulgated in December 1990), which omitted Serbs as a “constituent people,” and by the actions of the new government, which purged Serbs from <a href=\\\"/topic/public-administration\\\">public administration</a>, especially the police. Serbs’ fears also were aroused by accusations, especially from <a href=\\\"/place/Belgrade\\\">Belgrade</a>, that Croatian nationalism meant a return to fascism and the anti-Serb violence of World War II.\"},{\"tagName\":\"P\",\"html\":\"When independence was declared on June 25, 1991, armed clashes spread in protest throughout Serb enclaves in Croatia. This violence coincided with the hasty withdrawal of the <span></span><a href=\\\"/topic/Yugoslav-Peoples-Army\\\">Yugoslav People’s Army</a> from a newly independent <a href=\\\"/place/Slovenia\\\">Slovenia</a>. Turning to oppose Croatia’s independence, a larger <a href=\\\"https://www.merriam-webster.com/dictionary/contingent\\\" data-dictionary-link-target=\\\"contingent\\\">contingent</a> of army forces attacked the new regime. In the ensuing war, the city of Vukovar in <a href=\\\"/place/Slavonia\\\">Slavonia</a> was leveled by bombardment, <a href=\\\"/place/Dubrovnik\\\">Dubrovnik</a> and other <span></span><a href=\\\"/place/Dalmatia\\\">Dalmatian</a> cities were shelled, and about one-third of Croatian territory was occupied by Yugoslav forces. Warfare was halted by an agreement whereby European troops, sponsored by the <a href=\\\"/topic/United-Nations\\\">United Nations</a> (UN), were installed in the disputed areas in order to stabilize and demilitarize them. Although Croatia was granted international recognition in 1992, the government’s control over its own territories remained incomplete.\"}],\"sections\":[],\"isFilled\":true},\"ref284760\":{\"level\":2,\"id\":\"ref284760\",\"sidebarHeader\":\"Independent Croatia\",\"header\":\"Independent Croatia\",\"elements\":[{\"tagName\":\"P\",\"html\":\"In May and August 1995 two Croatian military offensives regained control of western Slavonia and central Croatia from rebel Serbs. Croatia was disappointed, however, when in November the U.S.-brokered <a href=\\\"/event/Dayton-Accords\\\">Dayton Accords</a> failed to provide a clear timetable for the return of eastern Slavonia to Zagreb’s control. In 1996 <a href=\\\"/biography/Slobodan-Milosevic\\\">Slobodan Milošević</a>, Serbia’s president and the effective leader of the rump Yugoslavia, agreed to give up claims to eastern Slavonia. Yugoslav troops then withdrew from the region under a UN <a href=\\\"https://www.merriam-webster.com/dictionary/mandate\\\" data-dictionary-link-target=\\\"mandate\\\">mandate</a>, and Yugoslavia established full diplomatic relations with Croatia. Croatia recovered full <a href=\\\"https://www.merriam-webster.com/dictionary/sovereignty\\\" data-dictionary-link-target=\\\"sovereignty\\\">sovereignty</a> over eastern Slavonia in 1998, and, with the withdrawal of UN troops from the Prelavka Peninsula in 2002, Croatia finally had full control of its territory.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/70/135670-004-DA1E444F.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"Tudjman died in December 1999, and <span></span><a href=\\\"/biography/Stipe-Mesic\\\">Stipe Mesić</a>, who had broken with the HDZ over Tudjman’s autocratic rule, was elected president in February 2000. Mesić quickly moved to cut down corruption and to improve Croatia’s relations with its neighbours, but he failed to deliver on promises of early entry to the <span></span><a href=\\\"/topic/North-Atlantic-Treaty-Organization\\\">North Atlantic Treaty Organization</a> (NATO) or the <span></span><a href=\\\"/topic/European-Union\\\">European Union</a> (EU). Croatia continued to suffer deep economic and political divisions, particularly over cooperation with the <span></span><a href=\\\"/topic/International-Criminal-Tribunal-for-the-Former-Yugoslavia\\\">International Criminal Tribunal for the Former Yugoslavia</a> (ICTY), which indicted several Croatian generals who, according to many Croats, had heroic wartime reputations.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/30/127930-004-DF12FC44.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"With the success of the HDZ in the 2003 parliamentary elections, Croatia’s broad-based <a href=\\\"/topic/coalition-government\\\">coalition government</a> fell, and HDZ leader Ivo Sanader became prime minister of a new centre-right government. In 2004 Croatia became an official EU candidate, but negotiations were postponed in 2005 after the ICTY raised concerns about the country’s commitment to bringing war criminals to <a href=\\\"https://www.merriam-webster.com/dictionary/justice\\\" data-dictionary-link-target=\\\"justice\\\">justice</a>. EU officials also questioned Croatia’s dedication to eliminating corruption. By the following year, however, several key suspects had been arrested or tried for war crimes, and the government had adopted a strong anticorruption strategy. These developments <a href=\\\"https://www.merriam-webster.com/dictionary/bolstered\\\" data-dictionary-link-target=\\\"bolstered\\\">bolstered</a> hopes that Croatia could join the EU by the end of the decade. Meanwhile, the country’s economy, helped by the spectacular growth of tourism, began to improve. The status of the much-reduced Serb minority also was boosted by the inclusion of an ethnic Serb in the cabinet of the HDZ-led coalition government that came to power in 2008. On April 1, 2009, NATO officially welcomed Croatia as a member of the alliance.\"},{\"tagName\":\"P\",\"html\":\"By mid-2009 the outlook was not as promising. Although neighbouring <a href=\\\"/place/Slovenia\\\">Slovenia</a>—a member of both NATO and the EU—had agreed to Croatia’s NATO membership, it continued to block Croatian accession negotiations with the EU, claiming that the countries’ ongoing border dispute needed to be resolved first. (The dispute, focused on the maritime border in the Bay of Piran, had originated in 1991 when both countries seceded from Yugoslavia.) Adding to Croatia’s problems, the growing global financial crisis caused the economy to contract sharply during the first half of 2009, and by the end of the year it had suffered a decline of 6 percent of <a href=\\\"/topic/gross-domestic-product\\\">gross domestic product</a>. Croatia faced yet another hurdle when Prime Minister Sanader resigned on July 1, 2009. Fellow HDZ member <span></span>Jadranka Kosor, who had been serving as deputy prime minister, succeeded Sanader. She was the first woman to hold the Croatian prime ministership.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/29/133729-004-DC385D49.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"In January 2010 <span></span>Ivo Josipović, a member of the opposition Social Democratic Party of Croatia (Socijaldemokratska partija Hrvatske; SDP), was elected president. Despite his political differences with the ruling HDZ, he promised to support Prime Minister Kosor’s goals of expediting EU membership talks and fighting corruption. Nevertheless, the relative inexperience of the two new leaders and the jockeying of their parties for advantage in the 2011 parliamentary elections kept their differences in play. The HDZ’s continued emphasis on an exclusively Croatian national identity and history still separated its adherents from many younger urban voters and the remaining Serb minority. Some HDZ supporters, for instance, objected to the public apology that Josipović made in April 2010 to Bosnia and Herzegovina for Croatia’s role in the warfare there in the early 1990s. Meanwhile, the SDP was drawn into the public’s continued concerns about EU membership when one of the party’s major supporters, a large public employees’ union, objected to labour-related conditions imposed by the EU on prospective members. The objections slowed the full-scale labour reform that would be needed for EU accession. Larger concerns for EU accession, however, remained judicial reform in general and the conclusion of several corruption trials in particular. Still, the fact that both major parties and the respected Croatian National Bank supported membership in the EU was a major advantage in the accession process, which had gained momentum after November 2009, when Slovenia and Croatia agreed to have their border dispute settled by international arbitration.\"},{\"tagName\":\"P\",\"html\":\"After more than a decade of effort and six years of formal talks, the accession process reached a final milestone in June 2011, when Croatia closed negotiations with the EU. This accomplishment did little to <a href=\\\"https://www.merriam-webster.com/dictionary/bolster\\\" data-dictionary-link-target=\\\"bolster\\\">bolster</a> public approval of the HDZ, however, as corruption scandals—the most notable involving former prime minister Sanader—bogged down the party throughout the year. Croatia also struggled with the economic <a href=\\\"https://www.merriam-webster.com/dictionary/malaise\\\" data-dictionary-link-target=\\\"malaise\\\">malaise</a> that had afflicted the rest of Europe, and, like ruling parties across the continent throughout 2011, the HDZ suffered for it at the polls. In the general election on December 4, 2011, the opposition <span></span>Kukuriku coalition, headed by <span></span>Zoran Milanović of the SDP, swept the HDZ from power and claimed an overall majority in parliament, winning 80 of 151 seats. Just days after the election, as Milanović began the work of constructing his government, Croatia signed the accession treaty that would enable it to join the EU in 2013. In a referendum held in January 2012, accession received approval from two-thirds of Croatian voters, but voter turnout, at 43.6 percent, marked the lowest level of participation for any poll on EU entry. Nevertheless, thousands celebrated in Zagreb on July 1, 2013, when Croatia completed its decadelong accession journey to become the 28th member of the EU.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/71/172271-004-F96B9198.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"While full EU membership opened the door to financial assistance, Croatia did not make effective use of EU structural funds to help improve its business climate, and the country faced its sixth consecutive year of recession in 2014. As public finances deteriorated, investor confidence weakened, and Croatia’s <a href=\\\"https://www.merriam-webster.com/dictionary/sovereign\\\" data-dictionary-link-target=\\\"sovereign\\\">sovereign</a> credit rating suffered. Critics blamed successive governments for failing to introduce reform, partly because of public mistrust of market capitalism.\"},{\"tagName\":\"P\",\"html\":\"Opposition candidate <span></span>Kolinda Grabar-Kitarović narrowly topped incumbent Josipović in balloting in January 2015, becoming Croatia’s first woman president. The election was seen as a referendum on Milanović’s centre-left government, and the defeat of Josipović, who had enjoyed widespread popularity throughout much of his term, signaled dissatisfaction with the pace of Croatia’s economic recovery.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/43/193043-004-A4E36B08.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"Domestic politics was complicated further by the European migrant crisis, which saw refugees from <a href=\\\"/place/North-Africa\\\">North Africa</a>, the <a href=\\\"/place/Middle-East\\\">Middle East</a>, and <a href=\\\"/place/Afghanistan\\\">Afghanistan</a> attempting to transit Croatia en route to northern Europe. As neighbouring countries enacted tighter border restrictions, tens of thousands of migrants became trapped in Croatia. In early November 2015 the <a href=\\\"/topic/European-Commission\\\">European Commission</a> offered $18 million in emergency funding to help pay for police officers <a href=\\\"https://www.merriam-webster.com/dictionary/deployed\\\" data-dictionary-link-target=\\\"deployed\\\">deployed</a> along the Croatian-Serbian border and to fund temporary detention centres. By that point, well over 300,000 migrants had entered Croatia.\"},{\"tagName\":\"P\",\"html\":\"Parliamentary elections held on November 8, 2015, were inconclusive, with the HDZ and SDP finishing in a dead heat. Elsewhere in Europe, far right parties had capitalized on the migrant crisis by stoking nationalist <a href=\\\"https://www.merriam-webster.com/dictionary/sentiment\\\" data-dictionary-link-target=\\\"sentiment\\\">sentiment</a>, but Croatian voters largely supported Milanović’s evenhanded response, and that enabled the SDP to cut into the HDZ’s pre-election lead. Weeks of coalition talks followed, with the centrist Bridge of Independent Lists (Most Nezavisnih Lista) ultimately acting as kingmakers for the HDZ. In January 2016 <span></span>Tihomir Orešković was sworn in as the nonpartisan technocratic head of a centre-right coalition government. Orešković, a pharmaceutical <a href=\\\"/topic/executive-government\\\">executive</a> who held dual Croatian and Canadian citizenship, seemingly was chosen for his financial <a href=\\\"https://www.merriam-webster.com/dictionary/acumen\\\" data-dictionary-link-target=\\\"acumen\\\">acumen</a>, as Croatia struggled to maintain the fragile economic recovery that had begun in late 2015.\"},{\"tagName\":\"P\",\"html\":\"After just five months in office, however, Orešković’s government was toppled by a vote of no confidence after a bribery scandal enveloped one of his deputy prime ministers. The HDZ emerged as the winner in snap elections held on September 11, 2016, and the following month HDZ leader <span></span>Andrej Plenković was confirmed as prime minister at the head of a centre-right coalition government. Plenković presided over a healthy economic recovery, but further <a href=\\\"https://www.merriam-webster.com/dictionary/integration\\\" data-dictionary-link-target=\\\"integration\\\">integration</a> with the EU was hindered by Croatia’s ongoing border dispute with Slovenia. In June 2017 the Permanent Court of Arbitration at The Hague ruled in favour of Slovenia, stating that a “junction area” should be created in the <a href=\\\"/place/Adriatic-Sea\\\">Adriatic Sea</a> that would allow Slovenian shipping to pass through waters claimed by Croatia. Plenković rejected the decision as nonbinding and declared that it would not be <a href=\\\"https://www.merriam-webster.com/dictionary/implemented\\\" data-dictionary-link-target=\\\"implemented\\\">implemented</a>.\"},{\"tagName\":\"P\",\"html\":\"Croatia marked the five-year anniversary of its accession to the EU on July 1, 2018. With that landmark came the expiration of labour regulations that had limited the rights of Croatian citizens to pursue work throughout the EU. While many EU members lifted these labour controls on or ahead of that date, several countries, including Austria and Slovenia, elected to extend the restrictions for an additional two years.\"}],\"sections\":[],\"isFilled\":true}},\"tree\":{\"sections\":[{\"level\":1,\"id\":\"ref42760\",\"sidebarHeader\":\"Land\",\"header\":\"Land\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The upper arm of the Croatian crescent is bordered on the east by the <a href=\\\"/place/Vojvodina\\\">Vojvodina</a> region of <a href=\\\"/place/Serbia\\\">Serbia</a> and on the north by <a href=\\\"/place/Hungary\\\">Hungary</a> and <a href=\\\"/place/Slovenia\\\">Slovenia</a>. The body of the crescent forms a long coastal strip along the <a href=\\\"/place/Adriatic-Sea\\\">Adriatic Sea</a>, and the southern tip touches on <a href=\\\"/place/Montenegro\\\">Montenegro</a>. Within the hollow of the crescent, Croatia shares a long border with <a href=\\\"/place/Bosnia-and-Herzegovina\\\">Bosnia and Herzegovina</a>, which actually severs a part of southern Croatia from the rest of the country by penetrating to the Adriatic in a narrow corridor.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/32/6232-004-D1DB8152.jpg\\\">\"}],\"sections\":[{\"level\":2,\"id\":\"ref42761\",\"sidebarHeader\":\"Relief\",\"header\":\"Relief\",\"elements\":[{\"tagName\":\"P\",\"html\":\"<span></span>Croatia is composed of three major geographic regions. In the north and northeast, running the full length of the upper arm of the Croatian crescent, are the <span></span><a href=\\\"/place/Pannonian-Basin\\\">Pannonian</a> and para-Pannonian plains. To the north of <a href=\\\"/place/Zagreb\\\">Zagreb</a>, the <span></span>Zagorje Hills, fragments of the <a href=\\\"/place/Julian-Alps\\\">Julian Alps</a> now covered with vines and orchards, separate the <a href=\\\"/place/Sava-River\\\">Sava</a> and <a href=\\\"/place/Drava-River\\\">Drava</a> river valleys.\"},{\"tagName\":\"P\",\"html\":\"To the west and south of the Pannonian region, linking it with the Adriatic coast, is the central mountain belt, itself part of the <span></span><a href=\\\"/place/Dinaric-Alps\\\">Dinaric Alps</a>. The <a href=\\\"/science/karst-geology\\\">karst</a> plateaus of this region, consisting mostly of <a href=\\\"/science/limestone\\\">limestone</a>, are barren at the highest elevations; lower down, they are heavily forested. The highest mountain in Croatia, Dinara (6,007 feet [1,831 metres]), is located in the central mountain belt.\"},{\"tagName\":\"P\",\"html\":\"The third geographic region, the Croatian littoral, is composed of the <span></span><a href=\\\"/place/Istria\\\">Istrian</a> Peninsula in the north and the <span></span><a href=\\\"/place/Dalmatia\\\">Dalmatian</a> coast extending south to the <a href=\\\"/place/Gulf-of-Kotor\\\">Gulf of Kotor</a>. Wedged between the Dinaric Alps to the east and the Adriatic Sea to the west, its 1,100 miles (1,800 km) of coastline are fringed by more than 1,100 islands and islets.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/12/6212-004-B43A1A54.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref42763\",\"sidebarHeader\":\"Drainage\",\"header\":\"Drainage\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Of the 26 rivers that flow for more than 30 miles (50 km) in Croatia, the <span></span><a href=\\\"/place/Sava-River\\\">Sava</a> and the <span></span><a href=\\\"/place/Drava-River\\\">Drava</a>, coursing through the Pannonian and para-Pannonian plains, are of particular importance—both because of their length and because, along with the Kupa River, they are in large part navigable. The Sava originates in Slovenia, passes Croatia’s capital city of Zagreb, and then forms most of the border between Croatia and Bosnia and Herzegovina along the inside of the Croatian crescent. The Drava enters Croatia from Slovenia and forms all but a small section of the border with Hungary before joining the <a href=\\\"/place/Danube-River\\\">Danube</a>, which in turn forms most of the border between Croatia and the Vojvodina province of Serbia. The <span></span>Kupa, which forms part of the frontier between Slovenia and Croatia, and the <span></span><a href=\\\"/place/Una-river-Europe\\\">Una</a> River, which meanders along part of the border between Croatia and Bosnia and Herzegovina, both flow into the Sava. In Dalmatia the <span></span><a href=\\\"/place/Krka\\\">Krka</a> and <span></span>Cetina rivers are of particular importance because of their hydroelectric potential and because they flow into the Adriatic Sea.\"},{\"tagName\":\"P\",\"html\":\"In addition, a great deal of water circulates in underground rivers and pools in the karstic regions of the central mountain belt and the littoral. These waters account for many of the unique geologic formations and the picturesque landscape of central and western Croatia.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref278417\",\"sidebarHeader\":\"Soils\",\"header\":\"Soils\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The Pannonian and para-Pannonian plains are enriched with alluvial soil deposited by the Sava and Drava rivers. These plains are the most fertile agricultural regions of Croatia and form the country’s breadbasket. The soil of the central mountainous belt is rather poor but offers some cultivable land in the fields and meadows and some grazing land in the plateaus. The Croatian littoral is mostly mountainous and barren, with rocky soil and poor agricultural land.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref42762\",\"sidebarHeader\":\"Climate\",\"header\":\"Climate\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Two main climatic zones dominate Croatia. The Pannonian and para-Pannonian plains and the mountain regions are characterized by a continental climate of warm summers and cold winters. In the plains, temperatures average in the low 70s F (low 20s C) in June and in the low 30s F (around 0 °C) in January—although they can range from a low of −5 °F (−20 °C) in the winter to a high of 105 °F (40 °C) in the summer. The central mountain regions of Lika and Krbava have slightly cooler summers and cold winters, with a milder climate in the valleys. The average temperature range is between about 65 °F (about 18 °C) in June and the upper 20s F (about −2 °C) in January. Considerable rainfall, turning to snow in winter, is characteristic of the region.\"},{\"tagName\":\"P\",\"html\":\"The Dalmatian coast, Istria, and the islands have a mild <a href=\\\"/science/Mediterranean-climate\\\">Mediterranean climate</a>. In southern Dalmatia, where the <span></span><a href=\\\"/science/sirocco-wind\\\">sirocco</a> winds (known there as the <em>jugo</em>) bring a moderating influence from Africa, summers are sunny, warm, and dry, and winters are rainy. In the north the winters are drier and colder as a result of the cold northeast wind known as the <span></span><a href=\\\"/science/bora\\\">bora</a> (<em>bura</em>). In the summer the mistral wind has a cooling effect on the coast and the islands. The average temperature ranges from the low 40s F (about 5 °C) in January to the low 70s F (low 20s C) in June. Rainfall is moderate and occurs mainly in the winter.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/37/118037-004-2BFCBC6E.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296687\",\"sidebarHeader\":\"Plant and animal life\",\"header\":\"Plant and animal life\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Reflecting the country’s diverse geography, the flora and fauna of Croatia are highly varied. On the Dalmatian coast, grapes and olives are grown to produce wine and oil, while Istria is dominated by firs, and Slavonia has many oak forests. In terms of animal life, lizards are found on the coast, while wolves and even bears can be found in the inland forests. Hares, foxes, boars, wildcats, and mouflons (wild sheep) also inhabit Croatia. Sea life in the Adriatic is rich as well, with many coral reefs and underwater caves serving as habitats.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/54/180354-049-40FA86E1.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/55/180355-049-76ADFD9A.jpg\\\">\"}],\"sections\":[],\"isFilled\":true}],\"isFilled\":true},{\"level\":1,\"id\":\"ref42764\",\"sidebarHeader\":\"People\",\"header\":\"People\",\"elements\":[],\"sections\":[{\"level\":2,\"id\":\"ref42765\",\"sidebarHeader\":\"Ethnic groups and religions\",\"header\":\"Ethnic groups and religions\",\"elements\":[{\"tagName\":\"P\",\"html\":\"A variety of ethnic groups coexist within the republic. Croats <a href=\\\"https://www.merriam-webster.com/dictionary/constitute\\\" data-dictionary-link-target=\\\"constitute\\\">constitute</a> about nine-tenths of the population. Serbs make up the largest minority group; however, their proportion fell dramatically as a result of the 1990s war of independence—from more than one-tenth of the population before the war to less than half that figure in 2001. In addition to the <span></span><a href=\\\"/topic/Croat\\\">Croats</a> and the Serbs, there are small groups of Bosnian Muslims (Bosniaks), Hungarians, Italians, and Slovenes as well as a few thousand Albanians, Austrians, Bulgarians, Czechs, Germans, and other nationalities.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/77/184077-004-99203AC8.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"It has been estimated that the number of Croats living outside the borders of Croatia is comparable to the number living inside the country. Many ethnic Croats reside in <a href=\\\"/place/Bosnia-and-Herzegovina\\\">Bosnia and Herzegovina</a>, where Croats have lived since the <span></span><a href=\\\"/topic/Slav\\\">Slavs</a> first migrated to the western <a href=\\\"/place/Balkans\\\">Balkan Peninsula</a> in the 6th and 7th centuries <span>ce</span>. Although there has traditionally been a yearning for unification with Croatia among the Croats of Herzegovina (a region <a href=\\\"https://www.merriam-webster.com/dictionary/contiguous\\\" data-dictionary-link-target=\\\"contiguous\\\">contiguous</a> to Dalmatia), this <a href=\\\"https://www.merriam-webster.com/dictionary/sentiment\\\" data-dictionary-link-target=\\\"sentiment\\\">sentiment</a> has not generally been shared by Croats within Croatia or even by Croats in Bosnia. Many of the Serbs in Croatia are descendants of people who migrated to the border areas of the <a href=\\\"/place/Holy-Roman-Empire\\\">Holy Roman Empire</a> between the 16th and 18th centuries, following the <a href=\\\"/place/Ottoman-Empire\\\">Ottoman</a> conquest of <a href=\\\"/place/Serbia\\\">Serbia</a> and Bosnia.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/39/61039-004-610E6BF1.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"There is traditionally a close correlation between ethnic identity and religious affiliation. The Croats are overwhelmingly <a href=\\\"/topic/Roman-Catholicism\\\">Roman Catholic</a> and more Western-influenced than the <span></span><a href=\\\"/topic/Serb\\\">Serbs</a>, who are overwhelmingly <a href=\\\"/topic/Eastern-Orthodoxy\\\">Eastern Orthodox</a>. A small minority of people are nonreligious or atheist. Bosniaks constitute most of the Muslim population.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/78/184078-004-320B2288.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/99/94599-004-2A895E5D.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref42766\",\"sidebarHeader\":\"Languages\",\"header\":\"Languages\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Croats speak <span></span><a href=\\\"/topic/Serbo-Croatian-language\\\">Croatian</a>, a <a href=\\\"/topic/Slavic-languages#ref74889\\\">South Slavic language</a> of the <a href=\\\"/topic/Indo-European-languages\\\">Indo-European</a> family. Croatian is quite similar to Serbian and Bosnian, but political developments since the collapse of <a href=\\\"/place/Yugoslavia-former-federated-nation-1929-2003\\\">Yugoslavia</a> have encouraged the three ethnic groups to emphasize the differences between their languages. The clearest distinction between the Croatian and Serbian variants of what was previously called the <a href=\\\"/topic/Serbo-Croatian-language\\\">Serbo-Croatian language</a> is the script, with Croatian written in the <a href=\\\"/topic/Latin-alphabet\\\">Latin alphabet</a> and Serbian in the <a href=\\\"/topic/Cyrillic-alphabet\\\">Cyrillic</a>. Distinctions of grammar and pronunciation also occur, as do more striking differences in vocabulary, which result partly from differential historical patterns of foreign domination. For Croats, this has resulted in a sprinkling of German, <a href=\\\"/topic/Hungarian-people\\\">Hungarian</a>, and (in <a href=\\\"/place/Dalmatia\\\">Dalmatia</a> and <a href=\\\"/place/Istria\\\">Istria</a>) Italian vocabulary, while the Serbs’ speech shows Turkish and Russian influences. In addition, there have been various movements to “purify” the Croatian language, which have led to further differences.\"},{\"tagName\":\"P\",\"html\":\"Another linguistic distinction, reflecting the <a href=\\\"https://www.merriam-webster.com/dictionary/legacies\\\" data-dictionary-link-target=\\\"legacies\\\">legacies</a> of history as well as the effects of geography, can be heard in the colourful medley of regional <a href=\\\"https://www.merriam-webster.com/dictionary/dialects\\\" data-dictionary-link-target=\\\"dialects\\\">dialects</a> and subdialects that survive to this day. The standard Croatian literary language, based on the <span></span><a href=\\\"/topic/Shtokavian\\\">Shtokavian</a> <a href=\\\"/topic/dialect\\\">dialect</a>, emerged in the second half of the 19th century as a result of an effort to unite all South Slavs. Although all three major branches of Serbo-Croatian (Shtokavian, Chakavian, and Kajkavian) were spoken by Croats (as they still are today), the Shtokavian <a href=\\\"https://www.merriam-webster.com/dictionary/dialect\\\" data-dictionary-link-target=\\\"dialect\\\">dialect</a> was the most widely heard in Croatian regions of eastern <a href=\\\"/place/Slavonia\\\">Slavonia</a>, the Adriatic littoral from Makarska to <a href=\\\"/place/Dubrovnik\\\">Dubrovnik</a>, and Herzegovina, as well as <a href=\\\"/place/Montenegro\\\">Montenegro</a> and Serbia. It was therefore adopted by leading Croatian national <a href=\\\"https://www.merriam-webster.com/dictionary/intellectuals\\\" data-dictionary-link-target=\\\"intellectuals\\\">intellectuals</a> of the 19th century.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref278418\",\"sidebarHeader\":\"Settlement patterns\",\"header\":\"Settlement patterns\",\"elements\":[{\"tagName\":\"P\",\"html\":\"More than half of the population resides in urban areas, particularly in the upper arm of the country and along the Adriatic coast. Settlement is relatively sparse in the central mountainous area. While most of Croatia’s Serbs live in urban centres, a significant number are scattered in villages and towns, mostly in lightly populated parts of the central mountain belt, in the regions of Lika and Banija, and in northern Dalmatia. There is also a smaller concentration of Serbs in Slavonia, although this area was particularly hard-hit by anti-Serb <a href=\\\"/topic/ethnic-cleansing\\\">ethnic cleansing</a> during the 1991–95 war.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/75/184075-004-81E47B02.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/63/121263-004-BB0D3C30.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/40/140340-004-43569B71.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref42767\",\"sidebarHeader\":\"Demographic trends\",\"header\":\"Demographic trends\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The major <a href=\\\"https://www.merriam-webster.com/dictionary/demographic\\\" data-dictionary-link-target=\\\"demographic\\\">demographic</a> trend of the post-<a href=\\\"/event/World-War-II\\\">World War II</a> period was rapid urbanization and a consequent migration from rural areas—especially from the less-prosperous karstic regions of Lika and Gorski Kotar in the central mountain belt, from Dalmatia, and from islands in the Adriatic but also from the Pannonian regions of Banija and Baranja. As a result, in the second half of the 20th century, the portion of the population employed in agriculture dropped from about two-thirds to less than one-fifth, and larger cities grew significantly; <span></span><a href=\\\"/place/Zagreb\\\">Zagreb</a>, for example, more than doubled its metropolitan population. Parallel to this rapid urbanization was a sharp decrease in the <a href=\\\"/science/birth-rate\\\">birth rate</a>. A much larger drop in infant mortality meant that Croatia’s population continued to increase—although at a very low rate—until the 1990s, when wartime displacement, emigration, and deaths caused the population to plummet by several hundred thousand. After hitting a plateau in the second half of the ’90s, the population remained at roughly the same level into the 21st century. The many emigrants who left Croatia during the 20th century have created significant <a href=\\\"https://www.merriam-webster.com/dictionary/diasporas\\\" data-dictionary-link-target=\\\"diasporas\\\">diasporas</a> in <a href=\\\"/place/Canada\\\">Canada</a>, the <a href=\\\"/place/United-States\\\">United States</a>, <a href=\\\"/place/Australia\\\">Australia</a>, and other countries. Croatian expatriates have sometimes played an important role in political developments in their homeland.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/76/184076-004-4B3DC1AF.jpg\\\">\"}],\"sections\":[],\"isFilled\":true}],\"isFilled\":true},{\"level\":1,\"id\":\"ref42768\",\"sidebarHeader\":\"Economy\",\"header\":\"Economy\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Following the <a href=\\\"https://www.merriam-webster.com/dictionary/demise\\\" data-dictionary-link-target=\\\"demise\\\">demise</a> of communism in Croatia in 1990, the Croatian government began a course of restructuring the economy from the Yugoslav system of socialist self-management to <span></span><a href=\\\"/topic/market-economy\\\">market-oriented</a> capitalism. This required such measures as the sale of state-owned enterprises to private owners, the establishment of functioning markets, and the creation of stable prices, interest rates, and currency. The accomplishment of these tasks proved difficult, largely because of the destabilizing effects of war. The war not only deterred foreign investment, which was a crucial motor of <a href=\\\"/topic/economic-growth\\\">economic growth</a> and structural change in other central and eastern European countries, but also damaged <a href=\\\"https://www.merriam-webster.com/dictionary/infrastructure\\\" data-dictionary-link-target=\\\"infrastructure\\\">infrastructure</a> and production facilities. By the late 1990s nearly one in five members of the working-age population were jobless, with young people particularly affected; high unemployment remained a problem into the 21st century. The war also helped to foster an informal economy and a <a href=\\\"/topic/black-market\\\">black market</a>.\"}],\"sections\":[{\"level\":2,\"id\":\"ref42770\",\"sidebarHeader\":\"Agriculture, forestry, and fishing\",\"header\":\"Agriculture, forestry, and fishing\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Agriculture (grazing and tilling) occupies less than one-fourth of Croatia’s land and contributes less than one-tenth of the country’s <a href=\\\"/topic/gross-domestic-product\\\">gross domestic product</a> (GDP). Most agricultural land is privately held, but many landholdings are too small for profitable production. Croatian agricultural produce is exported mainly to nearby countries, particularly Bosnia and Herzegovina, <a href=\\\"/place/Italy\\\">Italy</a>, Slovenia, and Serbia.\"},{\"tagName\":\"P\",\"html\":\"<span></span><a href=\\\"/place/Slavonia\\\">Slavonia</a>, the granary of Croatia, is the most fertile agricultural region. Farming there is characterized by capital-intensive, market-oriented production and larger landholdings. Most of the land previously under social ownership has been nationalized by the Croatian government and is leased to farmers. Major crops of the region are sugar beets, corn (maize), wheat, potatoes, barley, soybeans, sunflowers, and tobacco. Oats, rye, millet, rice, beans, peas, and chicory are also grown. Pigs, cattle, and poultry are important to the economy of the region, while there is also some beekeeping and silkworm cultivation.\"},{\"tagName\":\"P\",\"html\":\"The hills of the western part of the para-Pannonian region are characterized by smallholdings, mixed farming, and generally low yields. Fruit growing, viticulture, and cattle and pig breeding are typical agricultural occupations.\"},{\"tagName\":\"P\",\"html\":\"The central mountain belt contains some of the poorest land and climate for agriculture. The large areas of meadow and pasture, however, are suitable for raising sheep and cattle, and there is also some cultivation of barley, oats, rye, and potatoes. Fruits grown include plums, apples, pears, sour cherries, sweet cherries, peaches, and apricots.\"},{\"tagName\":\"P\",\"html\":\"The Adriatic littoral of Istria and Dalmatia is characterized by rocky soil and long periods of <a href=\\\"/science/drought\\\">drought</a>, with small parcels of arable land and poor pasture. Sheep and goats are raised, while grapes, olives, almonds, figs, tangerines, and other Mediterranean fruits and vegetables round out the agriculture of this region. Beekeeping is also of some commercial importance, especially on the islands.\"},{\"tagName\":\"P\",\"html\":\"Croatia’s large forests, covering about two-fifths of the country’s area, form the basis of a wood and pulp industry. Fish and shellfish are harvested commercially in the waters off the Adriatic coast, although fish stocks in the sea declined in the late 20th and early 21st centuries. Around nine-tenths of the fish catch <a href=\\\"https://www.merriam-webster.com/dictionary/comprises\\\" data-dictionary-link-target=\\\"comprises\\\">comprises</a> small oily fish (e.g., anchovies and pilchards), much of which is consumed locally, but there is also an increasing demand for nonoily fish, or whitefish (e.g., sea bass). <a href=\\\"/topic/aquaculture\\\">Aquaculture</a>, or fish farming, is of growing importance, with <a href=\\\"/animal/sea-bass\\\">sea bass</a>, tuna, and mussels all popular. Almost all commercially sold freshwater fish is raised in ponds as well, though freshwater fishing has some significance for tourism. Farmed fish are exported to countries such as <a href=\\\"/place/Spain\\\">Spain</a> and <a href=\\\"/place/Japan\\\">Japan</a>, while canned fish is sold mainly to surrounding countries.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/21/114821-004-54F1FB7B.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref42769\",\"sidebarHeader\":\"Resources and power\",\"header\":\"Resources and power\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Deposits of oil and <a href=\\\"/science/natural-gas\\\">natural gas</a> are found in the Pannonian valleys of eastern Slavonia, but Croatia consumes more oil and gas than it produces and thus is dependent on imports. <a href=\\\"/science/bauxite\\\">Bauxite</a> and <a href=\\\"/technology/coal-mining\\\">coal mining</a> had ceased by the early 21st century. Clay, stone, and gravel are still quarried, however, and gypsum and quartz are mined. There are small deposits of other minerals, including salt, throughout the country.  Although Croatia’s numerous rivers offer hydroelectric potential, the country imports a significant portion of its electricity.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref42772\",\"sidebarHeader\":\"Manufacturing\",\"header\":\"Manufacturing\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Already more <span></span><a href=\\\"/topic/industrialization\\\">industrialized</a> than most of its neighbours when the communists assumed power over Yugoslavia in 1945, Croatia continued its rapid industrialization under socialist policies of economic and <a href=\\\"/science/social-learning\\\">social development</a>. One unfortunate result was the squandering of a great deal of money through inefficiency and the misallocation of resources through the building of so-called political factories, which served more to <a href=\\\"https://www.merriam-webster.com/dictionary/enhance\\\" data-dictionary-link-target=\\\"enhance\\\">enhance</a> the <a href=\\\"https://www.merriam-webster.com/dictionary/prestige\\\" data-dictionary-link-target=\\\"prestige\\\">prestige</a> of politicians than to use most rationally the endowments of a specific region. Nevertheless, large investments in industry (as well as transportation and education) ensured the continued growth of that sector and allowed the absorption into an industrial workforce of Croatia’s rapidly urbanizing population. On the eve of Yugoslavia’s disintegration into war in 1991, industry and mining accounted for more than one-third of Croatia’s GDP.\"},{\"tagName\":\"P\",\"html\":\"Today manufacturing and other <a href=\\\"/technology/industry#ref3506\\\">secondary industries</a> account for a smaller but still important portion of GDP. Significant industries include <a href=\\\"/technology/food-processing\\\">food processing</a> and wine making, as well as the production and refining of petroleum. Also important are chemical products, building materials, metallurgy (particularly aluminum and iron and steel), the wood and paper industries, machine engineering, electronics, textiles, and shipbuilding. The future of shipbuilding is in question, however, since it is heavily dependent on state subsidies. Most enterprises are concentrated around such urban centres as <a href=\\\"/place/Zagreb\\\">Zagreb</a>, <a href=\\\"/place/Rijeka\\\">Rijeka</a>, <a href=\\\"/place/Split-Croatia\\\">Split</a>, <a href=\\\"/place/Osijek\\\">Osijek</a>, <a href=\\\"/place/Karlovac\\\">Karlovac</a>, <a href=\\\"/place/Zadar\\\">Zadar</a>, Slavonski Brod, Sisak, and Varaždin.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296684\",\"sidebarHeader\":\"Finance, trade, and services\",\"header\":\"Finance, trade, and services\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The banking sector has consolidated considerably since the late 1990s, through mergers, takeovers, and bankruptcies. The sector is also now overwhelmingly privately and foreign-owned, with Italian, Austrian, and German banks dominating. Banks in Croatia have invested heavily in technology; hence, Internet, telephone, and drive-in banking are widely offered. Card transactions are the norm in cities. There has been a major expansion in credit since the late 1990s, with consumers eager to borrow money in order to satisfy pent-up demand. The sector is overseen by the Croatian National Bank, the country’s <a href=\\\"/topic/central-bank\\\">central bank</a>, which earned a good record of achieving price stability in the period after the independence war.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/79/184079-004-5806E0B9.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"The Croatian economy is very open to <a href=\\\"/topic/international-trade\\\">international trade</a>. Nearly two-thirds of trade is conducted with other <a href=\\\"/topic/European-Union\\\">European Union</a> (EU) countries, while trade with Croatia’s neighbours in southeastern <a href=\\\"/place/Europe\\\">Europe</a> is also significant. Italy, Bosnia and Herzegovina, <a href=\\\"/place/Germany\\\">Germany</a>, Slovenia, and <a href=\\\"/place/Austria\\\">Austria</a> are top buyers of Croatian exports, while Croatia imports primarily from Italy, Germany, <a href=\\\"/place/Russia\\\">Russia</a>, <a href=\\\"/place/China\\\">China</a>, and Slovenia. Important exports include fuels, ships, chemical products, food, machinery, and textiles. Fuels, chemical products, and transport equipment are also among the main imports.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/80/184080-004-2F297991.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"The service sector employs well over half the workforce and accounts for the majority of GDP. A substantial portion of service workers are employed in <a href=\\\"/topic/retailing\\\">retailing</a>. Although the retail market has long been dominated by small shops, newly constructed shopping malls have proliferated since 2000. Croatia’s beautiful coastline and numerous islands form the basis of another major component of the service sector—tourism. A historically important source of revenue, tourism was negatively affected by the war in the 1990s. The conflict deterred potential tourists from traveling to the country, and many empty hotels were used to house refugees and displaced persons. Significant investment has been necessary to revive the tourist industry.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296685\",\"sidebarHeader\":\"Labour and taxation\",\"header\":\"Labour and taxation\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The service and manufacturing sectors employ the bulk of the workforce, which, in general, is well educated and has excellent foreign-language skills, reflecting and <a href=\\\"https://www.merriam-webster.com/dictionary/facilitating\\\" data-dictionary-link-target=\\\"facilitating\\\">facilitating</a> the tourist trade. However, employing people in Croatia is expensive, owing to a combination of relatively high wages, burdensome <a href=\\\"/topic/social-security-government-program\\\">social security</a> contributions, and the high cost of dismissing workers. The Union of <a href=\\\"https://www.merriam-webster.com/dictionary/Autonomous\\\" data-dictionary-link-target=\\\"Autonomous\\\">Autonomous</a> Trade Unions of Croatia, founded in 1990, <a href=\\\"https://www.merriam-webster.com/dictionary/affiliates\\\" data-dictionary-link-target=\\\"affiliates\\\">affiliates</a> a number of unions in the country.\"},{\"tagName\":\"P\",\"html\":\"The tax burden on businesses in Croatia is moderate. Under a number of incentive programs, a business may reduce the tax on its profits. Profit tax is reduced, for example, on investments in areas with significant war damage or high unemployment. Income tax is levied on individuals at varying rates. A large part of revenue is raised through a <span></span><a href=\\\"/topic/value-added-tax\\\">value-added tax</a>, although this tax is reduced for many tourist services and is eliminated for some products, such as books, basic foodstuffs, and certain medical goods.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296686\",\"sidebarHeader\":\"Transportation and telecommunications\",\"header\":\"Transportation and telecommunications\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Croatia has excellent access to shipping routes because of its long coastline on the Adriatic. The major seaports of <a href=\\\"/place/Rijeka\\\">Rijeka</a>, <a href=\\\"/place/Zadar\\\">Zadar</a>, <a href=\\\"/place/Sibenik\\\">Šibenik</a>, <a href=\\\"/place/Split-Croatia\\\">Split</a>, Ploče, and <a href=\\\"/place/Dubrovnik\\\">Dubrovnik</a> link Europe, via the <a href=\\\"/topic/Suez-Canal\\\">Suez Canal</a>, with <a href=\\\"/place/Asia\\\">Asia</a> and Australia. There are also several international airports in Croatia, with a number of them used largely for tourism.\"},{\"tagName\":\"P\",\"html\":\"There has been significant investment in highways and railways within the country since the 1990s war. Highways run between Zagreb and Split—a route also well served by rail connections—and between Zagreb and the Serbian border. In addition to the direct eastward routes to Serbia and <a href=\\\"/place/Romania\\\">Romania</a>, road access to central Europe is good. However, connections to the south, to <a href=\\\"/place/Albania\\\">Albania</a> and <a href=\\\"/place/Greece\\\">Greece</a>, are cumbersome.\"},{\"tagName\":\"P\",\"html\":\"Croatia possesses a good telecommunications infrastructure. About half the population regularly uses the Internet. Mobile phone usage has outpaced that of landlines; there is more than one cellular subscription for every member of the population. The telecommunications market is fully liberalized, with numerous landline, cellular, and Internet service providers in operation.\"}],\"sections\":[],\"isFilled\":true}],\"isFilled\":true},{\"level\":1,\"id\":\"ref42773\",\"sidebarHeader\":\"Government and society\",\"header\":\"Government and society\",\"elements\":[],\"sections\":[{\"level\":2,\"id\":\"ref42774\",\"sidebarHeader\":\"Constitutional framework\",\"header\":\"Constitutional framework\",\"elements\":[{\"tagName\":\"P\",\"html\":\"On Dec. 22, 1990, the <span></span>constitution of the Republic of Croatia was <a href=\\\"https://www.merriam-webster.com/dictionary/promulgated\\\" data-dictionary-link-target=\\\"promulgated\\\">promulgated</a>. In addition to such classic <a href=\\\"/topic/civil-rights\\\">civil rights</a> as <a href=\\\"/topic/freedom-of-speech\\\">freedom of speech</a>, religion, information, and association, the equality of nationalities is guaranteed in a number of <a href=\\\"https://www.merriam-webster.com/dictionary/constitutional\\\" data-dictionary-link-target=\\\"constitutional\\\">constitutional</a> articles. Cultural <a href=\\\"https://www.merriam-webster.com/dictionary/autonomy\\\" data-dictionary-link-target=\\\"autonomy\\\">autonomy</a>, along with the right to use one’s own language and script (the latter specifically intended for the Serb minority), is also guaranteed.\"},{\"tagName\":\"P\",\"html\":\"The 1990 constitution changed the structure of the <span></span><a href=\\\"/topic/Sabor\\\">Sabor</a> (parliament) from a tricameral body under the Yugoslav system to a bicameral body consisting of the House of Representatives (lower house) and the House of Districts (upper house). Constitutional <a href=\\\"https://www.merriam-webster.com/dictionary/amendments\\\" data-dictionary-link-target=\\\"amendments\\\">amendments</a> in 2001 abolished the upper house, thereby rendering the Sabor a unicameral body. Members are elected from party lists every four years. In addition, a small percentage of seats are reserved for national minorities and for representatives of Croats living outside the country.\"},{\"tagName\":\"P\",\"html\":\"The <span></span><a href=\\\"/topic/president-government-official\\\">president</a> of the republic is elected directly by popular vote for a period of five years and is limited to two terms. The 1990 constitution originally granted the president very broad powers; this “superpresident” appointed and could dismiss the <a href=\\\"/topic/prime-minister\\\">prime minister</a>, who was nominally responsible to both the parliament and the president but was actually directly dependent on the president. Constitutional amendments in 2000 reduced the importance of the president, who thenceforth served solely as head of state, and increased the power of the parliament and of the prime minister, who assumed the role of head of government. The president continues to nominate the prime minister, but the Sabor must confirm the appointment. In addition, the prime minister is typically the head of the leading party in the Sabor.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref278419\",\"sidebarHeader\":\"Local government\",\"header\":\"Local government\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Below the national level, Croatia is divided into 20 administrative districts called <em>županije</em> (counties). One city, <a href=\\\"/place/Zagreb\\\">Zagreb</a>, has an administrative status equivalent to that of the counties. Within the <em>županije</em> are hundreds of <em>općine</em> (municipalities).\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296688\",\"sidebarHeader\":\"Justice\",\"header\":\"Justice\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The Supreme Court, county courts, and municipal courts <a href=\\\"https://www.merriam-webster.com/dictionary/constitute\\\" data-dictionary-link-target=\\\"constitute\\\">constitute</a> the three-tiered <a href=\\\"/topic/judiciary\\\">judicial system</a>. The Supreme Court is the highest legal authority in all matters but constitutional questions, which are decided by the Constitutional Court. <a href=\\\"https://www.merriam-webster.com/dictionary/Justices\\\" data-dictionary-link-target=\\\"Justices\\\">Justices</a> on the Supreme Court are appointed by a judicial council, which is elected by the Sabor. The independence of the judiciary has been questioned, largely because many of the judges who were politically appointed in the 1990s remained in office well into the 21st century. However, there have been significant reforms to the judiciary, largely under EU pressure.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296689\",\"sidebarHeader\":\"Political process\",\"header\":\"Political process\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Suffrage is universal from age 18, although employed individuals may vote beginning at age 16. Multiparty elections have been held in Croatia since independence. The Croatian Democratic Union (Hrvatska Demokratska Zajednica; HDZ) and the <a href=\\\"/topic/Social-Democratic-Party\\\">Social Democratic Party</a> (Socijaldemokratska partija Hrvatske; SDP) are the predominant political parties. The HDZ dominated politics in the first years of the post-Yugoslav era, having come to power in the parliamentary elections of 1990. The party leader, <a href=\\\"/biography/Franjo-Tudjman\\\">Franjo Tudjman</a>, served as the first president of independent Croatia. The HDZ initially based its <a href=\\\"https://www.merriam-webster.com/dictionary/ideology\\\" data-dictionary-link-target=\\\"ideology\\\">ideology</a> on Croatian <a href=\\\"https://www.merriam-webster.com/dictionary/nationalism\\\" data-dictionary-link-target=\\\"nationalism\\\">nationalism</a> and the struggle for independence, but it began to lose favour after the war ended in 1995 and the population felt the pain of economic collapse. In 2000, the year after Tudjman died, the HDZ was resoundingly defeated in parliamentary and presidential elections. A multiparty centre-left coalition, led by the SDP, then governed until 2003, when the HDZ, having repositioned itself as a typical centre-right party, returned to power. The HDZ and the SDP continued to be the main <a href=\\\"https://www.merriam-webster.com/dictionary/contenders\\\" data-dictionary-link-target=\\\"contenders\\\">contenders</a> in subsequent elections. Both parties favoured Croatian accession to the EU.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296690\",\"sidebarHeader\":\"Security\",\"header\":\"Security\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Croatia’s armed forces—comprising an army, a navy, and an air force—were created in the early 1990s with significant support from the international <a href=\\\"https://www.merriam-webster.com/dictionary/community\\\" data-dictionary-link-target=\\\"community\\\">community</a>, particularly the <a href=\\\"/place/United-States\\\">United States</a>. Although Croatia had no army to speak of when it declared independence in 1991, within a few years an army had been trained and equipped sufficiently to be able to conduct two major operations to reclaim territory from Serb paramilitaries in 1995. However, Croatia is not a militaristic country, and it relies on the security of the <a href=\\\"/topic/North-Atlantic-Treaty-Organization\\\">North Atlantic Treaty Organization</a> (NATO), which it joined in 2009.\"},{\"tagName\":\"P\",\"html\":\"The Croatian police force, under the authority of the central government, has been reformed since independence. Reform efforts have focused on improving service and stamping out corruption.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296691\",\"sidebarHeader\":\"Health, welfare, and housing\",\"header\":\"Health, welfare, and housing\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The health of Croatians is good compared with that of the populations of neighbouring countries. Life expectancy at birth is higher than the eastern European average, and the <a href=\\\"/science/infant-mortality-rate\\\">infant mortality rate</a> is significantly lower. The rate of HIV infection is low, reflecting competent prevention efforts. However, the health care system is in need of investment and far-reaching reform because, being almost entirely state-provided, it imposes a substantial burden on the budget. The social welfare system is also burdensome, partly because Croatia has a large number of retirees and unemployed individuals. In urban areas, large portions of the population live in concrete tower blocks built during the Yugoslav era, which are in dire need of investment.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref42775\",\"sidebarHeader\":\"Education\",\"header\":\"Education\",\"elements\":[{\"tagName\":\"P\",\"html\":\"During its 45 years in power, the communist Yugoslav regime reduced illiteracy in Croatia from 16 percent of the population over 10 years of age to less than 4 percent. By the early 21st century, the literacy rate for Croatians over age 14 was nearly 99 percent. In addition to thousands of elementary schools, secondary schools, commercial and technical institutions, and vocational schools, the Yugoslav emphasis on education led to the founding of universities in <a href=\\\"/place/Rijeka\\\">Rijeka</a> in 1973, in <a href=\\\"/place/Split-Croatia\\\">Split</a> in 1974, and in <a href=\\\"/place/Osijek\\\">Osijek</a> in 1975. The oldest university in Croatia is the <span></span>University of Zagreb (1669), which traces its beginnings to a Jesuit school of <a href=\\\"/topic/moral-theology\\\">moral theology</a> founded in 1632.\"}],\"sections\":[],\"isFilled\":true}],\"isFilled\":true},{\"level\":1,\"id\":\"ref42776\",\"sidebarHeader\":\"Cultural life\",\"header\":\"Cultural life\",\"elements\":[],\"sections\":[{\"level\":2,\"id\":\"ref296692\",\"sidebarHeader\":\"Cultural milieu\",\"header\":\"Cultural milieu\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The Yugoslav version of <a href=\\\"/topic/communism\\\">communism</a>—which evolved following <a href=\\\"/place/Yugoslavia-former-federated-nation-1929-2003\\\">Yugoslavia</a>’s 1948 break with the <a href=\\\"/place/Soviet-Union\\\">Soviet Union</a> and the agency of international communism known as <a href=\\\"/topic/Cominform\\\">Cominform</a>—allowed far greater autonomy and self-expression in cultural and other spheres of life than did the communist societies of most of Yugoslavia’s neighbours. As a result, Croatian <a href=\\\"https://www.merriam-webster.com/dictionary/culture\\\" data-dictionary-link-target=\\\"culture\\\">culture</a> was able to develop in <a href=\\\"https://www.merriam-webster.com/dictionary/continuity\\\" data-dictionary-link-target=\\\"continuity\\\">continuity</a> with the Western heritage of which it has long been a part and to which it has contributed for the last thousand years.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296693\",\"sidebarHeader\":\"Daily life and social customs\",\"header\":\"Daily life and social customs\",\"elements\":[{\"tagName\":\"P\",\"html\":\"With a predominantly Roman Catholic population, Croatia observes Catholic religious holidays. Other important national holidays <a href=\\\"https://www.merriam-webster.com/dictionary/commemorate\\\" data-dictionary-link-target=\\\"commemorate\\\">commemorate</a> historical events. Anti-Fascist Resistance Day, June 22, marks the formation of the first <a href=\\\"/topic/Partisan-Yugoslavian-military-force\\\">Partisan</a> unit in Croatia in 1941. Statehood Day, June 25, celebrates Croatia’s declaration of independence from Yugoslavia in 1991. Independence Day, marking the day in 1991 on which Croatia formally broke with Yugoslavia, is October 8.\"},{\"tagName\":\"P\",\"html\":\"Croatian cuisine is heavily influenced by Turkish, central European, and Italian cuisine. Typical dishes are cabbage leaves stuffed with minced meat, <em>ćevapčići</em> (rolls of seasoned grilled meat), dumplings, and pickles. Along the coast, fish is served with <em>blitva</em>, a dish of <a href=\\\"/plant/chard-plant\\\">Swiss chard</a> mixed with potatoes and crushed garlic in <a href=\\\"/topic/olive-oil\\\">olive oil</a>. There are also local delicacies, such as cheese from the island of Pag and wine from any number of good-quality small producers, particularly in Dalmatia.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref278420\",\"sidebarHeader\":\"The arts\",\"header\":\"The arts\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Croatians take pride in their literary tradition, which dates to about 1100, with the dedication of the Baška Tablet (Bašćanska Ploča), a stone monument inscribed with <a href=\\\"/topic/Glagolitic-alphabet\\\">Glagolitic</a> script that was found in the 19th century on the island of <a href=\\\"/place/Krk\\\">Krk</a>. The first printed book in the <a href=\\\"/topic/Serbo-Croatian-language\\\">Croatian language</a> was <em>Hrvoje’s Missal</em>, a liturgical text printed in 1483. Among the 20th-century giants in <a href=\\\"/art/Croatian-literature\\\">Croatian literature</a> are the much-translated novelist, poet, essayist, dramatist, polemicist, and critic <span></span><a href=\\\"/biography/Miroslav-Krleza\\\">Miroslav Krleža</a> (1893–1981) and the lyric poet, essayist, and translator Tin Ujević (1891–1955), both of whom treated psychological and sociopolitical struggles at individual and universal levels.\"},{\"tagName\":\"P\",\"html\":\"The monumental sculptures of the Croatian-born American artist <span></span><a href=\\\"/biography/Ivan-Mestrovic\\\">Ivan Meštrović</a> (1883–1962), whom the French sculptor <a href=\\\"/biography/Auguste-Rodin\\\">Auguste Rodin</a> once called “the biggest phenomenon among sculptors,” synthesize a particularly Croatian national romanticism with the entire European tradition. His works include many religious reliefs and figures carved in walnut. Meštrović designed his own house in <a href=\\\"/place/Split-Croatia\\\">Split</a>, now used as a museum for his works.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/20/36820-004-6E4CF824.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"Croatian visual artists also have been active in several other <a href=\\\"https://www.merriam-webster.com/dictionary/genres\\\" data-dictionary-link-target=\\\"genres\\\">genres</a>. Hundreds of painters and photographers are represented in galleries throughout the country, and traditional Croatian arts, including fine textile and lacework, can still be seen. Croatian naive painting, through a simple depiction of the timeless concerns of men and women, struck a universal chord in the mid- to late 20th century and brought worldwide fame to its main exponents, Ivan Generalić, Ivan Rabuzin, and Ivan Lacković-Croata.\"},{\"tagName\":\"P\",\"html\":\"Film enjoys a particularly important place in contemporary Croatian culture. The <a href=\\\"/place/Zagreb\\\">Zagreb</a> school of film animation has acquired world renown and recognition, including an <a href=\\\"/art/Academy-Award\\\">Academy Award</a> in 1961 for Dušan Vukotić’s animated film <em>The Substitute</em>. Since 1972, Zagreb has periodically hosted an international animated <a href=\\\"/art/film-festival\\\">film festival</a>. Acclaimed Croatian filmmakers of the late 20th and early 21st centuries include Dejan Šorak, Krsto Papić, and Zrinko Ogresta.\"},{\"tagName\":\"P\",\"html\":\"Croatians enjoy music of many varieties, ranging from folk to opera, jazz, and rock. In Croatia and among the Croatian <a href=\\\"https://www.merriam-webster.com/dictionary/diaspora\\\" data-dictionary-link-target=\\\"diaspora\\\">diaspora</a>, traditional music featuring the <em>tamburitza</em>, a <a href=\\\"/art/stringed-instrument\\\">stringed instrument</a> similar to a mandolin (<em>see also</em> <a href=\\\"/art/tanbur\\\">tanbur</a>), has a fervid following. In addition, the traditional <a href=\\\"/art/kolo\\\">kolo</a> dance is still performed at weddings and festivals. Zagreb, Split, and Dubrovnik teem with nightclubs that showcase local musical talent. Tereza Kesovija, arguably Croatia’s most famous singer, first received acclaim in the 1960s as a singer of French chansons. In the late 20th and early 21st centuries Sandra Nasić sang and wrote lyrics for Guano Apes, one of <a href=\\\"/place/Germany\\\">Germany’s</a> most popular rock groups.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/03/115203-004-57C48726.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296694\",\"sidebarHeader\":\"Cultural institutions\",\"header\":\"Cultural institutions\",\"elements\":[{\"tagName\":\"P\",\"html\":\"<a href=\\\"/topic/UNESCO\\\">UNESCO</a> has inscribed several sites in Croatia on its <a href=\\\"/topic/World-Heritage-site\\\">World Heritage List</a>. These include the old city of <a href=\\\"/place/Dubrovnik\\\">Dubrovnik</a> and the historical area of <a href=\\\"/place/Split-Croatia\\\">Split</a> that contains ruins of the <a href=\\\"/topic/Palace-of-Diocletian\\\">palace</a> of the Roman emperor <a href=\\\"/biography/Diocletian\\\">Diocletian</a>. Zagreb hosts the National Theatre, the National and University Library, and a concert hall named after the 19th-century Croatian composer Vatroslav Lisinski.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/68/95568-004-144BDCC9.jpg\\\">\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/60/121260-004-45AA407C.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref278421\",\"sidebarHeader\":\"Sports and recreation\",\"header\":\"Sports and recreation\",\"elements\":[{\"tagName\":\"P\",\"html\":\"Like most Europeans, Croatians are passionate about <span></span><a href=\\\"/sports/football-soccer\\\">football</a> (soccer). Since independence, Croatia’s national team, made up largely of players from Zagreb and Split, has performed with great distinction. <span></span><a href=\\\"/sports/basketball\\\">Basketball</a> is also widely popular, with Croatian club teams winning several European championships. The well-known basketball player <span></span><a href=\\\"/biography/Drazen-Petrovic\\\">Dražen Petrović</a> played for Croatia’s Olympic team in 1992 as well as in the <a href=\\\"/topic/National-Basketball-Association\\\">National Basketball Association</a>. Croatian tennis players have performed well in international competitions; in particular, <span></span>Goran Ivanišević won the men’s <a href=\\\"/sports/Wimbledon-Championships\\\">Wimbledon</a> championship in 2001.\"},{\"tagName\":\"P\",\"html\":\"Croatian athletes participated on Yugoslavia’s <span></span><a href=\\\"/sports/Olympic-Games\\\">Olympic</a> team from 1948. The independent Republic of Croatia formed a national Olympic committee in 1991, and its athletes competed at the <a href=\\\"/event/Barcelona-1992-Olympic-Games\\\">1992 Summer Olympics in Barcelona</a>, where its basketball squad earned the silver medal. The country’s greatest Summer Olympics strengths are handball (for which it won gold medals in 1996 and 2004) and <a href=\\\"/sports/weightlifting\\\">weight lifting</a> (one gold in 2000), as well as rowing, <a href=\\\"/sports/water-polo\\\">water polo</a>, sailing, swimming, and gymnastics. Croatia also has performed well in the Winter Olympics, with Alpine skier <span></span><a href=\\\"/biography/Janica-Kostelic\\\">Janica Kostelić</a> winning a total of four gold medals in 2002 and 2006 and her brother, Ivica Kostelić, winning silver medals in 2006 and 2010.\"},{\"tagName\":\"P\",\"html\":\"Croatia has a number of national parks and reserves that are popular with hikers and other nature enthusiasts. <a href=\\\"/place/Plitvicka-Lakes\\\">Plitvička Lakes</a> National Park features an extensive waterfall system. The stunning natural beauty of many of Croatia’s islands is preserved in the national parks of Brijuni, Kornati, and Mljet. The North Velebit, Paklenica, and Risnjak national parks <a href=\\\"https://www.merriam-webster.com/dictionary/encompass\\\" data-dictionary-link-target=\\\"encompass\\\">encompass</a> mountainous terrain, while the Krka National Park is centred on the river of the same name.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/14/114614-004-FDBB3210.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref296695\",\"sidebarHeader\":\"Media and publishing\",\"header\":\"Media and publishing\",\"elements\":[{\"tagName\":\"P\",\"html\":\"During the 1990s, the Croatian media appeared to be easily influenced by the political agenda of the government. Although <a href=\\\"/topic/media-freedom\\\">media freedom</a> and independence have progressed significantly since that time, <a href=\\\"/topic/market\\\">market</a> pressures now may pose a greater threat to media freedom. Several newspapers, based in various cities, focus on politics or business, but a number of the daily papers are tabloids. Croatia’s well-respected independent weekly newspaper, <em>Feral Tribune</em>, closed down in 2008 because of financial problems. The departure of <em>Feral</em> left <em>Nacional</em>, another weekly, as the main source of independent commentary. However, the assassination of its editor in 2008 revived concerns about freedom of the press.\"},{\"tagName\":\"P\",\"html\":\"Television is dominated by the state provider, Croatian Radio-Television (Hrvatska Radiotelevizija; HRT), which derives a good portion of its revenue from a compulsory subscription fee. It has some respected current affairs programs but largely focuses on sports and entertainment. Two significant privately owned channels are Nova TV and RTL; both tend toward sensationalism. In addition to the HRT-run radio networks, there are a few private radio operations.\"}],\"sections\":[],\"isFilled\":true}],\"isFilled\":true},{\"level\":1,\"id\":\"ref223953\",\"sidebarHeader\":\"History\",\"header\":\"History\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The territory of Croatia bridges the central European and Mediterranean worlds, and its history has been marked by this position as a borderland. It lay near the division between the two halves of the <span></span><a href=\\\"/place/Roman-Empire\\\">Roman Empire</a> and between their <a href=\\\"/place/Byzantine-Empire\\\">Byzantine</a> and <a href=\\\"/topic/Frank-people\\\">Frankish</a> successors. The <span></span><a href=\\\"/topic/Eastern-Orthodoxy\\\">Eastern</a> and Western churches competed for influence there, and, as the frontier of Christendom, it confronted the limits of Muslim expansion into <a href=\\\"/place/Europe\\\">Europe</a>. As a part of <a href=\\\"/place/Yugoslavia-former-federated-nation-1929-2003\\\">Yugoslavia</a> after both World Wars, it struggled within the Serbian-dominated state of the interwar years and emerged from <a href=\\\"/event/World-War-II\\\">World War II</a> as a separate republic in the communist federation that navigated between the Soviet and Western blocs. All these competing interests have had an influence on Croatia’s development.\"}],\"sections\":[{\"level\":2,\"id\":\"ref43554\",\"sidebarHeader\":\"Croatia to the Ottoman conquests\",\"header\":\"Croatia to the Ottoman conquests\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The lands where the <span></span><a href=\\\"/topic/Croat\\\">Croats</a> would settle and establish their state lay just within the borders of the Western Roman Empire. In the 6th and 7th centuries <span>ce</span>, <span></span><a href=\\\"/topic/Slav\\\">Slavs</a> arrived in the western <a href=\\\"/place/Balkans\\\">Balkans</a>, settling on <a href=\\\"https://www.merriam-webster.com/dictionary/Byzantine\\\" data-dictionary-link-target=\\\"Byzantine\\\">Byzantine</a> territory along the Adriatic and in the hinterland and gradually merging with the <a href=\\\"https://www.merriam-webster.com/dictionary/indigenous\\\" data-dictionary-link-target=\\\"indigenous\\\">indigenous</a> Latinized population. Eventually they accepted the <a href=\\\"/topic/Roman-Catholicism\\\">Roman Catholic Church</a>, though preserving a <a href=\\\"/topic/Old-Church-Slavonic-language\\\">Slavonic</a> liturgy. In the 9th century an independent Croatian state developed with its centre in northern <span></span><a href=\\\"/place/Dalmatia\\\">Dalmatia</a>, later incorporating Croatia proper and <a href=\\\"/place/Slavonia\\\">Slavonia</a> as well. This state grew into a powerful military force under King <span></span>Tomislav (reigned <em>c.</em> 910–928). Croatia retained its independence under native kings until 1102, when the crown passed into the hands of the <a href=\\\"/topic/Hungarian-people\\\">Hungarian</a> <a href=\\\"https://www.merriam-webster.com/dictionary/dynasty\\\" data-dictionary-link-target=\\\"dynasty\\\">dynasty</a>. The precise terms of this relationship later became a matter of dispute. Nonetheless, even under dynastic union with <span></span><a href=\\\"/place/Hungary\\\">Hungary</a>, institutions of separate Croatian statehood were maintained through the Sabor (an assembly of Croatian nobles) and the <span></span><a href=\\\"/topic/ban-Hungarian-official\\\">ban</a> (viceroy). In addition, the Croatian nobles retained their lands and titles.\"},{\"tagName\":\"P\",\"html\":\"Over the following centuries, the area associated with the name Croatia shifted gradually north and west as its territory was eroded, first with the loss of Dalmatia to <a href=\\\"/place/Venice\\\">Venice</a> by 1420 and then as a result of <span></span><a href=\\\"/place/Ottoman-Empire\\\">Ottoman</a> conquests in the 16th century. The Croatian nobility maintained their claims to lands occupied by the Ottomans, hoping to repossess them once liberated. A Croatian national tradition also survived within these territories, as well as in lands under Venetian rule. A broader Croatian ethnic identity would be further consolidated among the Catholics of Dalmatia and of <a href=\\\"/place/Bosnia-and-Herzegovina\\\">Bosnia and Herzegovina</a> during the nationalist movements of the 19th century.\"},{\"tagName\":\"P\",\"html\":\"The <span></span><a href=\\\"/topic/history-of-Austria\\\">Austrian</a> <span></span><a href=\\\"/topic/House-of-Habsburg\\\">Habsburgs</a>, elected to the throne of Croatia in 1527 after the death of King <a href=\\\"/biography/Louis-II-king-of-Hungary-and-Bohemia\\\">Louis II</a> of Hungary at the <a href=\\\"/event/Battle-of-Mohacs\\\">Battle of Mohács</a>, defended the “remnant of the remnants” of Croatia by establishing the Military Frontier (German: Militärgrenze; Serbo-Croatian: Vojna Krajina), a defensive zone along the border with the Ottoman-controlled lands. Because it was ruled directly by the Habsburg war council, the Military Frontier further reduced the amount of land under the control of Croatian nobles, the Sabor, and the ban. Furthermore, its military units and their land rights attracted not only some Croatian peasants but also a larger Orthodox inflow from the Ottoman-conquered territories. Such was the origin of Croatia’s minority <span></span><a href=\\\"/topic/Serb\\\">Serb</a> population.\"},{\"tagName\":\"P\",\"html\":\"Under the pressures caused by the Ottoman invasions and increased obligations to landlords, the position of the Croatian peasantry deteriorated, leading to a number of rebellions—most notably in 1573. The nobility, too, was under pressure from Habsburg absolutism. An anti-Habsburg <a href=\\\"https://www.merriam-webster.com/dictionary/conspiracy\\\" data-dictionary-link-target=\\\"conspiracy\\\">conspiracy</a> of Croatian and Hungarian nobles was unsuccessful, and its leaders, including Petar Zrinski, ban of Croatia, were executed in 1671. Their extensive properties in Croatia were confiscated by the Habsburg crown.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref43555\",\"sidebarHeader\":\"Ragusa and the Croat Renaissance in Dalmatia\",\"header\":\"Ragusa and the Croat Renaissance in Dalmatia\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The Adriatic port of Ragusa had been founded by Latinized colonists, but by the 14th century it had been largely Slavicized and had acquired its alternate name of <span></span><a href=\\\"/place/Dubrovnik\\\">Dubrovnik</a>. The largely Croat republic of Ragusa maintained a precarious autonomy under the suzerainty of Venice, Hungary, and (after 1397) the <a href=\\\"/place/Ottoman-Empire\\\">Ottoman Empire</a>. Its wealth as a trading power was based on its role as an intermediary between East and West, and it nurtured a flourishing cultural life. In the 16th and 17th centuries, Ragusa and other Dalmatian cities under the rule of Venice became the centre of the Croat Renaissance, which produced, in addition to works of art and science, an extensive and powerful literature that had a lasting influence on the development of the Croatian literary language. As a mercantile power, however, Ragusa eventually entered a decline parallel to that of Venice, so that by the 18th century it had become little more than an economic backwater. Ragusa retained its autonomy as a city-state until 1806, when it was occupied by <a href=\\\"/biography/Napoleon-I\\\">Napoleon I</a>’s armies. During the French occupation of all of Dalmatia, which lasted until 1813, the region was designated as part of the <a href=\\\"/place/Illyrian-Provinces\\\">Illyrian Provinces</a>, where education and publications in South Slav languages were allowed.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref43556\",\"sidebarHeader\":\"Croatian national revival\",\"header\":\"Croatian national revival\",\"elements\":[{\"tagName\":\"P\",\"html\":\"From the end of the 17th century, the Habsburgs began to regain Croatian crown lands, first from the Ottomans (with the treaties of <span></span><a href=\\\"/event/Treaty-of-Carlowitz\\\">Carlowitz</a> in 1699 and <span></span><a href=\\\"/event/Treaty-of-Passarowitz\\\">Passarowitz</a> in 1718) and then from Venice after the <a href=\\\"/event/French-revolutionary-wars\\\">Napoleonic Wars</a> (confirmed by the <a href=\\\"/event/Congress-of-Vienna\\\">Congress of Vienna</a> in 1815). For the most part these territories were not rejoined to Croatia but were either incorporated into the Military Frontier or organized as separate provinces—as in the case of Austrian Habsburg Dalmatia. Much of the land was distributed to German or Hungarian magnates and military dignitaries.\"},{\"tagName\":\"P\",\"html\":\"The Croat nobility was impoverished, often culturally <a href=\\\"https://www.merriam-webster.com/dictionary/assimilated\\\" data-dictionary-link-target=\\\"assimilated\\\">assimilated</a>, and too weak to withstand the Habsburg centralization and Germanization that began in the 18th century under the Austrian archduchess and Holy Roman empress <a href=\\\"/biography/Maria-Theresa\\\">Maria Theresa</a> and continued under her son, the Holy Roman emperor <a href=\\\"/biography/Joseph-II\\\">Joseph II</a>. As the best defense of their rights and privileges, the Croats turned to cooperation with the Hungarians, but this choice would later expose them to the rising force of Hungarian nationalism. When Hungarian, rather than Latin, was imposed as the official language in Hungary and Croatia, Croatian resistance took shape in the <span></span><a href=\\\"/topic/Illyrian-movement\\\">Illyrian movement</a> of the 1830s and ’40s. The Illyrianists—primarily <a href=\\\"https://www.merriam-webster.com/dictionary/intellectuals\\\" data-dictionary-link-target=\\\"intellectuals\\\">intellectuals</a>, professionals, clergymen, and gentry led by the linguistic reformer <span></span><a href=\\\"/biography/Ljudevit-Gaj\\\">Ljudevit Gaj</a>—strove to defend Croatian interests by calling for the unification of all the South Slavs, to be <a href=\\\"https://www.merriam-webster.com/dictionary/facilitated\\\" data-dictionary-link-target=\\\"facilitated\\\">facilitated</a> through the adoption of a single literary language. Though the Illyrianists failed to win over the other South Slavs, they did succeed in <a href=\\\"https://www.merriam-webster.com/dictionary/integrating\\\" data-dictionary-link-target=\\\"integrating\\\">integrating</a> the linguistically and administratively divided Croats within one national movement.\"},{\"tagName\":\"P\",\"html\":\"Threatened by Hungarian <span></span><a href=\\\"/topic/nationalism\\\">nationalism</a> in the <a href=\\\"/event/Revolutions-of-1848\\\">Revolution of 1848</a> and hoping for national unification and autonomy within the Austrian Empire, the Croats, under Ban <span></span><a href=\\\"/biography/Josip-Count-Jelacic\\\">Josip Jelačić</a>, an Illyrianist, sided with the Austrian dynasty against the Hungarians. Yet, instead of a reward, the Croats received the same central control and Germanization that were dealt out to the Hungarians as punishment. Reaction against these disappointments encouraged the development of the <span></span>Party of Right, led by <span></span>Ante Starčević, which emphasized the idea of Croatian “state rights” and aspired to the creation of an independent Great Croatia. The necessity of relying on the other South Slavs in opposition to the Habsburgs and Hungarians also kept alive the Illyrian idea, revived in the 1860s under the name <span></span>Yugoslavism. The Yugoslavists, under the patronage of Bishop <span></span><a href=\\\"/biography/Joseph-George-Strossmayer\\\">Josip Juraj Štrossmajer</a> (<a href=\\\"/biography/Joseph-George-Strossmayer\\\">Joseph George Strossmayer</a>), advocated South Slav unity within a federated Habsburg state as the basis for an independent Balkan state. Croatian separatism and South Slav cooperation (Yugoslavism) thus became the two <a href=\\\"https://www.merriam-webster.com/dictionary/alternatives\\\" data-dictionary-link-target=\\\"alternatives\\\">alternatives</a> that would shape much of Croatian political thought in the future.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/65/121265-004-3E433E44.jpg\\\">\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref43557\",\"sidebarHeader\":\"Croatia in Austria-Hungary\",\"header\":\"Croatia in Austria-Hungary\",\"elements\":[{\"tagName\":\"P\",\"html\":\"The Habsburg monarchy was reconstituted in 1867 as <a href=\\\"/place/Austria-Hungary\\\">Austria-Hungary</a>, with Croatia-Slavonia placed under the rule of Hungary and with Dalmatia, <span></span><a href=\\\"/place/Istria\\\">Istria</a>, and the Military Frontier remaining under <a href=\\\"/place/Vienna\\\">Vienna</a>. Under an 1868 agreement between Croatia and Hungary, known as the <span></span><a href=\\\"/event/Nagodba\\\">Nagodba</a>, Croatian statehood was formally recognized, but Croatia was in fact stripped of all real control over its affairs. The Sabor requested that Bosnia and Herzegovina, under Habsburg occupation from 1878, be incorporated into Croatia on the grounds that those lands had been part of the <a href=\\\"https://www.merriam-webster.com/dictionary/medieval\\\" data-dictionary-link-target=\\\"medieval\\\">medieval</a> kingdom. The request was rejected, but the Military Frontier was rejoined to Croatia in 1881. In the following decades, Hungarian domination of Croatian politics was maintained by Ban Károly Khuen-Héderváry, a Hungarian magnate, and supported by those in Croatia who favoured cooperation with <a href=\\\"/place/Budapest\\\">Budapest</a>. The government also gained support through <a href=\\\"https://www.merriam-webster.com/dictionary/concessions\\\" data-dictionary-link-target=\\\"concessions\\\">concessions</a> to the Serbs, who, with the incorporation of the Military Frontier, had become a larger proportion of Croatia’s population. These changes increased Croat-Serb antagonism in Croatia, as did the Croatian opposition’s demands for greater Croatian autonomy.\"},{\"tagName\":\"P\",\"html\":\"However, the crisis of Austro-Hungarian dualism and the accession of the Russophilic <span></span><a href=\\\"/topic/Karadjordjevic-dynasty\\\">Karadjordjević dynasty</a> in <a href=\\\"/place/Serbia\\\">Serbia</a> in 1903 created a more favourable climate for cooperation, embodied in the <span></span>Croat-Serb Coalition of political parties. Launched by the Rijeka Resolution of 1905, the coalition emphasized the links between Croats and Serbs, and in the following years it attracted wide support. Discontent with the existing order contributed to the growing belief that the problems of Croatia could best be solved in a South Slav state, either within Austria-Hungary or outside it—although there was disagreement about what shape such a state would take and about the status of its <a href=\\\"https://www.merriam-webster.com/dictionary/constituent\\\" data-dictionary-link-target=\\\"constituent\\\">constituent</a> nationalities.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref223954\",\"sidebarHeader\":\"From World War I to the establishment of the Kingdom of Serbs, Croats, and Slovenes\",\"header\":\"From World War I to the establishment of the Kingdom of Serbs, Croats, and Slovenes\",\"elements\":[{\"tagName\":\"P\",\"html\":\"New solutions to <span></span><a href=\\\"/topic/history-of-Croatia\\\">Croatia</a>’s problems became possible with the dissolution of Austria-Hungary during <a href=\\\"/event/World-War-I\\\">World War I</a>. However, Croatia’s postwar future was threatened by the 1915 <span></span><a href=\\\"/event/Treaty-of-London\\\">Treaty of London</a>, which promised <span></span><a href=\\\"/topic/history-of-Italy\\\">Italy</a> extensive Habsburg territories on the Adriatic in return for entering the war on the <a href=\\\"/topic/Allied-Powers-international-alliance\\\">Allied</a> side. Representatives of the Habsburg South Slavs in exile, led by the former Croat-Serb Coalition politicians <span></span><a href=\\\"/biography/Ante-Trumbic\\\">Ante Trumbić</a> and <span></span><a href=\\\"/biography/Frano-Supilo\\\">Frano Supilo</a>, set up the Yugoslav Committee to promote the cause of a new Yugoslav state that was to be based on the national unity of the South Slavs and on the principle of self-determination. In July 1917 the leaders of the Yugoslav Committee and representatives of the Serbian government-in-exile signed the <span></span><a href=\\\"/event/Corfu-Declaration\\\">Corfu Declaration</a>, announcing the intention of founding at the end of the war a unified South Slav state, conceived of as a democratic, constitutional, and parliamentary monarchy under the Karadjordjević dynasty. The agreement with Serbia would save Croatia from being partitioned by the Allies as part of vanquished Austria-Hungary, but the declaration did not specify whether the new state would be a federation of equal partners or would merely represent an extension of the Serbian administrative system.\"},{\"tagName\":\"P\",\"html\":\"At the same time, a movement for unification developed among South Slav politicians still living under Habsburg authority in Croatia. With the Habsburg monarchy collapsing, the peasantry in revolt, and the Serbian and Italian armies advancing toward Croatian territory, the Croatian Sabor voted in October 1918 to break relations with <span></span><a href=\\\"/topic/history-of-Austria\\\">Austria</a>-<span></span><a href=\\\"/topic/history-of-Hungary\\\">Hungary</a> and declared the unification of the lands of Croatia, Dalmatia, and Slavonia in an independent Croatian state. Soon, however, the Sabor announced the incorporation of Croatia into a South Slav state and transferred its power to the newly created <span></span>National Council of Slovenes, Croats, and Serbs in <a href=\\\"/place/Zagreb\\\">Zagreb</a>. One dissenting voice was that of <span></span><a href=\\\"/biography/Stjepan-Radic\\\">Stjepan Radić</a>, leader of the <span></span><a href=\\\"/topic/Croatian-Peasant-Party\\\">Croatian Peasant Party</a>, who opposed unconditional unification with no reference to the will of the people of Croatia and with no guarantees of national equality in the future state. Notwithstanding the Peasant Party’s objections, in November 1918 representatives of the National Council, the Yugoslav Committee, and the Serbian government signed the Geneva declaration calling for the establishment of a South <span></span><a href=\\\"/topic/Slav\\\">Slav</a> state with a form of government to be decided by a national Constituent Assembly. On December 1, 1918, delegates of the National Council met Serbia’s regent, <span></span><a href=\\\"/biography/Alexander-I-king-of-Yugoslavia\\\">Alexander I</a>, to <a href=\\\"https://www.merriam-webster.com/dictionary/affiliate\\\" data-dictionary-link-target=\\\"affiliate\\\">affiliate</a> themselves to the <a href=\\\"/place/Kingdom-of-Serbs-Croats-and-Slovenes\\\">Kingdom of Serbs, Croats, and Slovenes</a>.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref223955\",\"sidebarHeader\":\"Croatia in Yugoslavia, 1918–41\",\"header\":\"Croatia in Yugoslavia, 1918–41\",\"elements\":[{\"tagName\":\"P\",\"html\":\"In many respects, the <span></span><a href=\\\"/place/Kingdom-of-Serbs-Croats-and-Slovenes\\\">Kingdom of Serbs, Croats, and Slovenes</a> represented an expansion of Serbian <a href=\\\"https://www.merriam-webster.com/dictionary/hegemony\\\" data-dictionary-link-target=\\\"hegemony\\\">hegemony</a> over new territories, particularly in <a href=\\\"/place/Kosovo\\\">Kosovo</a> and <a href=\\\"/place/Macedonia\\\">Macedonia</a>. In Croatia, discontent with the new state was demonstrated by the massive electoral success of Radić’s Croatian Peasant Party. Refusing to accept the unification act, Radić called instead for an independent Croatian peasant republic. In elections to the Constituent Assembly in 1920, his party received the fourth largest bloc of votes, but Radić <a href=\\\"https://www.merriam-webster.com/dictionary/boycotted\\\" data-dictionary-link-target=\\\"boycotted\\\">boycotted</a> the assembly, thus making possible the adoption of a constitution in 1921 that imposed a highly centralized administration on the new state. In the following decade the kingdom’s multiparty parliament came to be controlled by Serbian centralists, while Croatia’s elected representatives, led by Radić and the Peasant Party, continued to demand a federal system that would allow Croatia autonomy. The parliament made some progress in <a href=\\\"/topic/land-reform\\\">agrarian reform</a>, with peasants receiving land expropriated from large estates. However, by 1928, when Radić and four other Croatian deputies were assassinated on the floor of the parliament by a Montenegrin deputy, national conflict had brought the <a href=\\\"/topic/political-system\\\">political system</a> to a standstill.\"},{\"tagName\":\"P\",\"html\":\"Under the dictatorship established in 1929, King Alexander attempted to override ethnic divisions by introducing a supranational patriotism symbolized by the new name of <a href=\\\"/place/Yugoslavia-former-federated-nation-1929-2003\\\">Yugoslavia</a>. The internal borders of the country were redrawn, so that historical Croatia was subdivided into several new <em>banovine</em> (provinces) named after rivers and natural features. However, Croatian nationalism and opposition to the state system were not <a href=\\\"https://www.merriam-webster.com/dictionary/eradicated\\\" data-dictionary-link-target=\\\"eradicated\\\">eradicated</a> by this policy of unitarism—and neither was Serbian hegemony, which simply continued under the name of Yugoslavism. Political repression bred extremism among some opponents of the regime. In 1934 <span></span><a href=\\\"/biography/Alexander-I-king-of-Yugoslavia\\\">Alexander</a> was assassinated as the result of a plot hatched by the Croatian <span></span><a href=\\\"/topic/Ustasa\\\">Ustaša</a> (“Insurgence”), a separatist association founded in 1929 by <span></span><a href=\\\"/biography/Ante-Pavelic\\\">Ante Pavelić</a> and enjoying the support of Italy’s fascist leader, <a href=\\\"/biography/Benito-Mussolini\\\">Benito Mussolini</a>. Unlike the majority of Croats, who still believed in a federal solution, members of the Ustaša insisted that only the destruction of Yugoslavia could liberate Croatia.\"},{\"tagName\":\"P\",\"html\":\"The new Yugoslav regent, Prince <a href=\\\"/biography/Prince-Paul-Karadjordjevic\\\">Paul Karadjordjević</a>, permitted some relaxation in political life, though he prevented the restoration of full democratic rights. The desire for political change led to the formation of a united Yugoslav opposition, which argued for the reinstatement of <a href=\\\"https://www.merriam-webster.com/dictionary/democracy\\\" data-dictionary-link-target=\\\"democracy\\\">democracy</a> and for constitutional reform. In Croatia this opposition included the Peasant Party, now led by <span></span><a href=\\\"/biography/Vladko-Macek\\\">Vladko Maček</a>. In the elections of 1938, the <span></span><a href=\\\"/topic/Croatian-Peasant-Party\\\">Peasant Party</a> received 80 percent of the vote in Croatia and Dalmatia. Faced with such evidence of popular support for the opposition program, Prince Paul encouraged negotiations between the government and Maček. These culminated in the <span></span><a href=\\\"/topic/Sporazum\\\">Sporazum</a> (“Agreement”) of <a href=\\\"https://www.merriam-webster.com/dictionary/August\\\" data-dictionary-link-target=\\\"August\\\">August</a> 26, 1939, which created an <a href=\\\"https://www.merriam-webster.com/dictionary/autonomous\\\" data-dictionary-link-target=\\\"autonomous\\\">autonomous</a> Croatian <em>banovina</em> that was largely self-governing except in defense and foreign affairs. The agreement provoked resentment among the Serbs, even in the opposition.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref223956\",\"sidebarHeader\":\"World War II\",\"header\":\"World War II\",\"elements\":[{\"tagName\":\"P\",\"html\":\"War broke out soon after the Sporazum was signed, and Yugoslavia declared its neutrality. Invasion, occupation, and partition followed in 1941. In their campaign against Yugoslavia, the <span></span><a href=\\\"/topic/history-of-Germany\\\">Germans</a> exploited Croatian discontent, presenting themselves as liberators and inciting Croats in the armed forces to mutiny. In April 1941 Germans and Italians set up the Independent State of Croatia, which also embraced Bosnia and Herzegovina and those parts of Dalmatia that had not been ceded to Italy. Though in fact this state was under occupation by the German and <span></span><a href=\\\"/topic/history-of-Italy\\\">Italian</a> armies, Pavelić’s Ustaša was put into power—a takeover facilitated by the refusal of Maček to take part in a puppet government and by the passivity of the Roman Catholic archbishop of Zagreb, Alojzije Stepinac. Initially there was enthusiasm for the independent state, but once in power the Ustaša ruthlessly persecuted Serbs, Jews, Roma (Gypsies), and antifascist Croats. The Ustaša planned to eliminate Croatia’s Serb minority partly by conversion from Orthodoxy to Catholicism, partly by expulsion, and partly by extermination. As many as 350,000 to 450,000 victims were killed in Ustaša massacres and in the <a href=\\\"https://www.merriam-webster.com/dictionary/notorious\\\" data-dictionary-link-target=\\\"notorious\\\">notorious</a> <a href=\\\"/topic/concentration-camp\\\">concentration camp</a> at Jasenovac.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/21/115621-004-95CAC9BA.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"Sporadic resistance, particularly by Croatia’s Serbs, began almost immediately, but it was the communist <a href=\\\"/topic/Partisan-Yugoslavian-military-force\\\">Partisans</a>, under <span></span><a href=\\\"/biography/Josip-Broz-Tito\\\">Josip Broz Tito</a> (himself a Croat), who provided the resistance with leadership and a program. Croatian Serbs joined the Partisans in flight from Ustaša terror. Antifascist Croats subsequently were attracted by the Partisans’ broad popular front and by their emphasis on national self-determination, particularly the proposed reordering of postwar Yugoslavia along federal lines. Mass enlistment in their ranks made the Partisans more successful in Croatia and in Bosnia and Herzegovina than anywhere else outside their mountain strongholds. By 1944 most of Croatia—apart from the main cities—was liberated territory, and Croats were joining the Partisans’ ranks in <a href=\\\"/topic/large-numbers-1765137\\\">large numbers</a>. As the war neared its end, however, many Croats, especially those compromised by involvement with the Ustaša regime and those who opposed the communists, fled north along with other refugees toward the Allied armies. British commanders refused to accept their surrender and handed them over to the Partisans, who took a merciless revenge. Tens of thousands, including some civilians, were subsequently slaughtered on forced marches and in death camps.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref223957\",\"sidebarHeader\":\"Croatia in Yugoslavia, 1945–91\",\"header\":\"Croatia in Yugoslavia, 1945–91\",\"elements\":[{\"tagName\":\"P\",\"html\":\"After 1945 Croatia was a republic within the Socialist Federal Republic of Yugoslavia. This new federation was intended to satisfy the national <a href=\\\"https://www.merriam-webster.com/dictionary/aspirations\\\" data-dictionary-link-target=\\\"aspirations\\\">aspirations</a> of all its peoples, but a centrally controlled <span></span><a href=\\\"/topic/communism\\\">Communist</a> Party and a supranational push for Yugoslav unity undermined this structure. The effects were felt in Croatia in such matters as the purge in 1948 of the Croatian communist Andrija Hebrang and others who had supported first Croatian national interests and then the Soviet side in Tito’s split with <a href=\\\"/biography/Joseph-Stalin\\\">Joseph Stalin</a>. A later issue was the Partisan-based Serb predominance in the Yugoslav army and the local Croatian police. By the 1960s Croats had grown increasingly critical of the economic centralization that appropriated part of the republic’s income for investment in other parts of the federation.\"},{\"tagName\":\"P\",\"html\":\"Beginning in the early 1960s, the Yugoslav government instituted a number of economic reforms and attempts at political liberalization and decentralization. Encouraged in Croatia by a reformist party leadership under Miko Tripalo and Savka Dabčević-Kučar, these reforms contributed to the flowering of a “Croatian Spring” in 1969–71. The movement took the shape of a cultural and <span></span><a href=\\\"/topic/nationalism\\\">national</a> revival, expressed in large part through the activities of the cultural organization Matica Hrvatska, but it soon culminated in calls for greater Croatian autonomy. Warning of the danger of civil war, <span></span><a href=\\\"/biography/Josip-Broz-Tito\\\">Tito</a> intervened and reimposed “democratic centralism” through a series of purges and trials that decimated the ranks of Croatian politicians and intellectuals. The political restrictions were not <a href=\\\"https://www.merriam-webster.com/dictionary/alleviated\\\" data-dictionary-link-target=\\\"alleviated\\\">alleviated</a> by the 1974 Yugoslav constitution: although the republics gained greater autonomy within the federation, they were still controlled by their single-party regimes.\"},{\"tagName\":\"P\",\"html\":\"This centralized control began to break down in the late 1980s, however. In 1989, as communist hegemony was challenged throughout eastern Europe, the Slovene and Croatian communists agreed to free multiparty elections. The right-wing, nationalist <span></span><a href=\\\"/topic/Croatian-Democratic-Union\\\">Croatian Democratic Union</a> (Hrvatska Demokratska Zajednica; HDZ), led by <span></span><a href=\\\"/biography/Franjo-Tudjman\\\">Franjo Tudjman</a> (a former party member who had been jailed during the suppression of the Croatian Spring), was victorious in the <span></span><a href=\\\"/topic/Croat\\\">Croatian</a> elections of 1990. The <span></span><a href=\\\"/topic/Serb\\\">Serb</a> minority was deeply alarmed by Croatia’s new constitution (promulgated in December 1990), which omitted Serbs as a “constituent people,” and by the actions of the new government, which purged Serbs from <a href=\\\"/topic/public-administration\\\">public administration</a>, especially the police. Serbs’ fears also were aroused by accusations, especially from <a href=\\\"/place/Belgrade\\\">Belgrade</a>, that Croatian nationalism meant a return to fascism and the anti-Serb violence of World War II.\"},{\"tagName\":\"P\",\"html\":\"When independence was declared on June 25, 1991, armed clashes spread in protest throughout Serb enclaves in Croatia. This violence coincided with the hasty withdrawal of the <span></span><a href=\\\"/topic/Yugoslav-Peoples-Army\\\">Yugoslav People’s Army</a> from a newly independent <a href=\\\"/place/Slovenia\\\">Slovenia</a>. Turning to oppose Croatia’s independence, a larger <a href=\\\"https://www.merriam-webster.com/dictionary/contingent\\\" data-dictionary-link-target=\\\"contingent\\\">contingent</a> of army forces attacked the new regime. In the ensuing war, the city of Vukovar in <a href=\\\"/place/Slavonia\\\">Slavonia</a> was leveled by bombardment, <a href=\\\"/place/Dubrovnik\\\">Dubrovnik</a> and other <span></span><a href=\\\"/place/Dalmatia\\\">Dalmatian</a> cities were shelled, and about one-third of Croatian territory was occupied by Yugoslav forces. Warfare was halted by an agreement whereby European troops, sponsored by the <a href=\\\"/topic/United-Nations\\\">United Nations</a> (UN), were installed in the disputed areas in order to stabilize and demilitarize them. Although Croatia was granted international recognition in 1992, the government’s control over its own territories remained incomplete.\"}],\"sections\":[],\"isFilled\":true},{\"level\":2,\"id\":\"ref284760\",\"sidebarHeader\":\"Independent Croatia\",\"header\":\"Independent Croatia\",\"elements\":[{\"tagName\":\"P\",\"html\":\"In May and August 1995 two Croatian military offensives regained control of western Slavonia and central Croatia from rebel Serbs. Croatia was disappointed, however, when in November the U.S.-brokered <a href=\\\"/event/Dayton-Accords\\\">Dayton Accords</a> failed to provide a clear timetable for the return of eastern Slavonia to Zagreb’s control. In 1996 <a href=\\\"/biography/Slobodan-Milosevic\\\">Slobodan Milošević</a>, Serbia’s president and the effective leader of the rump Yugoslavia, agreed to give up claims to eastern Slavonia. Yugoslav troops then withdrew from the region under a UN <a href=\\\"https://www.merriam-webster.com/dictionary/mandate\\\" data-dictionary-link-target=\\\"mandate\\\">mandate</a>, and Yugoslavia established full diplomatic relations with Croatia. Croatia recovered full <a href=\\\"https://www.merriam-webster.com/dictionary/sovereignty\\\" data-dictionary-link-target=\\\"sovereignty\\\">sovereignty</a> over eastern Slavonia in 1998, and, with the withdrawal of UN troops from the Prelavka Peninsula in 2002, Croatia finally had full control of its territory.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/70/135670-004-DA1E444F.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"Tudjman died in December 1999, and <span></span><a href=\\\"/biography/Stipe-Mesic\\\">Stipe Mesić</a>, who had broken with the HDZ over Tudjman’s autocratic rule, was elected president in February 2000. Mesić quickly moved to cut down corruption and to improve Croatia’s relations with its neighbours, but he failed to deliver on promises of early entry to the <span></span><a href=\\\"/topic/North-Atlantic-Treaty-Organization\\\">North Atlantic Treaty Organization</a> (NATO) or the <span></span><a href=\\\"/topic/European-Union\\\">European Union</a> (EU). Croatia continued to suffer deep economic and political divisions, particularly over cooperation with the <span></span><a href=\\\"/topic/International-Criminal-Tribunal-for-the-Former-Yugoslavia\\\">International Criminal Tribunal for the Former Yugoslavia</a> (ICTY), which indicted several Croatian generals who, according to many Croats, had heroic wartime reputations.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/30/127930-004-DF12FC44.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"With the success of the HDZ in the 2003 parliamentary elections, Croatia’s broad-based <a href=\\\"/topic/coalition-government\\\">coalition government</a> fell, and HDZ leader Ivo Sanader became prime minister of a new centre-right government. In 2004 Croatia became an official EU candidate, but negotiations were postponed in 2005 after the ICTY raised concerns about the country’s commitment to bringing war criminals to <a href=\\\"https://www.merriam-webster.com/dictionary/justice\\\" data-dictionary-link-target=\\\"justice\\\">justice</a>. EU officials also questioned Croatia’s dedication to eliminating corruption. By the following year, however, several key suspects had been arrested or tried for war crimes, and the government had adopted a strong anticorruption strategy. These developments <a href=\\\"https://www.merriam-webster.com/dictionary/bolstered\\\" data-dictionary-link-target=\\\"bolstered\\\">bolstered</a> hopes that Croatia could join the EU by the end of the decade. Meanwhile, the country’s economy, helped by the spectacular growth of tourism, began to improve. The status of the much-reduced Serb minority also was boosted by the inclusion of an ethnic Serb in the cabinet of the HDZ-led coalition government that came to power in 2008. On April 1, 2009, NATO officially welcomed Croatia as a member of the alliance.\"},{\"tagName\":\"P\",\"html\":\"By mid-2009 the outlook was not as promising. Although neighbouring <a href=\\\"/place/Slovenia\\\">Slovenia</a>—a member of both NATO and the EU—had agreed to Croatia’s NATO membership, it continued to block Croatian accession negotiations with the EU, claiming that the countries’ ongoing border dispute needed to be resolved first. (The dispute, focused on the maritime border in the Bay of Piran, had originated in 1991 when both countries seceded from Yugoslavia.) Adding to Croatia’s problems, the growing global financial crisis caused the economy to contract sharply during the first half of 2009, and by the end of the year it had suffered a decline of 6 percent of <a href=\\\"/topic/gross-domestic-product\\\">gross domestic product</a>. Croatia faced yet another hurdle when Prime Minister Sanader resigned on July 1, 2009. Fellow HDZ member <span></span>Jadranka Kosor, who had been serving as deputy prime minister, succeeded Sanader. She was the first woman to hold the Croatian prime ministership.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/29/133729-004-DC385D49.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"In January 2010 <span></span>Ivo Josipović, a member of the opposition Social Democratic Party of Croatia (Socijaldemokratska partija Hrvatske; SDP), was elected president. Despite his political differences with the ruling HDZ, he promised to support Prime Minister Kosor’s goals of expediting EU membership talks and fighting corruption. Nevertheless, the relative inexperience of the two new leaders and the jockeying of their parties for advantage in the 2011 parliamentary elections kept their differences in play. The HDZ’s continued emphasis on an exclusively Croatian national identity and history still separated its adherents from many younger urban voters and the remaining Serb minority. Some HDZ supporters, for instance, objected to the public apology that Josipović made in April 2010 to Bosnia and Herzegovina for Croatia’s role in the warfare there in the early 1990s. Meanwhile, the SDP was drawn into the public’s continued concerns about EU membership when one of the party’s major supporters, a large public employees’ union, objected to labour-related conditions imposed by the EU on prospective members. The objections slowed the full-scale labour reform that would be needed for EU accession. Larger concerns for EU accession, however, remained judicial reform in general and the conclusion of several corruption trials in particular. Still, the fact that both major parties and the respected Croatian National Bank supported membership in the EU was a major advantage in the accession process, which had gained momentum after November 2009, when Slovenia and Croatia agreed to have their border dispute settled by international arbitration.\"},{\"tagName\":\"P\",\"html\":\"After more than a decade of effort and six years of formal talks, the accession process reached a final milestone in June 2011, when Croatia closed negotiations with the EU. This accomplishment did little to <a href=\\\"https://www.merriam-webster.com/dictionary/bolster\\\" data-dictionary-link-target=\\\"bolster\\\">bolster</a> public approval of the HDZ, however, as corruption scandals—the most notable involving former prime minister Sanader—bogged down the party throughout the year. Croatia also struggled with the economic <a href=\\\"https://www.merriam-webster.com/dictionary/malaise\\\" data-dictionary-link-target=\\\"malaise\\\">malaise</a> that had afflicted the rest of Europe, and, like ruling parties across the continent throughout 2011, the HDZ suffered for it at the polls. In the general election on December 4, 2011, the opposition <span></span>Kukuriku coalition, headed by <span></span>Zoran Milanović of the SDP, swept the HDZ from power and claimed an overall majority in parliament, winning 80 of 151 seats. Just days after the election, as Milanović began the work of constructing his government, Croatia signed the accession treaty that would enable it to join the EU in 2013. In a referendum held in January 2012, accession received approval from two-thirds of Croatian voters, but voter turnout, at 43.6 percent, marked the lowest level of participation for any poll on EU entry. Nevertheless, thousands celebrated in Zagreb on July 1, 2013, when Croatia completed its decadelong accession journey to become the 28th member of the EU.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/71/172271-004-F96B9198.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"While full EU membership opened the door to financial assistance, Croatia did not make effective use of EU structural funds to help improve its business climate, and the country faced its sixth consecutive year of recession in 2014. As public finances deteriorated, investor confidence weakened, and Croatia’s <a href=\\\"https://www.merriam-webster.com/dictionary/sovereign\\\" data-dictionary-link-target=\\\"sovereign\\\">sovereign</a> credit rating suffered. Critics blamed successive governments for failing to introduce reform, partly because of public mistrust of market capitalism.\"},{\"tagName\":\"P\",\"html\":\"Opposition candidate <span></span>Kolinda Grabar-Kitarović narrowly topped incumbent Josipović in balloting in January 2015, becoming Croatia’s first woman president. The election was seen as a referendum on Milanović’s centre-left government, and the defeat of Josipović, who had enjoyed widespread popularity throughout much of his term, signaled dissatisfaction with the pace of Croatia’s economic recovery.\"},{\"tagName\":\"IMG\",\"html\":\"<img src=\\\"https://cdn.britannica.com/s:700x450/43/193043-004-A4E36B08.jpg\\\">\"},{\"tagName\":\"P\",\"html\":\"Domestic politics was complicated further by the European migrant crisis, which saw refugees from <a href=\\\"/place/North-Africa\\\">North Africa</a>, the <a href=\\\"/place/Middle-East\\\">Middle East</a>, and <a href=\\\"/place/Afghanistan\\\">Afghanistan</a> attempting to transit Croatia en route to northern Europe. As neighbouring countries enacted tighter border restrictions, tens of thousands of migrants became trapped in Croatia. In early November 2015 the <a href=\\\"/topic/European-Commission\\\">European Commission</a> offered $18 million in emergency funding to help pay for police officers <a href=\\\"https://www.merriam-webster.com/dictionary/deployed\\\" data-dictionary-link-target=\\\"deployed\\\">deployed</a> along the Croatian-Serbian border and to fund temporary detention centres. By that point, well over 300,000 migrants had entered Croatia.\"},{\"tagName\":\"P\",\"html\":\"Parliamentary elections held on November 8, 2015, were inconclusive, with the HDZ and SDP finishing in a dead heat. Elsewhere in Europe, far right parties had capitalized on the migrant crisis by stoking nationalist <a href=\\\"https://www.merriam-webster.com/dictionary/sentiment\\\" data-dictionary-link-target=\\\"sentiment\\\">sentiment</a>, but Croatian voters largely supported Milanović’s evenhanded response, and that enabled the SDP to cut into the HDZ’s pre-election lead. Weeks of coalition talks followed, with the centrist Bridge of Independent Lists (Most Nezavisnih Lista) ultimately acting as kingmakers for the HDZ. In January 2016 <span></span>Tihomir Orešković was sworn in as the nonpartisan technocratic head of a centre-right coalition government. Orešković, a pharmaceutical <a href=\\\"/topic/executive-government\\\">executive</a> who held dual Croatian and Canadian citizenship, seemingly was chosen for his financial <a href=\\\"https://www.merriam-webster.com/dictionary/acumen\\\" data-dictionary-link-target=\\\"acumen\\\">acumen</a>, as Croatia struggled to maintain the fragile economic recovery that had begun in late 2015.\"},{\"tagName\":\"P\",\"html\":\"After just five months in office, however, Orešković’s government was toppled by a vote of no confidence after a bribery scandal enveloped one of his deputy prime ministers. The HDZ emerged as the winner in snap elections held on September 11, 2016, and the following month HDZ leader <span></span>Andrej Plenković was confirmed as prime minister at the head of a centre-right coalition government. Plenković presided over a healthy economic recovery, but further <a href=\\\"https://www.merriam-webster.com/dictionary/integration\\\" data-dictionary-link-target=\\\"integration\\\">integration</a> with the EU was hindered by Croatia’s ongoing border dispute with Slovenia. In June 2017 the Permanent Court of Arbitration at The Hague ruled in favour of Slovenia, stating that a “junction area” should be created in the <a href=\\\"/place/Adriatic-Sea\\\">Adriatic Sea</a> that would allow Slovenian shipping to pass through waters claimed by Croatia. Plenković rejected the decision as nonbinding and declared that it would not be <a href=\\\"https://www.merriam-webster.com/dictionary/implemented\\\" data-dictionary-link-target=\\\"implemented\\\">implemented</a>.\"},{\"tagName\":\"P\",\"html\":\"Croatia marked the five-year anniversary of its accession to the EU on July 1, 2018. With that landmark came the expiration of labour regulations that had limited the rights of Croatian citizens to pursue work throughout the EU. While many EU members lifted these labour controls on or ahead of that date, several countries, including Austria and Slovenia, elected to extend the restrictions for an additional two years.\"}],\"sections\":[],\"isFilled\":true}],\"isFilled\":true}]}};\n\n//# sourceURL=webpack:///./src/topics/croatia.json?");

